(30, 261, 'Laurence', 'laurencebry@hotmail.fr', '', '78.251.152.41', '2011-02-16 10:45:17', '2011-02-16 10:45:17', 'Bonjour, je voudrais savoir si je peut acheter un billet avec la carte SORTIR? Est ce qu''il y a des tarifs correspondant?\r\nMerci d''avance pour votre réponse. Bonne journée ;)', 0, '1', '', '', 0, 0),
