(33, 261, 'Admin', 'wab2com@gmail.com', '', '82.245.143.62', '2011-02-17 18:47:12', '2011-02-17 18:47:12', 'Salut,\r\n\r\nLa Before est bien vendredi 18 au bistrot de la Cité !\r\nCela dit, si tu cherches un endroit pour prende un verre avant de venir à lUbu, il y a une soirée au Chantier le soir même avec les S''il Te Play.\r\nA Samedi ...', 0, '1', '', '', 32, 1),
(31, 261, 'Admin', 'wab2com@gmail.com', '', '82.245.143.62', '2011-02-16 18:28:30', '2011-02-16 18:28:30', 'Salut Laurence,\r\n\r\nil n''y a pas de tarif spécial pour la "carte sortir" mais seulement  pour la carte "Ubu".\r\n\r\nCependant les places sont à 10€ sur place pour tous ceux qui viennent avant 1h !!\r\n\r\nÀ samedi ...', 0, '1', '', '', 0, 1),
(32, 261, 'Benjamin', 'vick_du_35@hotmail.fr', '', '193.49.124.107', '2011-02-17 16:20:43', '2011-02-17 16:20:43', 'Bonjour,je vois marquer que le before à lieu le vendredi 18 février, est ce une erreur? \r\n\r\nMerci.', 0, '1', '', '', 0, 0),
(29, 244, 'COATLEVEN', 'andre.coatleven@orange.fr', '', '92.135.90.220', '2010-11-15 08:54:16', '2010-11-15 08:54:16', 'Bon diou ! v''la les Charlots déguisés en jeunots qui sont de retour...... ça va chier dans les labours. \r\nMoi dans le genre, je préfère Yvon Etienne, c''est plus drôle. (Y''a aussi Bebert Huchais). \r\nEh ouais les gars, la place est occupée.', 0, '1', '', '', 0, 0),
(34, 84, 'Doume', 'dominique.thual@gmail.com', '', '88.189.240.15', '2011-02-23 11:32:08', '2011-02-23 11:32:08', 'Bon mix les gâs! \r\nDj hell i.d. chire !\r\nBon sinon openfader c une bonne petite organisation!\r\nLes festivaux eletroni[k] ch[a]pô. Happy skull le wik dernier à l''ubu: bonne soirée (perso : lady late me rend b[é]te).\r\n\r\nCiao\r\n\r\nC3Po', 0, '1', '', '', 0, 0),
