nk";a:1:{i:0;a:5:{s:4:"data";s:110:"http://sebastienbosquet.com/8343/wordpress-informer-vos-lecteurs-de-la-fermeture-automatique-des-commentaires/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:119:"http://sebastienbosquet.com/8343/wordpress-informer-vos-lecteurs-de-la-fermeture-automatique-des-commentaires/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 26 Nov 2014 14:15:16 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:2:{i:0;a:5:{s:4:"data";s:9:"Wordpress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:9:"Tutorials";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:35:"http://sebastienbosquet.com/?p=8343";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:738:"<p>Pour empêcher les spammeurs d&#8217;inonder vos vieux articles avec des commentaires inutiles, vous pouvez définir dans WordPress la fermeture des commentaires après un certain nombre de jours : &#160; Certains de vos utilisateurs pourraient être surpris de voir les commentaires fermés automatiquement de sorte qu&#8217;il serait peut-être plus judicieux de les informer sur le temps [&#8230;]</p>\n<p>The post <a rel="nofollow" href="http://sebastienbosquet.com/8343/wordpress-informer-vos-lecteurs-de-la-fermeture-automatique-des-commentaires/">WordPress : Informer vos lecteurs de la fermeture automatique des commentaires</a> appeared first on <a rel="nofollow" href="http://sebastienbosquet.com">Sébastien Bosquet</a>.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:9:"Sebastien";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:2531:"<p>Pour empêcher les spammeurs d&rsquo;inonder vos vieux articles avec des commentaires inutiles, vous pouvez définir dans WordPress la fermeture des commentaires après un certain nombre de jours :<span id="more-8343"></span></p>\n<p><img class="alignnone wp-image-8344 size-medium" src="http://sebastienbosquet.com/wp-content/uploads/2014/11/52522-770x83.jpg" alt="Close comments" width="770" height="83" /></p>\n<p>&nbsp;</p>\n<p>Certains de vos utilisateurs pourraient être surpris de voir les commentaires fermés automatiquement de sorte qu&rsquo;il serait peut-être plus judicieux de les informer sur le temps restant.</p>\n<p>&nbsp;</p>\n<div class="code-embed-wrapper">\n<pre class="language-php code-embed-pre" ><code class="language-php code-embed-code">function time_comment_closes() {\r\n    global $post;\r\n    if ($post-&gt;comment_status == &#039;open&#039;) {\r\n        $close_comments_days_old = get_option( &#039;close_comments_days_old&#039; );\r\n        $expires = strtotime( &quot;{$post-&gt;post_date_gmt} GMT&quot; ) +  $close_comments_days_old * DAY_IN_SECONDS;\r\n        printf( __( &#039;(Les commentaires de cet article se fermeront automatiquement dans %s. )&#039;, &#039;text-domain&#039; ),  human_time_diff( $expires ));\r\n    }\r\n}\r\n\r\nadd_action( &#039;comment_form_top&#039;, &#039;time_comment_closes&#039; );</code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name"></span>\n</div>\n</div>\n<p>&nbsp;</p>\n<p>Bien que le code devrait être presque explicite, il est une fonction intéressante que tous les développeurs WordPress ne connaissent pas, à savoir: <code>human_time_diff ()</code>. Cette fonction est cachée dans le fichier <code>.../wp-includes/formatting.php</code>. Elle est initialement prévue pour être utilisée dans les thèmes afin de fournir une touche plus «humaine» à la date/heure d&rsquo;un message qui a été écrit. Comme la fonction ne se soucie pas de savoir si la date est passé ou futur, nous pouvons l&rsquo;utiliser pour nos besoins.</p>\n<p>&nbsp;</p>\n<p><img class="alignnone size-full wp-image-8345" src="http://sebastienbosquet.com/wp-content/uploads/2014/11/9561981.jpg" alt="9561981" width="770" height="427" /></p>\n<p>The post <a rel="nofollow" href="http://sebastienbosquet.com/8343/wordpress-informer-vos-lecteurs-de-la-fermeture-automatique-des-commentaires/">WordPress : Informer vos lecteurs de la fermeture automatique des commentaires</a> appeared first on <a rel="nofollow" href="http://sebastienbosquet.com">Sébastien Bosquet</a>.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:115:"http://sebastienbosquet.com/8343/wordpress-informer-vos-lecteurs-de-la-fermeture-automatique-des-commentaires/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:1;a:6:{s:4:"data";s:48:"\n		\n		\n		\n		\n		\n				\n		\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:72:"WordPress : Supprimer les Transients périmés de votre base de données";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:101:"http://sebastienbosquet.com/8327/wordpress-supprimer-les-transients-perimes-de-votre-base-de-donnees/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:110:"http://sebastienbosquet.com/8327/wordpress-supprimer-les-transients-perimes-de-votre-base-de-donnees/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 26 Nov 2014 10:55:09 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:3:{i:0;a:5:{s:4:"data";s:9:"Wordpress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:10:"DB Cleaner";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:6:"Plugin";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:35:"http://sebastienbosquet.com/?p=8327";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:717:"<p>Les API transitoires (Transients API) de WordPress offrent un moyen simple et standardisé de stocker des données mises en cache pour un temps défini dans la base de données, après quoi elles expirent. Les Transients ont une date d&#8217;expiration fixe et sont supprimés automatiquement lorsque le délai d&#8217;expiration est atteint. L&#8217;idée étant que vous définissez [&#8230;]</p>\n<p>The post <a rel="nofollow" href="http://sebastienbosquet.com/8327/wordpress-supprimer-les-transients-perimes-de-votre-base-de-donnees/">WordPress : Supprimer les Transients périmés de votre base de données</a> appeared first on <a rel="nofollow" href="http://sebastienbosquet.com">Sébastien Bosquet</a>.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:9:"Sebastien";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:3658:"<p>Les <strong>API transitoires</strong> (Transients API) de WordPress offrent un moyen simple et standardisé de stocker des données mises en cache pour un temps défini dans la base de données, après quoi elles expirent. Les <strong>Transients</strong> ont une date d&rsquo;expiration fixe et sont supprimés automatiquement lorsque le délai d&rsquo;expiration est atteint. L&rsquo;idée étant que vous définissez une date d&rsquo;expiration pour chacun, et que WordPress les supprime automatiquement lorsqu&rsquo;elle est atteinte.</p>\n<p>Jusqu&rsquo;ici tout va bien, non? Pas tout à fait. <span id="more-8327"></span></p>\n<p>Il arrive que les Transients périmés soient effacés correctement de la base de données, mais que la table wp_options devienne conséquente. En creusant un peu, vous pourrez vous apercevoir que certains enregistrements transitoires sont toujours dans la DB, y compris tous ceux qui ont une date d&rsquo;expiration dépassée.</p>\n<p>WordPress ne semble pas gérer la suppression de certains Transients périmés dans la base de données.</p>\n<p>Alors, pourquoi ces données transitoires ne sont pas supprimées automatiquement?</p>\n<p>Avec les WordPress Transients, vous obtenez un comportement différent, mais toujours très indésirable. Parce que les valeurs sont inscrites dans la base de données, pas de taille fixe par bloc de RAM. Ce qui signifie que, même avec un site très chargé, vous avez encore vos données de session.</p>\n<p>Parce que ce ne est pas précisé dans le Transient API lorsque vous utilisez les clés uniques comme pour les sessions. Ce qui se passe avec la méthode intégrée, c&rsquo;est que le tableau des options se remplit indéfiniment! Parce que: le nettoyage des &laquo;&nbsp;anciennes données&nbsp;&raquo; ne fonctionne que lorsque vous demandez la clé. Si vous venez de vider cette clé, les données seront laissée dans la table des options, pour toujours. Il n&rsquo;y a pas processus distinct qui nettoie ces &laquo;&nbsp;up!&nbsp;&raquo;.<br />\nDonc, votre base de données est rempli avec beaucoup de données périmés et redondantes.</p>\n<blockquote><p><strong>Q :</strong> Quelle est la solution pour supprimer automatiquement les Transients ?<br />\n<strong>R :</strong> Il n&rsquo;y en a pas, vraiment.</p></blockquote>\n<p>En d&rsquo;autres termes, vous devez les supprimer vous-même &#8211; mais n&rsquo;ayez crainte &#8211; un Add-on du plugin DB Cleaner vient à la rescousse pour gérer cela a votre place.</p>\n<p>Téléchargez le <strong>plugin DB Purge Transients</strong>, mettez-le dans votre dossier plugins, vérifiez que le plugin DB Cleaner est présent et activez-le dans l&rsquo;admin de WordPress. Maintenant toutes les données transitoires expirées seront supprimées de votre base de données une fois par semaine.</p>\n        <style type="text/css">\n            #button-1{\n                                color:#FFFFFF;\n                                    background-color: #00A8FF;\n                                }\n            #button-1:hover{\n                                        background-color:#838383;\n                            }\n        </style>\n        <a id="button-1" class="button button1 button-small" href="http://sebastienbosquet.com/produits/db-cleaner/" title="DB Purge Transients" >Télécharger</a>\n    \n<p>The post <a rel="nofollow" href="http://sebastienbosquet.com/8327/wordpress-supprimer-les-transients-perimes-de-votre-base-de-donnees/">WordPress : Supprimer les Transients périmés de votre base de données</a> appeared first on <a rel="nofollow" href="http://sebastienbosquet.com">Sébastien Bosquet</a>.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:106:"http://sebastienbosquet.com/8327/wordpress-supprimer-les-transients-perimes-de-votre-base-de-donnees/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:2;a:6:{s:4:"data";s:45:"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:69:"WooCommerce: Comment renommer ou supprimer les onglets des produits ?";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:100:"http://sebastienbosquet.com/8321/woocommerce-comment-renommer-ou-supprimer-les-onglets-des-produits/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:109:"http://sebastienbosquet.com/8321/woocommerce-comment-renommer-ou-supprimer-les-onglets-des-produits/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 24 Nov 2014 15:56:04 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:2:{i:0;a:5:{s:4:"data";s:11:"WooCommerce";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:9:"Tutorials";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:35:"http://sebastienbosquet.com/?p=8321";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:723:"<p>Par défaut, WooCommerce affiche sous chaque produit  jusqu&#8217;à trois onglets en dessous de la zone du contenu principal. Description : affiche le contenu que vous tapez dans l&#8217;éditeur de texte, ou dans la «Description courte du produit&#160;&#187;, qui agit de la même façon que les Extraits dans WordPress. Informations complémentaires (Additional Information) : apparaît si [&#8230;]</p>\n<p>The post <a rel="nofollow" href="http://sebastienbosquet.com/8321/woocommerce-comment-renommer-ou-supprimer-les-onglets-des-produits/">WooCommerce: Comment renommer ou supprimer les onglets des produits ?</a> appeared first on <a rel="nofollow" href="http://sebastienbosquet.com">Sébastien Bosquet</a>.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:9:"Sebastien";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:3598:"<p>Par défaut, WooCommerce affiche sous chaque produit  jusqu&rsquo;à trois onglets en dessous de la zone du contenu principal.</p>\n<p><strong>Description</strong> : affiche le contenu que vous tapez dans l&rsquo;éditeur de texte, ou dans la «Description courte du produit&nbsp;&raquo;, qui agit de la même façon que les Extraits dans WordPress.</p>\n<p><strong>Informations complémentaires</strong> (Additional Information) : apparaît si votre produit a des attributs tels que la couleur, la taille, etc.</p>\n<p><strong>Avis</strong> (Reviews) : contient la liste des derniers avis ou commentaires.<span id="more-8321"></span></p>\n<p><img class="alignnone size-full wp-image-8322" src="http://sebastienbosquet.com/wp-content/uploads/2014/11/onglets-WooCommerce.png" alt="Onglets WooCommerce" width="577" height="99" /></p>\n<p>Vous pouvez <strong>renommer</strong> l&rsquo;un de ces onglets pour l&rsquo;adapter à votre boutique ou <strong>l’empêcher de s&rsquo;afficher</strong>. Cependant, il n&rsquo;existe aucun paramètre pour ce faire, dans WooCommerce.</p>\n<p>L&rsquo;exemple suivant montre comment renommer l&rsquo;onglet <strong>Description</strong> par <strong>En savoir plus</strong> dans le cas où vous souhaitez utiliser le champ Description pour ajouter du contenu spécial distinct du contenu principal du produit dans l&rsquo;éditeur de texte.</p>\n<p>Ajoutez le code suivant dans le fichier <span style="color: #000000;">functions.php</span> de votre thème :</p>\n<div class="code-embed-wrapper">\n<pre class="language-php code-embed-pre" ><code class="language-php code-embed-code">/** Rename product tabs in WooCommerce **/\r\n\r\nfunction woo_rename_product_tab_sb($tabs) {\r\n	\r\n$tabs[&#039;description&#039;][&#039;title&#039;] = &#039;En Savoir Plus&#039;;return $tabs; // Rename the description tab\r\n\r\n}\r\nadd_filter( &#039;woocommerce_product_tabs_sb&#039;, &#039;woo_rename_tab&#039;, 98);</code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name"></span>\n</div>\n</div>\n<p>L&rsquo;exemple suivant montre comment supprimer l&rsquo;onglet <strong>Informations complémentaires</strong> dans le cas où vous ne souhaitez pas l&rsquo;utiliser.</p>\n<p>Ajoutez le code suivant dans le fichier <span style="color: #000000;">functions.php</span> de votre thème :</p>\n<div class="code-embed-wrapper">\n<pre class="language-php code-embed-pre" ><code class="language-php code-embed-code">/** Remove product tabs in WooCommerce **/\r\n\r\nfunction woo_remove_product_tab_sb($tabs) {\r\n\r\n    unset( $tabs[&#039;additional_information&#039;] );  	// Remove the additional information tab\r\n\r\n 	return $tabs;\r\n \r\n}\r\nadd_filter( &#039;woocommerce_product_tabs&#039;, &#039;woo_remove_product_tab_sb&#039;, 98);</code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name"></span>\n</div>\n</div>\n<p>Pour supprimer les deux autres onglets vous pouvez ajouter les lignes suivantes :</p>\n<div class="code-embed-wrapper">\n<pre class="language-php code-embed-pre" ><code class="language-php code-embed-code">unset( $tabs[&#039;description&#039;] );      		// Remove the description tab\r\n    unset( $tabs[&#039;reviews&#039;] ); 					// Remove the reviews tab</code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name"></span>\n</div>\n</div>\n<p>The post <a rel="nofollow" href="http://sebastienbosquet.com/8321/woocommerce-comment-renommer-ou-supprimer-les-onglets-des-produits/">WooCommerce: Comment renommer ou supprimer les onglets des produits ?</a> appeared first on <a rel="nofollow" href="http://sebastienbosquet.com">Sébastien Bosquet</a>.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:105:"http://sebastienbosquet.com/8321/woocommerce-comment-renommer-ou-supprimer-les-onglets-des-produits/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:3;a:6:{s:4:"data";s:45:"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:67:"Ajouter le Pseudonyme de votre client dans l’admin de la commande";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:98:"http://sebastienbosquet.com/8317/ajouter-le-pseudonyme-de-votre-client-dans-ladmin-de-la-commande/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:107:"http://sebastienbosquet.com/8317/ajouter-le-pseudonyme-de-votre-client-dans-ladmin-de-la-commande/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 24 Nov 2014 11:07:16 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:2:{i:0;a:5:{s:4:"data";s:11:"WooCommerce";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:9:"Tutorials";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:35:"http://sebastienbosquet.com/?p=8317";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:709:"<p>Lors de la visualisation ou de la modification d&#8217;une commande dans WooCommerce, il peut être très pratique d&#8217;ajouter des données personnalisées sur la page pour éviter d&#8217;avoir à changer de page pour les rechercher. Voici un exemple d&#8217;ajout de données qui va afficher sur la page voir/modifier la commande dans la partie administration, le Pseudonyme [&#8230;]</p>\n<p>The post <a rel="nofollow" href="http://sebastienbosquet.com/8317/ajouter-le-pseudonyme-de-votre-client-dans-ladmin-de-la-commande/">Ajouter le Pseudonyme de votre client dans l&rsquo;admin de la commande</a> appeared first on <a rel="nofollow" href="http://sebastienbosquet.com">Sébastien Bosquet</a>.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:9:"Sebastien";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:2069:"<p>Lors de la visualisation ou de la modification d&rsquo;une commande dans WooCommerce, il peut être très pratique d&rsquo;ajouter des données personnalisées sur la page pour éviter d&rsquo;avoir à changer de page pour les rechercher. Voici un exemple d&rsquo;ajout de données qui va afficher sur la page voir/modifier la commande dans la partie administration, le <strong>Pseudonyme (Username)</strong> du client et un lien vers son profil d&rsquo;utilisateur.<span id="more-8317"></span></p>\n<p><img class="alignnone size-medium wp-image-8318" src="http://sebastienbosquet.com/wp-content/uploads/2014/11/65165156165-770x427.jpg" alt="WooUsername" width="770" height="427" /></p>\n<p>Si vous souhaitez ajouter le Pseudonyme (Username) de votre client, placez dans le fichier functions.php de votre thème le code suivant :</p>\n<div class="code-embed-wrapper">\n<pre class="language-php code-embed-pre" ><code class="language-php code-embed-code">/*** Customer Username ***/\r\n\r\n// Add WooCommerce customer username to edit/view order admin page\r\nadd_action( &#039;woocommerce_admin_order_data_after_billing_address&#039;, &#039;woo_display_order_customer_username&#039;, 10, 1 );\r\n \r\nfunction woo_display_order_customer_username( $order ){\r\n \r\nglobal $post;\r\n$customer_user = get_post_meta( $post-&gt;ID, &#039;_customer_user&#039;, true );\r\necho &#039;&lt;p&gt;&lt;strong style=&quot;display: block;&quot;&gt;&#039;.__(&#039;Pseudonyme&#039;).&#039;:&lt;/strong&gt; &lt;a href=&quot;user-edit.php?user_id=&#039; . $customer_user . &#039;&quot;&gt;&#039; . get_user_meta( $customer_user, &#039;nickname&#039;, true ) . &#039;&lt;/a&gt;&lt;/p&gt;&#039;;\r\n}</code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name"></span>\n</div>\n</div>\n<p>The post <a rel="nofollow" href="http://sebastienbosquet.com/8317/ajouter-le-pseudonyme-de-votre-client-dans-ladmin-de-la-commande/">Ajouter le Pseudonyme de votre client dans l&rsquo;admin de la commande</a> appeared first on <a rel="nofollow" href="http://sebastienbosquet.com">Sébastien Bosquet</a>.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:103:"http://sebastienbosquet.com/8317/ajouter-le-pseudonyme-de-votre-client-dans-ladmin-de-la-commande/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:4;a:6:{s:4:"data";s:51:"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:54:"Plugin WordPress DB Cleaner – Nouvelle version 2.9.x";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:84:"http://sebastienbosquet.com/8306/plugin-wordpress-db-cleaner-nouvelle-version-2-9-x/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:93:"http://sebastienbosquet.com/8306/plugin-wordpress-db-cleaner-nouvelle-version-2-9-x/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 20 Nov 2014 13:51:51 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:4:{i:0;a:5:{s:4:"data";s:9:"Wordpress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:6:"Plugin";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:13:"Requêtes SQL";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:3;a:5:{s:4:"data";s:3:"SQL";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:35:"http://sebastienbosquet.com/?p=8306";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:664:"<p>Nettoyez, optimisez et sauvegardez votre base de données WordPress avec le Plugin DB Cleaner. Cette extension exécute un certain nombre de requêtes SQL pour nettoyer et optimiser une base de données. Vous pouvez également sauvegarder votre BDD sur votre serveur ou recevoir un fichier compressé (.zip) par e-mail. Corrections La version 2.9.x de DB Cleaner [&#8230;]</p>\n<p>The post <a rel="nofollow" href="http://sebastienbosquet.com/8306/plugin-wordpress-db-cleaner-nouvelle-version-2-9-x/">Plugin WordPress DB Cleaner &#8211; Nouvelle version 2.9.x</a> appeared first on <a rel="nofollow" href="http://sebastienbosquet.com">Sébastien Bosquet</a>.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:9:"Sebastien";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:3112:"<p>Nettoyez, optimisez et sauvegardez votre base de données WordPress avec le <a title="DB Cleaner : Un plugin pour nettoyer votre base de données WordPress" href="http://sebastienbosquet.com/7614/db-cleaner-un-plugin-pour-nettoyer-et-optimiser-votre-base-de-donnees-wordpress/" target="_blank">Plugin DB Cleaner</a>. Cette extension exécute un certain nombre de <a title="25 Requêtes SQL utiles pour WordPress" href="http://sebastienbosquet.com/862/25-requetes-sql-wordpress-queries/" target="_blank">requêtes SQL</a> pour nettoyer et optimiser une base de données. Vous pouvez également sauvegarder votre BDD sur votre serveur ou recevoir un fichier compressé (.zip) par e-mail.<span id="more-8306"></span>    <div class="hr-title">\n        <div></div>\n        <div class="title"><h3><span style="color: #00a8ff;"><strong>Nouvelle version</strong></span></h3></div>\n        <div></div>\n    </div>\n    \n<p><span style="color: #00a8ff;"><strong>Corrections<br />\n</strong></span></p>\n<p>La <strong>version 2.9.x</strong> de DB Cleaner arrive avec son lot de corrections et d&rsquo;optimisations.</p>\n<ul>\n<li>FIX : call_user_func_array() ( Pour les utilisateurs de WordPress 4.0 et plus )</li>\n<li>Amélioration de l&rsquo;enregistrement et de l&rsquo;envoi de la base de données.</li>\n<li>Gestion des conflits avec les Plugins <strong>WordPress SEO</strong> by Yoast et <strong>XML Sitemaps</strong>.</li>\n<li>Optimisation du code.</li>\n<li>Corrections de divers bugs.</li>\n<li>Corrections de conflits avec quelques thèmes.</li>\n</ul>\n<p><span style="color: #00a8ff;"><strong>Nouveauté Version 2.9.4<br />\n</strong></span></p>\n<p>Une nouvelle fonctionnalité a été ajoutée, désormais si vous utilisez le <a title="WP Super Cache" href="https://wordpress.org/plugins/wp-super-cache/" target="_blank">Plugin WP Super Cache</a> vous aurez la possibilité de vider tout le cache en une seule fois. Pour faciliter l&rsquo;accès à cette fonction et comme certains d&rsquo;entre vous l&rsquo;ont demandé, elle a été placée dans le &laquo;&nbsp;menu header&nbsp;&raquo; de WordPress.</p>\n<p>&nbsp;</p>\n<p><img class="alignnone size-full wp-image-8297" src="http://sebastienbosquet.com/wp-content/uploads/2014/11/db_cleaner_008.jpg" alt="db_cleaner_008" width="657" height="286" /></p>\n<p>&nbsp;</p>\n        <style type="text/css">\n            #button-2{\n                                color:#FFFFFF;\n                                    background-color: #00A8FF;\n                                }\n            #button-2:hover{\n                                        background-color:#838383;\n                            }\n        </style>\n        <a id="button-2" class="button button1 button-small" href="http://sebastienbosquet.com/produits/db-cleaner/" title="Télécharger DB Cleaner" >Télécharger</a>\n    \n<p>The post <a rel="nofollow" href="http://sebastienbosquet.com/8306/plugin-wordpress-db-cleaner-nouvelle-version-2-9-x/">Plugin WordPress DB Cleaner &#8211; Nouvelle version 2.9.x</a> appeared first on <a rel="nofollow" href="http://sebastienbosquet.com">Sébastien Bosquet</a>.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:89:"http://sebastienbosquet.com/8306/plugin-wordpress-db-cleaner-nouvelle-version-2-9-x/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:5;a:6:{s:4:"data";s:45:"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:76:"Woocommerce : Retirer le mot Gratuit (Free) dans la méthode d’expédition";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:90:"http://sebastienbosquet.com/8283/woocommerce-retirer-mot-gratuit-free-methode-dexpedition/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:99:"http://sebastienbosquet.com/8283/woocommerce-retirer-mot-gratuit-free-methode-dexpedition/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 19 Nov 2014 08:24:05 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:2:{i:0;a:5:{s:4:"data";s:11:"WooCommerce";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:9:"Tutorials";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:35:"http://sebastienbosquet.com/?p=8283";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:717:"<p>Comment se débarrasser du terme &#171;&#160;Gratuit&#160;&#187; (Free) dans les méthodes de livraisons qui affichent des coûts à 0€ ? Si vous avez défini un mode de livraison en dehors de la livraison gratuite intégrée, le terme &#171;&#160;Gratuit&#160;&#187; (Free) ou 0€ est ajouté. Vous pouvez l&#8217;enlever en plaçant ce bout de code dans le fichier functions.php de [&#8230;]</p>\n<p>The post <a rel="nofollow" href="http://sebastienbosquet.com/8283/woocommerce-retirer-mot-gratuit-free-methode-dexpedition/">Woocommerce : Retirer le mot Gratuit (Free) dans la méthode d&rsquo;expédition</a> appeared first on <a rel="nofollow" href="http://sebastienbosquet.com">Sébastien Bosquet</a>.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:9:"Sebastien";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:4949:"<p>Comment se débarrasser du terme &laquo;&nbsp;Gratuit&nbsp;&raquo; (Free) dans les <span class="description">méthodes</span> de livraisons qui affichent des coûts à 0€ ?</p>\n<p>Si vous avez défini un mode de livraison en dehors de la livraison gratuite intégrée, le terme &laquo;&nbsp;Gratuit&nbsp;&raquo; (Free) ou 0€ est ajouté. Vous pouvez l&rsquo;enlever en plaçant ce bout de code dans le fichier functions.php de votre thème:<span id="more-8283"></span></p>\n<div class="code-embed-wrapper">\n<pre class="language-php code-embed-pre" ><code class="language-php code-embed-code">// Supprimer (gratuit) sur la page du panier pour &quot;Livraison et manutention&quot; si le cout est de 0€\r\nfunction gratuit_change_cart_shipping_free_label( $label ) {\r\n    $label =  str_replace( &quot;(Free)&quot;, &quot; &quot;, $label );\r\n    return $label;\r\n}\r\nadd_filter( &#039;woocommerce_cart_shipping_method_full_label&#039; , &#039;gratuit_change_cart_shipping_free_label&#039; );</code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name"></span>\n</div>\n</div>\n<p>Vous pouvez modifier le texte Free (Gratuit) en utilisant ce code. Remplacez la deuxième paire de guillemets vides par ce que vous souhaitez utiliser à la place.</p>\n    <div class="hr-title">\n        <div></div>\n        <div class="title"><h3><span class="description">Méthodes de livraison</span></h3></div>\n        <div></div>\n    </div>\n    \n<ul>\n<li>local_delivery</li>\n<li>free_shipping</li>\n<li>flat_rate</li>\n<li>international_delivery</li>\n<li>local_pickup</li>\n</ul>\n<p>Si vous souhaitez changer ou supprimer le mot gratuit dans un mode de livraison (ex.local_pickup/Point de vente) ajoutez ce bout de code dans le fichier functions.php de votre thème:</p>\n<div class="code-embed-wrapper">\n<pre class="language-php code-embed-pre" ><code class="language-php code-embed-code">//Supprimer (gratuit) sur la page du panier pour local_pickup (Point de vente)\r\nfunction liv_gratuit_change_cart_shipping_free_label( $label, $method) {\r\n	if( $method-&gt;id == &#039;local_pickup&#039; )\r\n    $label =  str_replace( &quot;(Free)&quot;, &quot; &quot;, $label );\r\n    return $label;\r\n}\r\nadd_filter( &#039;woocommerce_cart_shipping_method_full_label&#039; , &#039;liv_gratuit__change_cart_shipping_free_label&#039; );</code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name"></span>\n</div>\n</div>\n<p>Vous pouvez modifier le texte Free (Gratuit) en utilisant ce code. Remplacez la deuxième paire de guillemets vides par ce que vous souhaitez utiliser à la place. Remplacez <code>local_pickup</code> par l&rsquo;ID que vous souhaitez utiliser.</p>\n    <div class="hr-title">\n        <div></div>\n        <div class="title"><h3><span style="color: #00a8ff;"><strong>Référence dans Woocommerce</strong></span></h3></div>\n        <div></div>\n    </div>\n    \n<p>wc_cart_totals_shipping_method_label()</p>\n<p><strong>Usage</strong></p>\n<div class="code-embed-wrapper">\n<pre class="language-php code-embed-pre" ><code class="language-php code-embed-code">$string = wc_cart_totals_shipping_method_label( $method );</code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name"></span>\n</div>\n</div>\n<p><strong>Source</strong></p>\n<p>Nom du fichier: woocommerce/includes/wc-cart-functions.php</p>\n<div class="code-embed-wrapper">\n<pre class="language-php code-embed-pre" ><code class="language-php code-embed-code">function wc_cart_totals_shipping_method_label( $method ) {\r\n  $label = $method-&gt;label;\r\n\r\n  if ( $method-&gt;cost &gt; 0 ) {\r\n    if ( WC()-&gt;cart-&gt;tax_display_cart == &#039;excl&#039; ) {\r\n      $label .= &#039;: &#039; . wc_price( $method-&gt;cost );\r\n      if ( $method-&gt;get_shipping_tax() &gt; 0 &amp;&amp; WC()-&gt;cart-&gt;prices_include_tax ) {\r\n        $label .= &#039; &lt;small&gt;&#039; . WC()-&gt;countries-&gt;ex_tax_or_vat() . &#039;&lt;/small&gt;&#039;;\r\n      }\r\n    } else {\r\n      $label .= &#039;: &#039; . wc_price( $method-&gt;cost + $method-&gt;get_shipping_tax() );\r\n      if ( $method-&gt;get_shipping_tax() &gt; 0 &amp;&amp; ! WC()-&gt;cart-&gt;prices_include_tax ) {\r\n        $label .= &#039; &lt;small&gt;&#039; . WC()-&gt;countries-&gt;inc_tax_or_vat() . &#039;&lt;/small&gt;&#039;;\r\n      }\r\n    }\r\n  } elseif ( $method-&gt;id !== &#039;free_shipping&#039; ) {\r\n    $label .= &#039; (&#039; . __( &#039;Free&#039;, &#039;woocommerce&#039; ) . &#039;)&#039;;\r\n  }\r\n\r\n  return apply_filters( &#039;woocommerce_cart_shipping_method_full_label&#039;, $label, $method );\r\n}</code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name"></span>\n</div>\n</div>\n<p>The post <a rel="nofollow" href="http://sebastienbosquet.com/8283/woocommerce-retirer-mot-gratuit-free-methode-dexpedition/">Woocommerce : Retirer le mot Gratuit (Free) dans la méthode d&rsquo;expédition</a> appeared first on <a rel="nofollow" href="http://sebastienbosquet.com">Sébastien Bosquet</a>.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:95:"http://sebastienbosquet.com/8283/woocommerce-retirer-mot-gratuit-free-methode-dexpedition/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:6;a:6:{s:4:"data";s:45:"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:70:"Peaufiner la « Recherche Commandes » dans l’Admin de WooCommerce";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:93:"http://sebastienbosquet.com/8271/peaufiner-la-recherche-commandes-dans-ladmin-de-woocommerce/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:102:"http://sebastienbosquet.com/8271/peaufiner-la-recherche-commandes-dans-ladmin-de-woocommerce/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 18 Nov 2014 10:01:28 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:2:{i:0;a:5:{s:4:"data";s:11:"WooCommerce";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:9:"Tutorials";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:35:"http://sebastienbosquet.com/?p=8271";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:746:"<p>WooCommerce permet à l&#8217;Administrateur d&#8217;effectuer des recherches sur la page &#171;&#160;Commandes&#160;&#187; en utilisant les champs suivants : order key billing first name billing last name billing company billing address 1 billing address 2 billing city billing postcode billing country billing state billing email billing phone order items Mais que faire si vous voulez effectuer une [&#8230;]</p>\n<p>The post <a rel="nofollow" href="http://sebastienbosquet.com/8271/peaufiner-la-recherche-commandes-dans-ladmin-de-woocommerce/">Peaufiner la &laquo;&nbsp;Recherche Commandes&nbsp;&raquo; dans l&rsquo;Admin de WooCommerce</a> appeared first on <a rel="nofollow" href="http://sebastienbosquet.com">Sébastien Bosquet</a>.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:9:"Sebastien";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:2246:"<p>WooCommerce permet à l&rsquo;Administrateur d&rsquo;effectuer des recherches sur la page &laquo;&nbsp;Commandes&nbsp;&raquo; en utilisant les champs suivants : <span id="more-8271"></span></p>\n<ul>\n<li>order key</li>\n<li>billing first name</li>\n<li>billing last name</li>\n<li>billing company</li>\n<li>billing address 1</li>\n<li>billing address 2</li>\n<li>billing city</li>\n<li>billing postcode</li>\n<li>billing country</li>\n<li>billing state</li>\n<li>billing email</li>\n<li>billing phone</li>\n<li>order items</li>\n</ul>\n<p><img src="http://sebastienbosquet.com/wp-content/uploads/2014/11/41111171-770x261.jpg" alt="Sans" width="770" height="261" class="alignnone size-medium wp-image-8278" /></p>\n<p>Mais que faire si vous voulez effectuer une recherche avec un autre champ de commande ? Comme le total de la commande. Eh bien, il vous suffit d&rsquo;ajouter quelque chose comme ce qui suit au fichier functions.php de votre thème:</p>\n<div class="code-embed-wrapper">\n<pre class="language-php code-embed-pre" ><code class="language-php code-embed-code">add_filter( &#039;woocommerce_shop_order_search_fields&#039;, &#039;woocommerce_shop_order_search_my_field&#039; );\r\n \r\n \r\n \r\nfunction woocommerce_shop_order_search_my_field( $search_fields ) {\r\n \r\n  $search_fields[] = &#039;_order_total&#039;;\r\n \r\n  return $search_fields;\r\n \r\n}</code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name">_order_total = le champ de recherche choisi</span>\n</div>\n</div>\n<p>Avec ce simple code, vous pouvez maintenant effectuer une recherche par le total de la commande. </p>\n<p><img src="http://sebastienbosquet.com/wp-content/uploads/2014/11/41111172.jpg" alt="Avec" width="655" height="373" class="alignnone size-full wp-image-8277" /></p>\n<p>En utilisant cette technique, vous pouvez même effectuer une recherche par meta personnalisés que vous pouvez ajouter à l&rsquo;enregistrement de la commande.</p>\n<p>The post <a rel="nofollow" href="http://sebastienbosquet.com/8271/peaufiner-la-recherche-commandes-dans-ladmin-de-woocommerce/">Peaufiner la &laquo;&nbsp;Recherche Commandes&nbsp;&raquo; dans l&rsquo;Admin de WooCommerce</a> appeared first on <a rel="nofollow" href="http://sebastienbosquet.com">Sébastien Bosquet</a>.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:98:"http://sebastienbosquet.com/8271/peaufiner-la-recherche-commandes-dans-ladmin-de-woocommerce/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:7;a:6:{s:4:"data";s:51:"\n		\n		\n		\n		\n		\n				\n		\n		\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:59:"WordPress – Ajouter une barre d’acceptation des cookies";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:86:"http://sebastienbosquet.com/8171/wordpress-ajouter-une-barre-dacceptation-des-cookies/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:95:"http://sebastienbosquet.com/8171/wordpress-ajouter-une-barre-dacceptation-des-cookies/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 14 Nov 2014 19:41:45 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:4:{i:0;a:5:{s:4:"data";s:7:"Web Dev";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:9:"Wordpress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:9:"Tutorials";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:3;a:5:{s:4:"data";s:3:"Web";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:35:"http://sebastienbosquet.com/?p=8171";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:750:"<p>Nous allons voir comment créer une barre d&#8217;acceptation des cookies sur votre installation WordPress. Depuis l&#8217;adoption de la directive 2009/136/CE, l&#8217;obligation de recueil du consentement préalable de l&#8217;internaute en matière de dépôt de cookies, s&#8217;impose aux éditeurs de sites internet. &#171;&#160;Le consentement doit se manifester par une action positive de la personne préalablement informée des [&#8230;]</p>\n<p>The post <a rel="nofollow" href="http://sebastienbosquet.com/8171/wordpress-ajouter-une-barre-dacceptation-des-cookies/">WordPress &#8211; Ajouter une barre d&rsquo;acceptation des cookies</a> appeared first on <a rel="nofollow" href="http://sebastienbosquet.com">Sébastien Bosquet</a>.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:9:"Sebastien";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:20148:"<p>Nous allons voir comment créer une barre d&rsquo;acceptation des cookies sur votre installation WordPress. Depuis l&rsquo;adoption de la directive 2009/136/CE, l&rsquo;obligation de recueil du consentement préalable de l&rsquo;internaute en matière de dépôt de cookies, s&rsquo;impose aux éditeurs de sites internet.<span id="more-8171"></span></p>\n    <div class="hr-title">\n        <div></div>\n        <div class="title"><h3><span style="color: #00a8ff;">Que dit la CNIL ?</span></h3></div>\n        <div></div>\n    </div>\n    \n<blockquote><p>&laquo;&nbsp;Le consentement doit se manifester par une action positive de la personne préalablement informée des conséquences de son choix et disposant des moyens de l&rsquo;exercer.&nbsp;&raquo;</p></blockquote>\n<p>Un bouton <strong>Accepter</strong>, <strong>J&rsquo;accepte</strong>, <strong>Je comprends</strong> ou <strong>OK</strong> permet une action positive.</p>\n<blockquote><p>L&rsquo;internaute qui se rend sur le site d&rsquo;un éditeur (page d&rsquo;accueil ou page secondaire du site) doit être informé, par l&rsquo;apparition d&rsquo;un bandeau.</p></blockquote>\n<p>Un bandeau ou une barre, appelé ça comme vous voulez&#8230; suffisamment visible pour le visiteur et relativement discrète pour la santé graphique du site.</p>\n<blockquote><p>Dans la mesure où le consentement ne doit pas être ambigu, ce bandeau ne doit pas disparaître tant que la personne n&rsquo;a pas poursuivi sa navigation, c&rsquo;est-à-dire tant qu&rsquo;elle ne s&rsquo;est pas rendue sur une autre page du site ou n&rsquo;a pas cliqué sur un élément du site.</p></blockquote>\n<p>Exemple de texte que l&rsquo;on retrouve habituellement : <em>En poursuivant votre navigation sur ce site, vous acceptez l’utilisation de cookies &#8230;</em><br />\nCette barre peut éventuellement disparaitre si l&rsquo;utilisateur visite une autre page du site ou bien clique sur une image, un lien, un bouton, etc.</p>\n<p>À cela, il faut ajouter un lien <strong>[En savoir plus]</strong> soit en agrandissant la barre principale, à la manière du <a title="Plugin WordPress CookieConsent" href="http://sebastienbosquet.com/produits/cookieconsent/" target="_blank">plugin CookieConsent</a> soit en pointant le lien vers une page d&rsquo;information sur l&rsquo;utilisation des cookies.</p>\n<p><img class="alignnone size-full wp-image-8182" src="http://sebastienbosquet.com/wp-content/uploads/2014/11/project-bar.jpg" alt="Projet Barre Cookies" width="650" height="137" /></p>\n<blockquote><p>Les personnes doivent disposer de solutions leur permettant de refuser l&rsquo;insertion des cookies.</p></blockquote>\n<p>Un bouton <strong>refuser</strong> devra être envisagé pour respecter ce droit.</p>\n<p><img class="alignnone size-full wp-image-8184" src="http://sebastienbosquet.com/wp-content/uploads/2014/11/project-bar-2.jpg" alt="Projet Barre Cookies II" width="650" height="137" /></p>\n<blockquote><p>Le consentement à être suivi peut être oublié par les personnes qui l&rsquo;ont manifesté à un instant donné, la CNIL estime nécessaire de limiter dans le temps la portée de ce dernier.</p></blockquote>\n<p>La CNIL recommande une durée maximale de 13 mois pour un consentement au dépôt des Cookies. À l&rsquo;issu de ce délai, l&rsquo;utilisateur devra renouveler son approbation. Il faut donc prévoir une durée équivalente dans le script d&rsquo;affichage de la barre.</p>\n    <div class="hr-title-center">\n        <div></div>\n        <div class="title"><h3><strong><span style="color: #00a8ff;">Création de la barre</span></strong></h3></div>\n        <div></div>\n    </div>\n    \n<div class="block" style="background-color: #e0f5ff;">\n<div class="block-edit" style="padding: 10px;">\n<p>Nous utiliserons 2 fichiers (JavaScript + Feuille de style CSS) ainsi qu&rsquo;un petit code pour les options et les appels JS/CSS.</p>\n<p><strong><span style="color: #00a8ff;">Mise en place</span></strong></p>\n<p>Téléchargez le dossier <strong>cookieconsentbar.zip</strong></p>\n<p>Décompressez le fichier zip et placez le dossier <strong>cookieconsentbar</strong> à la racine de votre <strong>thème</strong>.</p>\n        <style type="text/css">\n            #button-3{\n                                color:#FFFFFF;\n                                    background-color: #00A8FF;\n                                }\n            #button-3:hover{\n                                        background-color:#838383;\n                            }\n        </style>\n        <a id="button-3" class="button button1 button-small" href="http://sebastienbosquet.com/goto/link.php?id=rbJzFVcFJ23dMYJEY2SBGZZRUurdTn" title="Télécharger Cookie Consent Bar" >Télécharger</a>\n    \n<p><strong><span style="color: #00a8ff;">Le Code</span></strong></p>\n<p>Placez le code ci-dessous dans le fichier <strong>function.php</strong> de votre thème.</p>\n</div>\n</div>\n<div class="code-embed-wrapper">\n<pre class="language-php code-embed-pre" ><code class="language-php code-embed-code">// Place the following code in your theme&#039;s functions.php file\r\n// Cookie Consent Bar\r\nfunction cookieconsentbar(){\r\n        ?&gt;\r\n&lt;link rel=&quot;stylesheet&quot; type=&quot;text/css&quot; href=&quot;&lt;?php bloginfo( &#039;template_url&#039; ); ?&gt;/cookieconsentbar/sb.cookieconsentbar.css&quot; /&gt;\r\n&lt;script src=&quot;https://ajax.googleapis.com/ajax/libs/jquery/1.7.1/jquery.min.js&quot;&gt;&lt;/script&gt;\r\n&lt;script type=&quot;text/javascript&quot; src=&quot;&lt;?php bloginfo( &#039;template_url&#039; ); ?&gt;/cookieconsentbar/sb.cookieconsentbar.js&quot;&gt;&lt;/script&gt;\r\n		&lt;script type=&quot;text/javascript&quot;&gt;\r\n			$(document).ready(function(){\r\n				$.sbCookieConsentBar({\r\n			message: &#039;Ce site utilise des cookies pour optimiser votre expérience de navigation. En continuant votre visite sur notre site, vous consentez à l’utilisation de Cookies.&#039;,\r\n			acceptButton: true,\r\n			acceptText: &#039;Accepter&#039;,\r\n			declineButton: false,\r\n			declineText: &#039;Refuser&#039;,\r\n			policyButton: false,\r\n			policyText: &#039;En savoir plus&#039;,\r\n			policyURL: &#039;/cookies/&#039;,\r\n			acceptOnContinue: false,\r\n			effect: &#039;slide&#039;,\r\n			element: &#039;body&#039;,\r\n			fixed: true,\r\n			bottom: true\r\n				});\r\n			});\r\n		&lt;/script&gt;\r\n     &lt;?php\r\n}\r\nadd_action(&#039;wp_head&#039;,&#039;cookieconsentbar&#039;,1,20);</code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name"></span>\n</div>\n</div>\n<p><strong>Votre barre est installée.</strong></p>\n    <div class="hr-title-center">\n        <div></div>\n        <div class="title"><h3><strong><span style="color: #00a8ff;">Réglages</span></strong></h3></div>\n        <div></div>\n    </div>\n    \n    <div class="hr-title">\n        <div></div>\n        <div class="title"><h3><span style="color: #00a8ff;">Options JS</span></h3></div>\n        <div></div>\n    </div>\n    \n<p><strong>Message et boutons</strong></p>\n    <div class="tabs">\n            <ul class="head clearfix">\n                        <li>message</li>\n                        <li>acceptButton &amp; acceptText</li>\n                        <li>declineButton &amp; declineText</li>\n                    </ul>\n        <div class="content">\n                            <div class="tab-content"><br />\n<span style="color: #333333;">message:</span> Personnalisez le texte, par exemple : En poursuivant votre navigation sur ce site, vous acceptez l’utilisation de cookies à des fins statistiques.<br />\n</div>\n                            <div class="tab-content"><br />\n<span style="color: #333333;">acceptButton:</span> Mettre <code>true</code> pour afficher le bouton de validation/Accepter.<br />\n<span style="color: #333333;">acceptText:</span> Texte du bouton de Validation/Accepter.<br />\n</div>\n                            <div class="tab-content"><br />\n<span style="color: #333333;">acceptButton:</span> Mettre <code>true</code> pour afficher le bouton de Refus/Désactiver.<br />\n<span style="color: #333333;">acceptText:</span> Texte du bouton de Refus/Désactiver.<br />\n</div>\n                    </div>\n        </div>\n    \n<p><strong>Information sur les cookies</strong><br />\n    <div class="tabs">\n            <ul class="head clearfix">\n                        <li>policyButton &amp; policyText</li>\n                        <li>policyURL</li>\n                        <li>acceptOnContinue</li>\n                    </ul>\n        <div class="content">\n                            <div class="tab-content"><br />\n<span style="color: #333333;">policyButton:</span> Mettre <code>true</code> pour afficher le lien <strong>En savoir plus</strong>.<br />\n<span style="color: #333333;">policyText:</span> Texte du lien <strong>En savoir plus</strong>.<br />\n</div>\n                            <div class="tab-content"><br />\n<span style="color: #333333;">policyURL:</span> URL du lien <strong>En savoir plus</strong>.<br />\nSoit un lien direct <code>http://</code> soit une page de votre site <code>/mapage/</code></p>\n<ul>Exemple de page :</p>\n<li>Politique de confidentialité</li>\n<li>Usage des Cookies</li>\n<li>Information sur les cookies</li>\n<li>&#8230;</li>\n</ul>\n</div>\n                            <div class="tab-content"><br />\n<span style="color: #333333;">acceptOnContinue:</span> Mettre <code>true</code> pour accepter silencieusement des cookies lorsque le visiteur se déplace vers une autre page.<br />\n</div>\n                    </div>\n        </div>\n    \n<p><strong>Design &amp; Effets</strong><br />\n    <div class="tabs">\n            <ul class="head clearfix">\n                        <li>effect</li>\n                        <li>element</li>\n                        <li>fixed</li>\n                        <li>bottom</li>\n                    </ul>\n        <div class="content">\n                            <div class="tab-content"><br />\n<span style="color: #333333;">effect:</span> Options d&rsquo;effets jQuery : slide, fade, hide.<br />\n</div>\n                            <div class="tab-content"><br />\n<span style="color: #333333;">element:</span> Élément à ajouter/préfixe &laquo;&nbsp;sbCookieConsentBar&nbsp;&raquo;. Pour <code>class</code> ou pour <code>id</code>.<br />\n</div>\n                            <div class="tab-content"><br />\n<span style="color: #333333;">fixed:</span> Mettre <code>true</code> pour ajouter la position <code>fixed</code> à la barre. Par défaut le CSS doit fixer la position.<br />\n</div>\n                            <div class="tab-content"><br />\n<span style="color: #333333;">bottom:</span> Forcer le CSS a positionner la barre en bas du site avec <code>fixed:true</code>.<br />\n</div>\n                    </div>\n        </div>\n    \n    <div class="hr-title">\n        <div></div>\n        <div class="title"><h3><span style="color: #00a8ff;">Options CSS</span></h3></div>\n        <div></div>\n    </div>\n    \n<p>Vous pouvez changer l&rsquo;aspect et les couleurs (<a title="Color Picker Master" href="http://sebastienbosquet.com/goto/link.php?id=9fZGRv3QR3Xgzm3RVEYtzshHjCSvjQ" target="_blank">Color Picker Master)</a> en modifiant la feuille de style.</p>\n    <div class="tabs">\n            <ul class="head clearfix">\n                        <li>Barre</li>\n                        <li>Texte</li>\n                        <li>Lien</li>\n                        <li>Bouton Accepter</li>\n                        <li>Bouton Refuser</li>\n                        <li>En savoir plus</li>\n                    </ul>\n        <div class="content">\n                            <div class="tab-content">\n<p><div class="code-embed-wrapper">\n<pre class="language-css code-embed-pre" ><code class="language-css code-embed-code">#cookie-consent-bar {\r\n	background:#f6f6f6; \r\n	min-height:24px; \r\n	line-height:24px; \r\n	color:#595959; \r\n	text-align:center; \r\n	padding:3px 0; \r\n	width:100%; /* opacity bar :\r\n	opacity: 0.6; \r\n	filter: alpha(opacity=60); */\r\n	}\r\n#cookie-consent-bar:hover { /* opacity bar :\r\n	opacity: 1.0;\r\n	filter: alpha(opacity=100); */\r\n	}\r\n#cookie-consent-bar.fixed {\r\n	position:fixed; \r\n	bottom:0; \r\n	left:0; \r\n	z-index:100;\r\n	}</code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name"></span>\n</div>\n</div><br />\n</div>\n                            <div class="tab-content">\n<p><div class="code-embed-wrapper">\n<pre class="language-css code-embed-pre" ><code class="language-css code-embed-code">#cookie-consent-bar p {\r\n	margin:0; \r\n	padding:0 10px; \r\n	font-size:12px;\r\n	}</code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name"></span>\n</div>\n</div><br />\n</div>\n                            <div class="tab-content">\n<p><div class="code-embed-wrapper">\n<pre class="language-css code-embed-pre" ><code class="language-css code-embed-code">#cookie-consent-bar a {\r\n	color:#ffffff; \r\n	display:inline-block; \r\n	border-radius:3px; \r\n	text-decoration:none; padding:0 6px;\r\n	}</code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name"></span>\n</div>\n</div><br />\n</div>\n                            <div class="tab-content">\n<p><div class="code-embed-wrapper">\n<pre class="language-css code-embed-pre" ><code class="language-css code-embed-code">#cookie-consent-bar .sb-enable {\r\n	background:#46aa51;\r\n	margin:0 8px;\r\n	}\r\n#cookie-consent-bar .sb-enable:hover {\r\n	background:#6ec478;\r\n	}</code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name"></span>\n</div>\n</div><br />\n</div>\n                            <div class="tab-content">\n<p><div class="code-embed-wrapper">\n<pre class="language-css code-embed-pre" ><code class="language-css code-embed-code">#cookie-consent-bar .sb-disable {\r\n	background:#e41b40;\r\n	margin:0 8px;\r\n	}\r\n#cookie-consent-bar .sb-disable:hover {\r\n	background:#e93f5e;\r\n	}</code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name"></span>\n</div>\n</div><br />\n</div>\n                            <div class="tab-content">\n<p><div class="code-embed-wrapper">\n<pre class="language-css code-embed-pre" ><code class="language-css code-embed-code">#cookie-consent-bar .sb-policy {\r\n	text-decoration:underline;\r\n	margin:0 2px;\r\n	}\r\n#cookie-consent-bar .sb-policy:hover {\r\n	text-decoration:underline;\r\n	}</code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name"></span>\n</div>\n</div><br />\n</div>\n                    </div>\n        </div>\n    \n    <div class="hr-title-center">\n        <div></div>\n        <div class="title"><h3><strong><span style="color: #00a8ff;">Refuser les cookies</span></strong></h3></div>\n        <div></div>\n    </div>\n    \n<p><span id="result_box" lang="fr">Si un utilisateur choisit de désactiver les cookies (Si vous leur donnez cette possibilité en affichant le bouton <strong>Refuser</strong>), vous devez vous assurer que les scripts tels que <a title="Google Analytics" href="https://support.google.com/analytics/answer/1008080?hl=fr" target="_blank">Google Analytics</a> et autres, seront bien désactivés.</span></p>\n<p>Ceci peut être réalisé en enroulant le code dans un simple <code>if</code>.</p>\n<div class="code-embed-wrapper">\n<pre class="language-css code-embed-pre" ><code class="language-css code-embed-code">&lt;script type=&quot;text/javascript&quot;&gt;\r\n			if(jQuery.sbCookieConsentBar(&#039;cookies&#039;)){\r\n				//Inserer Google Analytics par exemple :\r\n			}\r\n		&lt;/script&gt; </code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name"></span>\n</div>\n</div>\n<p>Exemple de code complet</p>\n<div class="code-embed-wrapper">\n<pre class="language-css code-embed-pre" ><code class="language-css code-embed-code">&lt;script type=&quot;text/javascript&quot;&gt;\r\n			if(jQuery.sbCookieConsentBar(&#039;cookies&#039;)){\r\n				//Inserer Google Analytics par exemple :\r\n				(function(i,s,o,g,r,a,m){i[&#039;GoogleAnalyticsObject&#039;]=r;i[r]=i[r]||function(){\r\n				(i[r].q=i[r].q||[]).push(arguments)},i[r].l=1*new Date();a=s.createElement(o),\r\n				m=s.getElementsByTagName(o)[0];a.async=1;a.src=g;m.parentNode.insertBefore(a,m)\r\n				})(window,document,&#039;script&#039;,&#039;//www.google-analytics.com/analytics.js&#039;,&#039;ga&#039;);\r\n				ga(&#039;create&#039;, &#039;UA-XXXXXXXX-X&#039;, &#039;auto&#039;);\r\n				ga(&#039;send&#039;, &#039;pageview&#039;);\r\n			}\r\n		&lt;/script&gt; </code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name"></span>\n</div>\n</div>\n    <div class="hr-title-center">\n        <div></div>\n        <div class="title"><h3><strong><span style="color: #00a8ff;">Réglages supplémentaires</span></strong></h3></div>\n        <div></div>\n    </div>\n    \n<p>Si l&rsquo;utilisateur accepte le dépôt de cookies, le temps que mettra la barre pour réapparaitre est fixé à 1 an = 365 jours. Si vous souhaitez augmenter ce temps et le passer à 13 mois ( durée maximale recommandée par la CNIL ) ou diminuer ce temps pour quelques raisons que ce soit. Vous devrez ajouter et modifier cette option dans le premier code.</p>\n<p>&nbsp;</p>\n<div class="code-embed-wrapper">\n<pre class="language-php code-embed-pre" ><code class="language-php code-embed-code">expireDays: 365,</code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name"></span>\n</div>\n</div>\n    <div class="hr-title-center">\n        <div></div>\n        <div class="title"><h3><strong><span style="color: #00a8ff;">Site</span></strong></h3></div>\n        <div></div>\n    </div>\n    \n<p>Si vous souhaitez porter ce code sur une installation autre que WordPress.</p>\n<p>Téléchargez le dossier <strong>cookieconsentbar.zip</strong></p>\n<p>Décompressez le fichier zip et placez le dossier <strong>cookieconsentbar</strong> à la racine de votre <strong>Site</strong>.</p>\n        <style type="text/css">\n            #button-4{\n                                color:#FFFFFF;\n                                    background-color: #00A8FF;\n                                }\n            #button-4:hover{\n                                        background-color:#838383;\n                            }\n        </style>\n        <a id="button-4" class="button button1 button-small" href="http://sebastienbosquet.com/goto/link.php?id=rbJzFVcFJ23dMYJEY2SBGZZRUurdTn" title="Télécharger Cookie Consent Bar" >Télécharger</a>\n    \n<p>Modifiez le code : le lien de l&rsquo;appel CS et JS.</p>\n<p>Remplacez<code>&lt; ? php bloginfo( ''template_url'' ); ? &gt;</code> par <code>http://www.adressedemonsite.com/</code></p>\n<p>Placer le code dans l&rsquo;en-tête de votre site au dessus de la balise <code>&lt; / head &gt;</code></p>\n<div class="code-embed-wrapper">\n<pre class="language-php code-embed-pre" ><code class="language-php code-embed-code">&lt;link rel=&quot;stylesheet&quot; type=&quot;text/css&quot; href=&quot;http://www.adressedemonsite.com/cookieconsentbar/cookieconsentbar.css&quot; /&gt;\r\n		&lt;script type=&quot;text/javascript&quot; src=&quot;//ajax.googleapis.com/ajax/libs/jquery/1.8.3/jquery.min.js&quot;&gt;&lt;/script&gt;\r\n		&lt;script type=&quot;text/javascript&quot; src=&quot;http://www.adressedemonsite.com/cookieconsentbar/cookieconsentbar.js&quot;&gt;&lt;/script&gt;\r\n		&lt;script type=&quot;text/javascript&quot;&gt;\r\n			$(document).ready(function(){\r\n				$.sbCookieConsentBar({\r\n			message: &#039;Ce site utilise des cookies pour optimiser votre expérience de navigation. En continuant votre visite sur notre site, vous consentez à l’utilisation de Cookies.&#039;,\r\n			acceptButton: true,\r\n			acceptText: &#039;Accepter&#039;,\r\n			declineButton: false,\r\n			declineText: &#039;Refuser&#039;,\r\n			policyButton: false,\r\n			policyText: &#039;En savoir plus&#039;,\r\n			policyURL: &#039;/cookies/&#039;,\r\n			acceptOnContinue: false,\r\n			effect: &#039;slide&#039;,\r\n			element: &#039;body&#039;,\r\n			fixed: true,\r\n			bottom: true\r\n				});\r\n			});\r\n		&lt;/script&gt;</code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name"></span>\n</div>\n</div>\n<p>The post <a rel="nofollow" href="http://sebastienbosquet.com/8171/wordpress-ajouter-une-barre-dacceptation-des-cookies/">WordPress &#8211; Ajouter une barre d&rsquo;acceptation des cookies</a> appeared first on <a rel="nofollow" href="http://sebastienbosquet.com">Sébastien Bosquet</a>.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:91:"http://sebastienbosquet.com/8171/wordpress-ajouter-une-barre-dacceptation-des-cookies/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:8;a:6:{s:4:"data";s:48:"\n		\n		\n		\n		\n		\n				\n		\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:67:"Ajouter un message au-dessus de la zone de connexion de WooCommerce";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:86:"http://sebastienbosquet.com/8148/ajouter-message-au-dessus-zone-connexion-woocommerce/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:95:"http://sebastienbosquet.com/8148/ajouter-message-au-dessus-zone-connexion-woocommerce/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 10 Nov 2014 05:37:54 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:3:{i:0;a:5:{s:4:"data";s:9:"Wordpress";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:9:"Tutorials";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:2;a:5:{s:4:"data";s:11:"WooCommerce";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:35:"http://sebastienbosquet.com/?p=8148";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:712:"<p>Pour encourager les utilisateurs à s&#8217;inscrire sur votre boutique, vous pouvez ajouter un message au-dessus du formulaire d&#8217;inscription en affichant les avantages que propose votre site envers ses membres. Certains sites proposent une liste d&#8217;envies, un système de points et récompenses, des ventes privilèges et bien d&#8217;autres avantages, à leurs clients. Ce petit bout de [&#8230;]</p>\n<p>The post <a rel="nofollow" href="http://sebastienbosquet.com/8148/ajouter-message-au-dessus-zone-connexion-woocommerce/">Ajouter un message au-dessus de la zone de connexion de WooCommerce</a> appeared first on <a rel="nofollow" href="http://sebastienbosquet.com">Sébastien Bosquet</a>.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:9:"Sebastien";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:4276:"<p>Pour encourager les utilisateurs à s&rsquo;inscrire sur votre boutique, vous pouvez <strong>ajouter un message</strong> au-dessus du formulaire d&rsquo;inscription <strong>en affichant les avantages</strong> que propose votre site envers ses membres. Certains sites proposent une liste d&rsquo;envies, un système de points et récompenses, des ventes privilèges et bien d&rsquo;autres avantages, à leurs clients. Ce petit bout de code affichera les privilèges par défaut que propose un compte client dans Woocommerce. À vous, d&rsquo;ajouter d&rsquo;autres avantages selon votre configuration.<span id="more-8148"></span></p>\n<p>Si vous souhaitez insérer un message au-dessus de la zone de <em>connexion/s&rsquo;enregistrer</em>, tout ce que vous avez à faire est d’ajouter le code ci-dessous dans le fichier <strong>functions.php</strong> de votre thème.</p>\n<div class="code-embed-wrapper">\n<pre class="language-php code-embed-pre" ><code class="language-php code-embed-code">// Place the following code in your theme&#039;s functions.php file\r\nadd_action( &#039;woocommerce_before_customer_login_form&#039;, &#039;sb_login_message&#039; );\r\nfunction sb_login_message() {\r\nif ( get_option( &#039;woocommerce_enable_myaccount_registration&#039; ) == &#039;yes&#039; ) {\r\n?&gt;\r\n&lt;style type=&quot;text/css&quot;&gt;\r\n/* Allows you to customize the appearance. CSS */\r\n.woocommerce-message-register {margin-bottom: 8px;padding: 10px; background-color: #F4F4F4;border: 1px dashed #CCC; width: 50%; position: relative;}\r\n.woocommerce-message-register h4{}\r\n.woocommerce-message-register ul{padding-left: 20px;}\r\n.woocommerce-message-register li{}\r\n&lt;/style&gt;\r\n&lt;div class=&quot;woocommerce-message-register&quot;&gt;\r\n&lt;h4&gt;&lt;?php _e( &#039;Cr&eacute;ez votre Espace Client&#039; ); ?&gt;&lt;/h4&gt;\r\n&lt;p&gt;&lt;?php _e( &#039;En cr&eacute;ant un compte sur notre boutique, vous pourrez :&#039; ); ?&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;&lt;?php _e( &#039;Voir l\\&#039;historique de vos commandes&#039; ); ?&gt;&lt;/li&gt;\r\n&lt;li&gt;&lt;?php _e( &#039;V&eacute;rifier vos commandes&#039; ); ?&gt;&lt;/li&gt;\r\n&lt;li&gt;&lt;?php _e( &#039;Modifier vos adresses&#039; ); ?&gt;&lt;/li&gt;\r\n&lt;li&gt;&lt;?php _e( &#039;Changer votre mot de passe&#039; ); ?&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;/div&gt;\r\n&lt;?php\r\n}\r\n}</code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name">Code Complet</span>\n</div>\n</div>\n<p>Pour personnaliser ce code, il vous suffit de modifier les lignes suivantes :</p>\n<div class="code-embed-wrapper">\n<pre class="language-php code-embed-pre" ><code class="language-php code-embed-code">&lt;h4&gt;&lt;?php _e( &#039;Cr&eacute;ez votre Espace Client&#039; ); ?&gt;&lt;/h4&gt;\r\n&lt;p&gt;&lt;?php _e( &#039;En cr&eacute;ant un compte sur notre boutique, vous pourrez :&#039; ); ?&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;&lt;?php _e( &#039;Voir l\\&#039;historique de vos commandes&#039; ); ?&gt;&lt;/li&gt;\r\n&lt;li&gt;&lt;?php _e( &#039;V&eacute;rifier vos commandes&#039; ); ?&gt;&lt;/li&gt;\r\n&lt;li&gt;&lt;?php _e( &#039;Modifier vos adresses&#039; ); ?&gt;&lt;/li&gt;\r\n&lt;li&gt;&lt;?php _e( &#039;Changer votre mot de passe&#039; ); ?&gt;&lt;/li&gt;</code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name">Personnalisation du Texte</span>\n</div>\n</div>\n<p><span class="st">Personnaliser l&rsquo;aspect des éléments du message</span>, il vous suffit de modifier les lignes suivantes :</p>\n<div class="code-embed-wrapper">\n<pre class="language-css code-embed-pre" ><code class="language-css code-embed-code">.woocommerce-message-register {margin-bottom: 8px;padding: 10px; background-color: #F4F4F4;border: 1px dashed #CCC; width: 50%; position: relative;}\r\n.woocommerce-message-register h4{}\r\n.woocommerce-message-register ul{padding-left: 20px;}\r\n.woocommerce-message-register li{}</code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name">Personnalisation CSS</span>\n</div>\n</div>\n<p>The post <a rel="nofollow" href="http://sebastienbosquet.com/8148/ajouter-message-au-dessus-zone-connexion-woocommerce/">Ajouter un message au-dessus de la zone de connexion de WooCommerce</a> appeared first on <a rel="nofollow" href="http://sebastienbosquet.com">Sébastien Bosquet</a>.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:91:"http://sebastienbosquet.com/8148/ajouter-message-au-dessus-zone-connexion-woocommerce/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:9;a:6:{s:4:"data";s:45:"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:60:"Ajouter un champ ⇢ Confirmer Mot de Passe dans WooCommerce";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:79:"http://sebastienbosquet.com/8139/ajouter-champ-confirmer-mot-passe-woocommerce/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:88:"http://sebastienbosquet.com/8139/ajouter-champ-confirmer-mot-passe-woocommerce/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Sun, 09 Nov 2014 11:04:36 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"category";a:2:{i:0;a:5:{s:4:"data";s:11:"WooCommerce";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}i:1;a:5:{s:4:"data";s:9:"Tutorials";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:35:"http://sebastienbosquet.com/?p=8139";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:639:"<p>Depuis la version 2.1 de WooCommerce, vous avez pu constater la suppression du champ de répétition de mot de passe sur la page de paiement (checkout page) ainsi que sur la page Mon compte (My Account page). L&#8217;équipe de développement a décidé de retirer ce critère parce qu&#8217;il était assez facile de réinitialiser son mot [&#8230;]</p>\n<p>The post <a rel="nofollow" href="http://sebastienbosquet.com/8139/ajouter-champ-confirmer-mot-passe-woocommerce/">Ajouter un champ ⇢ Confirmer Mot de Passe dans WooCommerce</a> appeared first on <a rel="nofollow" href="http://sebastienbosquet.com">Sébastien Bosquet</a>.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:9:"Sebastien";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:5066:"<p>Depuis la version 2.1 de <strong>WooCommerce</strong>, vous avez pu constater la suppression du champ de répétition de mot de passe sur la page de paiement (checkout page) ainsi que sur la page Mon compte (My Account page). L&rsquo;équipe de développement a décidé de retirer ce critère parce qu&rsquo;il était assez facile de réinitialiser son mot de passe en un seul clic.<br />\nSi vous souhaitez tout de même insérer un champ de confirmation de mot de passe sur ces pages, tout ce que vous avez à faire est d&rsquo;ajouter les codes ci-dessous dans le fichier <strong>functions.php</strong> de votre thème.<span id="more-8139"></span></p>\n<h3>Pour la page de paiement (checkout page)</h3>\n<div class="code-embed-wrapper">\n<pre class="language-php code-embed-pre" ><code class="language-php code-embed-code">// place the following code in your theme&#039;s functions.php file\r\n// Add a second password field to the checkout page.\r\nadd_action( &#039;woocommerce_checkout_init&#039;, &#039;wc_add_confirm_password_checkout&#039;, 10, 1 );\r\nfunction wc_add_confirm_password_checkout( $checkout ) {\r\nif ( get_option( &#039;woocommerce_registration_generate_password&#039; ) == &#039;no&#039; ) {\r\n$checkout-&gt;checkout_fields[&#039;account&#039;][&#039;account_password2&#039;] = array(\r\n&#039;type&#039; =&gt; &#039;password&#039;,\r\n&#039;label&#039; =&gt; __( &#039;Confirm password&#039;, &#039;woocommerce&#039; ),\r\n&#039;required&#039; =&gt; true,\r\n&#039;placeholder&#039; =&gt; _x( &#039;Confirm Password&#039;, &#039;placeholder&#039;, &#039;woocommerce&#039; )\r\n);\r\n}\r\n}\r\n \r\n// Check the password and confirm password fields match before allow checkout to proceed.\r\nadd_action( &#039;woocommerce_after_checkout_validation&#039;, &#039;wc_check_confirm_password_matches_checkout&#039;, 10, 2 );\r\nfunction wc_check_confirm_password_matches_checkout( $posted ) {\r\n$checkout = WC()-&gt;checkout;\r\nif ( ! is_user_logged_in() &amp;&amp; ( $checkout-&gt;must_create_account || ! empty( $posted[&#039;createaccount&#039;] ) ) ) {\r\nif ( strcmp( $posted[&#039;account_password&#039;], $posted[&#039;account_password2&#039;] ) !== 0 ) {\r\nwc_add_notice( __( &#039;Passwords do not match.&#039;, &#039;woocommerce&#039; ), &#039;error&#039; );\r\n}\r\n}\r\n}</code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name">Page de paiement ➜ Checkout Page</span>\n</div>\n</div>\n<p>Cela va ajouter un nouveau champ sous le champ de mot de passe avec le label &laquo;&nbsp;Confirmer Mot de Passe/Confirm Password&nbsp;&raquo;.</p>\n<h3>Pour la page Mon Compte Inscription (My Account page/Register Page)</h3>\n<div class="code-embed-wrapper">\n<pre class="language-php code-embed-pre" ><code class="language-php code-embed-code">\r\n// Add the code below to your theme&#039;s functions.php file to add a confirm password field on the register form under My Accounts.\r\nadd_filter(&#039;woocommerce_registration_errors&#039;, &#039;registration_errors_validation&#039;, 10,3);\r\nfunction registration_errors_validation($reg_errors, $sanitized_user_login, $user_email) {\r\nglobal $woocommerce;\r\nextract( $_POST );\r\n \r\nif ( strcmp( $password, $password2 ) !== 0 ) {\r\nreturn new WP_Error( &#039;registration-error&#039;, __( &#039;Passwords do not match.&#039;, &#039;woocommerce&#039; ) );\r\n}\r\nreturn $reg_errors;\r\n}\r\n \r\nadd_action( &#039;woocommerce_register_form&#039;, &#039;wc_register_form_password_repeat&#039; );\r\nfunction wc_register_form_password_repeat() {\r\n?&gt;\r\n&lt;p class=&quot;form-row form-row-wide&quot;&gt;\r\n&lt;label for=&quot;reg_password2&quot;&gt;&lt;?php _e( &#039;Password Repeat&#039;, &#039;woocommerce&#039; ); ?&gt; &lt;span class=&quot;required&quot;&gt;*&lt;/span&gt;&lt;/label&gt;\r\n&lt;input type=&quot;password&quot; class=&quot;input-text&quot; name=&quot;password2&quot; id=&quot;reg_password2&quot; value=&quot;&lt;?php if ( ! empty( $_POST[&#039;password2&#039;] ) ) echo esc_attr( $_POST[&#039;password2&#039;] ); ?&gt;&quot; /&gt;\r\n&lt;/p&gt;\r\n&lt;?php\r\n}</code></pre>\n<div class="code-embed-infos">\n<span class="code-embed-name">Page Mon Compte Inscription ➜ Register Page</span>\n</div>\n</div>\n<p>Cela va ajouter un nouveau champ sous le champ de mot de passe avec le label &laquo;&nbsp;Répéter Mot de Passe/Password Repeat&nbsp;&raquo;.</p>\n<p>Vous pouvez traduire ces champs directement dans ce code ou en utilisant le <em>text-domain</em> de votre thème, en remplaçant &lsquo;woocommerce&rsquo; par &lsquo;le-text-domain-de-mon-thème&rsquo; puis en procédant a une traduction via <a title="Poedit" href="https://poedit.net/" target="_blank">Poedit</a> ou en utilisant un plugin comme <a title="Codestyling Localization" href="https://wordpress.org/plugins/codestyling-localization/" target="_blank">Codestyling Localization</a></p>\n<p>The post <a rel="nofollow" href="http://sebastienbosquet.com/8139/ajouter-champ-confirmer-mot-passe-woocommerce/">Ajouter un champ ⇢ Confirmer Mot de Passe dans WooCommerce</a> appeared first on <a rel="nofollow" href="http://sebastienbosquet.com">Sébastien Bosquet</a>.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:84:"http://sebastienbosquet.com/8139/ajouter-champ-confirmer-mot-passe-woocommerce/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}}}s:27:"http://www.w3.org/2005/Atom";a:1:{s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:0:"";s:7:"attribs";a:1:{s:0:"";a:3:{s:4:"href";s:33:"http://sebastienbosquet.com/feed/";s:3:"rel";s:4:"self";s:4:"type";s:19:"application/rss+xml";}}s:8:"xml_base";s:0