(1544, 740, '_yoast_wpseo_metadesc', 'Les Faders font venir Gilb’R, boss de Versatile records à l''Ubu et lui adjoignent l’actualité de spaghrecords : Monkey Analow & Oil B.'),
(1552, 740, '_yoast_wpseo_opengraph-description', 'Les Faders font venir Gilb’R, Dj encyclopédique & boss de Versatile records, lui adjoignent l’actualité bouillonnante du label rennais spaghrecords : Monkey Analow (‘acid light’ ep le 23 janvier) ; Oil B. (‘plume’ ep le 25 février) ; le tout accompagné par Squatt. Les décors noir et blanc de Size et le dress code de rigueur participeront à installer une ambiance … Versatile.'),
(1553, 740, '_yoast_wpseo_google-plus-description', 'Les Faders font venir Gilb’R, Dj encyclopédique & boss de Versatile records, lui adjoignent l’actualité bouillonnante du label rennais spaghrecords : Monkey Analow (‘acid light’ ep le 23 janvier) ; Oil B. (‘plume’ ep le 25 février) ; le tout accompagné par Squatt. Les décors noir et blanc de Size et le dress code de rigueur participeront à installer une ambiance … Versatile.'),
