(1740, 843, '_feedback_akismet_values', 'a:44:{s:14:"comment_author";s:0:"";s:20:"comment_author_email";s:25:"loubnabentamy@hotmail.com";s:18:"comment_author_url";s:0:"";s:20:"contact_form_subject";s:8:"[contact";s:17:"comment_author_IP";s:14:"212.198.111.18";s:15:"comment_content";s:333:"Bonjour, \r\nSur les recommandations de Camille de l''association ATM, je me permets de prendre contact avec vous concernant la soirée de samedi soir Legowelt, Bot''Ox, Prosumer, à la MJC Antipode. \r\nVendez-vous des places à des tarifs préférentiels pour les titulaires de la carte Antipode/ubu ? \r\nMerci! \r\nBonne journée, \r\nLoubna";s:12:"comment_type";s:12:"contact_form";s:7:"user_ip";s:14:"212.198.111.18";s:10:"user_agent";s:102:"Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.22 (KHTML, like Gecko) Chrome/25.0.1364.152 Safari/537.22";s:8:"referrer";s:33:"http://www.openfader.org/contact/";s:4:"blog";s:24:"http://www.openfader.org";s:15:"SERVER_SOFTWARE";s:22:"Apache/2.2.14 (Ubuntu)";s:11:"REQUEST_URI";s:9:"/contact/";s:15:"REDIRECT_STATUS";s:3:"200";s:9:"HTTP_HOST";s:17:"www.openfader.org";s:15:"HTTP_CONNECTION";s:10:"keep-alive";s:14:"CONTENT_LENGTH";s:3:"574";s:18:"HTTP_CACHE_CONTROL";s:9:"max-age=0";s:11:"HTTP_ACCEPT";s:63:"text/html,application/xhtml+xml,application/xml;q=0.9,*/*;q=0.8";s:11:"HTTP_ORIGIN";s:24:"http://www.openfader.org";s:15:"HTTP_USER_AGENT";s:102:"Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.22 (KHTML, like Gecko) Chrome/25.0.1364.152 Safari/537.22";s:12:"CONTENT_TYPE";s:33:"application/x-www-form-urlencoded";s:12:"HTTP_REFERER";s:33:"http://www.openfader.org/contact/";s:20:"HTTP_ACCEPT_ENCODING";s:17:"gzip,deflate,sdch";s:20:"HTTP_ACCEPT_LANGUAGE";s:35:"fr-FR,fr;q=0.8,en-US;q=0.6,en;q=0.4";s:19:"HTTP_ACCEPT_CHARSET";s:30:"ISO-8859-1,utf-8;q=0.7,*;q=0.3";s:4:"PATH";s:28:"/usr/local/bin:/usr/bin:/bin";s:16:"SERVER_SIGNATURE";s:59:"Apache/2.2.14 (Ubuntu) Server at www.openfader.org Port 80\n";s:11:"SERVER_NAME";s:17:"www.openfader.org";s:11:"SERVER_ADDR";