ut en les confrontant à une musicalité exigeante et tonique."\r\n\r\n\r\n* La Montagne (mai 2013) - en 1ère partie des Tistics/les Franglaises à La 2Deuche (Lempdes - 63) :\r\n Devant une salle pleine, une première partie avec une révélation, Jules. Pétillant, gouailleur, drôle, le chanteur distille avec de belles mimiques des textes bien ficelés. Il a su chauffé la salle, seulement avec un guitariste, juste à un très très bon niveau. Retenez ce prénom..."\r\n(l''intégralité de l''article en PJ).\r\n\r\n\r\n* Francofans (février/mars 2013) : "C''est drôle, percutant, touchant car mis en musique avec beaucoup d''ingéniosité (...). Jules confirme avec cette nouvelle salve de titres un style corrosif bien assumé (...). N''est pas Sale Gosse qui veut, lui y arrive avec brio." \r\n(l''intégralité de l''article en PJ)\r\n\r\n\r\n\r\n\r\n* Longueur d''Ondes (février 2013) : "Troisième album pour cet énergumène qui sait soulever les salles avec ses chansons tubesques qui se fredonnent dès le deuxième refrain."\r\n\r\n\r\nJe reste à votre entière disposition pour tous renseignements complémentaires .\r\n\r\n \r\nbonne réception \r\ncordialement \r\n \r\n\r\n\r\n Béatrice Mochel \r\npresse pour Jules \r\n06 80 84 01 80\r\n \r\n \r\n \r\n pour \r\nb.a.b & b.a.p\r\nTél : +33 (0)1 46 06 29 26\r\nwww.beatriceadnotbooking.com\r\n\r\n\r\n ";}'),
