(1982, 903, '_feedback_email', 'a:4:{s:2:"to";a:1:{i:0;s:19:"openfader@gmail.com";}s:7:"subject";s:8:"[contact";s:7:"message";s:492:": commuiaction@audiogenic.fr\nemail: commuiaction@audiogenic.fr\nMessage: Bonjour,\r\n\r\nLe label Audiogenic organise, à l''occasion de la sortie du nouvel album de Radium, la tournée Excess Overdrive.\r\nNous serons le 2 Novembre à l''UBU.\r\n\r\nJe souhaite discuter d''un partenariat à ce sujet.\r\n\r\nCordialement\nNom: Audiogenic\n\nHeure: Mardi 1 octobre 2013 à 9&#104; 01\nAdresse IP : 80.12.87.94\nURL du formulaire de contact : http://www.openfader.org/contact/\nEnvoyé par un visiteur non vérifié.";s:7:"headers";s:172:"From: commuiaction@audiogenic.fr <wordpress@www.openfader.org>\r\nReply-To: commuiaction@audiogenic.fr <commuiaction@audiogenic.fr>\r\nContent-Type: text/plain; charset="UTF-8"";}'),
