(2213, 956, '_feedback_all_fields', 'a:3:{s:3:"Nom";s:22:"Nico de Digital Window";s:5:"email";s:23:"lemee.nicolas@gmail.com";s:7:"Message";s:867:"Salut à tous ! \r\nUn petit message pour encore vous remercier pour cette excellente soirée.\r\nJe crois que tout le monde était content ! \r\nJe récupère les rush à droite à gauche des différents films/photos tournés sur place. Cela prend un peu de temps car ce sont de gros fichiers et les copains sont tout sauf réactifs.\r\nMis à part ça, j''aurai besoin des Records de la soirée. Comme je ne suis pas à Rennes ça va être dur de me les filer en physique. Donc si une âme charitable peut m''envoyer ça via Dropbox ou autre ça sera avec grand plaisir. Pas de son, pas de montage ! Les images tabassent, elles sont un peu sombres pour certaines mais c''est grunge donc c''est cool.\r\n\r\nConcernant votre prochaine soirée, contactez moi pour qu''on voit ensembles comment être encore plus au top pour la capta.\r\n\r\nMerci encore de la part de tout le monde.\r\nNico";}'),
(2208, 956, '_feedback_author_email', 'lemee.nicolas@gmail.com'),
(2206, 955, '_feedback_email', 'a:4:{s:2:"to";a:1:{i:0;s:19:"openfader@gmail.com";}s:7:"subject";s:8:"[contact";s:7:"message";s:795:": kamilafranca@hotmail.fr\nemail: kamilafranca@hotmail.fr\nMessage: Bonjour,\r\n\r\nj''espère que vous lirez ce message ce soir, puisque j''ai un gros problème. J''avais acheté deux places pour ce soir, et sans faire exprès, j''ai téléchargé une place 2 fois, au lieu de télécharger les deux.. Résultat, je me retrouve avec 2 mêmes places mais pas avec l''autre et je ne sais pas du tout comment faire pour l''avoir vu que je l''ai pas reçu par mail.\r\nS''il vous plait aidez moi dès que vous pourrez ! Voici mon numéro (vous pouvez aussi répondre par mail) : 06 61 55 70 49\r\nMerci\r\n\r\nCordialement\r\nKamila França\nNom: FRANCA\n\nHeure: 1 février 2014 at 18 h 28 min\nAdresse IP : 82.236.143.77\nURL du formulaire de contact : http://www.openfader.org/contact/\nEnvoyé par un visiteur non vérifié.";s:7:"headers";s:163:"From: kamilafranca@hotmail.fr <wordpress@www.openfader.org>\r\nReply-To: kamilafranca@hotmail.fr <kamilafranca@hotmail.fr>\r\nContent-Type: text/plain; charset="UTF-8"";}'),
