(2215, 956, '_feedback_akismet_values', 'a:41:{s:14:"comment_author";s:0:"";s:20:"comment_author_email";s:23:"lemee.nicolas@gmail.com";s:18:"comment_author_url";s:0:"";s:20:"contact_form_subject";s:8:"[contact";s:17:"comment_author_IP";s:13:"82.232.66.136";s:15:"comment_content";s:867:"Salut à tous ! \r\nUn petit message pour encore vous remercier pour cette excellente soirée.\r\nJe crois que tout le monde était content ! \r\nJe récupère les rush à droite à gauche des différents films/photos tournés sur place. Cela prend un peu de temps car ce sont de gros fichiers et les copains sont tout sauf réactifs.\r\nMis à part ça, j''aurai besoin des Records de la soirée. Comme je ne suis pas à Rennes ça va être dur de me les filer en physique. Donc si une âme charitable peut m''envoyer ça via Dropbox ou autre ça sera avec grand plaisir. Pas de son, pas de montage ! Les images tabassent, elles sont un peu sombres pour certaines mais c''est grunge donc c''est cool.\r\n\r\nConcernant votre prochaine soirée, contactez moi pour qu''on voit ensembles comment être encore plus au top pour la capta.\r\n\r\nMerci encore de la part de tout le monde.\r\nNico";s:12:"comment_type";s:12:"contact_form";s:7:"user_ip";s:13:"82.232.66.136";s:10:"user_agent";s:72:"Mozilla/5.0 (Windows NT 6.1; WOW64; rv:26.0) Gecko/20100101 Firefox/26.0";s:8:"referrer";s:33:"http://www.openfader.org/contact/";s:4:"blog";s:24:"http://www.openfader.org";s:15:"SERVER_SOFTWARE";s:22:"Apache/2.2.14 (Ubuntu)";s:11:"REQUEST_URI";s:9:"/contact/";s:15:"REDIRECT_STATUS";s:3:"200";s:9:"HTTP_HOST";s:17:"www.openfader.org";s:15:"HTTP_USER_AGENT";s:72:"Mozilla/5.0 (Windows NT 6.1; WOW64; rv:26.0) Gecko/20100101 Firefox/26.0";s:11:"HTTP_ACCEPT";s:63:"text/html,application/xhtml+xml,application/xml;q=0.9,*/*;q=0.8";s:20:"HTTP_ACCEPT_LANGUAGE";s:35:"fr,fr-fr;q=0.8,en-us;q=0.5,en;q=0.3";s:20:"HTTP_ACCEPT_ENCODING";s:13:"gzip, deflate";s:12:"HTTP_REFERER";s:33:"http://www.openfader.org/contact/";s:15:"HTTP_CONNECTION";s:10:"keep-alive";s:12:"CONTENT_TYPE";s:33:"application/x-www-form-urlencoded";s:14:"CONTENT_LENGTH";s:4:"1139";s:4:"PATH";s:28:"/usr/local/bin:/usr/bin:/bin";s:16:"SERVER_SIGNATURE";s:59:"Apache/2.2.14 (Ubuntu) Server at www.openfader.org Port 80\n";s:11:"SERVER_NAME";s:17:"www.openfader.org";s:11:"SERVER_ADDR";s:11:"92.243.8.53";s:11:"SERVER_PORT";s:2:"80";s:11:"REMOTE_ADDR";s:13:"82.232.66.136";s:13:"DOCUMENT_ROOT";s:36:"/srv/d_wab2/www/openfader.org/htdocs";s:12:"SERVER_ADMIN";s:17:"wab2com@gmail.com";s:15:"SCRIPT_FILENAME";s:46:"/srv/d_wab2/www/openfader.org/htdocs/index.php";s:11:"REMOTE_PORT";s:5:"51548";s:12:"REDIRECT_URL";s:9:"/contact/";s:17:"GATEWAY_INTERFACE";s:7:"CGI/1.1";s:15:"SERVER_PROTOCOL";s:8:"HTTP/1.1";s:14:"REQUEST_METHOD";s:4:"POST";s:12:"QUERY_STRING";s:0:"";s:11:"SCRIPT_NAME";s:10:"/index.php";s:8:"PHP_SELF";s:10:"/index.php";s:12:"REQUEST_TIME";s:10:"1391534066";}'),
(2216, 956, '_feedback_email', 'a:4:{s:2:"to";a:1:{i:0;s:19:"openfader@gmail.com";}s:7:"subject";s:8:"[contact";s:7:"message";s:1131:": lemee.nicolas@gmail.com\nemail: lemee.nicolas@gmail.com\nMessage: Salut à tous ! \r\nUn petit message pour encore vous remercier pour cette excellente soirée.\r\nJe crois que tout le monde était content ! \r\nJe récupère les rush à droite à gauche des différents films/photos tournés sur place. Cela prend un peu de temps car ce sont de gros fichiers et les copains sont tout sauf réactifs.\r\nMis à part ça, j''aurai besoin des Records de la soirée. Comme je ne suis pas à Rennes ça va être dur de me les filer en physique. Donc si une âme charitable peut m''envoyer ça via Dropbox ou autre ça sera avec grand plaisir. Pas de son, pas de montage ! Les images tabassent, elles sont un peu sombres pour certaines mais c''est grunge donc c''est cool.\r\n\r\nConcernant votre prochaine soirée, contactez moi pour qu''on voit ensembles comment être encore plus au top pour la capta.\r\n\r\nMerci encore de la part de tout le monde.\r\nNico\nNom: Nico de Digital Window\n\nHeure: 4 février 2014 at 17 h 14 min\nAdresse IP : 82.232.66.136\nURL du formulaire de contact : http://www.openfader.org/contact/\nEnvoyé par un visiteur non vérifié.";s:7:"headers";s:163:"From: lemee.nicolas@gmail.com <wordpress@www.openfader.org>\r\nReply-To: lemee.nicolas@gmail.com <lemee.nicolas@gmail.com>\r\nContent-Type: text/plain; charset="UTF-8"";}'),
