(2225, 958, '_feedback_akismet_values', 'a:41:{s:14:"comment_author";s:0:"";s:20:"comment_author_email";s:30:"undergroove.bretagne@gmail.com";s:18:"comment_author_url";s:0:"";s:20:"contact_form_subject";s:8:"[contact";s:17:"comment_author_IP";s:9:"2.10.9.17";s:15:"comment_content";s:571:"Bonjour,\r\nNous sommes Undergroove, un groupe de groove rennais.\r\nA l''occasion de la sortie de notre premier album (Rythmicotractable), nous organisons une soirée concert le 26 avril 2014 dans la salle de concert du 4bis à Rennes (35).\r\nN''hésitez pas à venir pour découvrir notre univers musical et scénique.\r\n\r\nPour plus d''informations sur le groupe, vous pouvez aussi visiter notre site www.undergroove.fr/ ou notre facebook www.facebook.com/undergroove.quartet\r\nMerci d''avance de votre intérêt,\r\n\r\nCordialement,\r\n\r\nMartin Capon (06 16 34 16 61) pour Undergroove";s:12:"comment_type";s:12:"contact_form";s:7:"user_ip";s:9:"2.10.9.17";s:10:"user_agent";s:72:"Mozilla/5.0 (Windows NT 6.1; WOW64; rv:27.0) Gecko/20100101 Firefox/27.0";s:8:"referrer";s:33:"http://www.openfader.org/contact/";s:4:"blog";s:24:"http://www.openfader.org";s:15:"SERVER_SOFTWARE";s:22:"Apache/2.2.14 (Ubuntu)";s:11:"REQUEST_URI";s:9:"/contact/";s:15:"REDIRECT_STATUS";s:3:"200";s:9:"HTTP_HOST";s:17:"www.openfader.org";s:15:"HTTP_USER_AGENT";s:72:"Mozilla/5.0 (Windows NT 6.1; WOW64; rv:27.0) Gecko/20100101 Firefox/27.0";s:11:"HTTP_ACCEPT";s:63:"text/html,application/xhtml+xml,application/xml;q=0.9,*/*;q=0.8";s:20:"HTTP_ACCEPT_LANGUAGE";s:35:"fr,fr-fr;q=0.8,en-us;q=0.5,en;q=0.3";s:20:"HTTP_ACCEPT_ENCODING";s:13:"gzip, deflate";s:12:"HTTP_REFERER";s:33:"http://www.openfader.org/contact/";s:15:"HTTP_CONNECTION";s:10:"keep-alive";s:12:"CONTENT_TYPE";s:33:"application/x-www-form-urlencoded";s:14:"CONTENT_LENGTH";s:3:"802";s:4:"PATH";s:28:"/usr/local/bin:/usr/bin:/bin";s:16:"SERVER_SIGNATURE";s:59:"Apache/2.2.14 (Ubuntu) Server at www.openfader.org Port 80\n";s:11:"SERVER_NAME";s:17:"www.openfader.org";s: