(2, 1, '2010-03-07 17:48:48', '2010-03-07 17:48:48', '<h2>Historique :</h2>\r\nDepuis 2004,<strong> les Faders</strong> font bouillonner la scène Rennaise avec de nombreux et différents projets comme des émission radios, des soirées tant dans les bars que dans les salles, publiques ou privées. De part les moultes artistes invités et ses différents artistes résidents !\r\n\r\nA la base, un projet d''émission pour <strong><a href="http://www.radiocampusrennes.fr">Radio Campus Rennes</a></strong>, <strong>Open Fader</strong> ne reste pas longtemps en studio, les émissions sont alors en live et en direct du bar <strong><a href="http://www.facebook.com/barlechantier">Le Chantier</a></strong>, l''organisation de soirées pointait déjà le bout des son nez !!\r\n\r\nEn 2005, <strong>DavLebill</strong>, <strong>DRJD Low</strong>, <strong>Karlotta</strong>, <strong>Menthine</strong> et <strong><a href="http://www.spaghrecords.fr/artists/oil-b">Oil B.</a></strong> fondent<strong> ElektroPitch</strong> afin de développer les soirées <strong>Open Fader</strong>. les premières  au <strong>Jardin Moderne</strong> attirent du monde, en parrallèle, les émissions continuent au<strong> Chantier</strong> et l''asso. se voit proposer un créneau sur la Web radio <strong><a href="http://www.electrone.net">ElectrOne</a></strong>. Le 1er avril 06, les Faders remplissent l''<strong><a href="http://www.ubu-rennes.com/">Ubu</a> </strong>en proposant une soirée entière et progressive, simplement avec ses résidents, 2 bouts de tissu et quelques plantes. Une <em>part 2</em> s''imposait ...\r\n\r\nEn 2007, <strong>ElektroPitch</strong> s''élargi ... les projets fusent, les soirées s''exportent ! L''asso compte alors 20 membres actifs dont 10 Dj''s d''horizons différents, 2 Vj''s, 1 live et une photographe ...\r\n\r\n2009, une pause et un retour aux sources s''imposaient après un <strong>Printemps Industriel</strong> rempli d''émotions.\r\n\r\nAujourd''hui, Les Faders sont enfin de retour avec une identité visuelle toute fraîche ; un nouveau site ;  et des projets aboutis, muris, à l''image de la <a title="Close Up" href="http://localhost:8888/wp-openfader/2010/events/close-up-samedi-3-avril-a-lubu-club/">Close Up</a> ... et ce n''est pas une illusion ...\r\n<h2>Artistes qui ont défilés dans une Open Fader (hors résidents) :</h2>\r\n<strong><em><span style="text-decoration: underline;">Live/Dj :</span></em></strong> The Youngsters,  D.a.v.e. the drummer, E-Swat, PadaOne, James Ruskin, Run X, le Sonic Crew, Alex L aka Lowkey, Pat''Panik, Leven, Tarik''n''Djamel, Lady Late, The Edger, Reflex, Soap crew, Hip-J, Steve Rachmad, Dj Jee, Oxyd, Nicolas Masseyeff, Raudive,  ...\r\n\r\n<strong><span style="text-decoration: underline;"><em>Vj :</em></span> </strong>Miss~Chémar, Charlie Mars,  Scouap, Koniec, Bombaklak, Ratsi[emovie], Eyescore, ...\r\n\r\n<strong><span style="text-decoration: underline;"><em>Performer </em></span>:</strong> Psychetic, Anartiste (l''homme cent visages), Migwel &amp; Rom1, ...', 'À propos', '', 'publish', 'closed', 'open', '', 'a-propos', '', '', '2013-02-03 15:41:40', '2013-02-03 15:41:40', '', 0, 'http://92.243.15.64/?page_id=2', 0, 'page', '', 0),
(3, 1, '2010-03-08 01:24:09', '2010-03-08 01:24:09', 'Vous l''avez probablement remarqué, les Faders se dotent d''une toute nouvelle identité visuelle.\r\n\r\nVoici donc la présentation du nouveau logo &amp; sigle déssiné pour l''asso par le <a href="http://kornographe.blogspot.com/">kornographe</a>, après 5 ans de loyaux service de notre fleur préférée.\r\n\r\n<img class="aligncenter size-full wp-image-31" title="presentation_logo" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/03/presentation_logo.jpg" alt="presentation logo open fader" width="480" height="447" />', 'New logo & new site', 'Open Fader se dote d''une nouvelle identité visuelle : un nouveau logo & un nouveau site.', 'publish', 'open', 'open', '', 'new-logo-new-site', '', '', '2010-03-08 13:44:14', '2010-03-08 13:44:14', '', 0, 'http://92.243.15.64/?p=3', 0, 'post', '', 1),
