(9, 1, '2010-03-08 03:50:06', '2010-03-08 03:50:06', '<p style="text-align: center;"><img class="aligncenter size-full wp-image-13" title="spg05_web" src="http://92.243.15.64/wp-content/uploads/2010/03/spg05_web.jpg" alt="sekence ep" width="480" height="480" /></p>\r\nAprès le surprenant <em>King Kong &amp; The Fonky Whales ep </em>sorti en juin 2009, <strong><a href="http://www.myspace.com/oilb">Oil B.</a></strong> signe avec ce maxi  sa deuxième sortie chez <strong><a href="http://www.spagh.fr">SPAGH records</a></strong>\r\n\r\nSekence ep est donc disponible depuis le mois de février 2010 sur la plupart des plateformes de téléchargement comme Beatport, Junorecords, Trackitdown, Beatdigital, ...\r\n\r\n5ème opus du label d''Hip-J,  cet ep se compose de 3 groovy-tracks naviguant entre House et Techno.\r\n\r\n<!-- //         BEGIN BEATPORT PLAYER            - -->\r\n<div class="beatport" style="border: 0px; background: transparent; padding: 10px;"><map name="bottomlinks"> <area coords="0,0,225,50" href="http://www.beatport.com" alt="Go to Beatport.com" target="_blank" /> <area coords="237,12,332,38" href="http://www.beatport.com/viralPlayer/relay?playerId=1137111" alt="Get These Tracks" target="_blank" /> <area coords="332,12,422,38" href="http://www.beatportplayer.com/?playerId=1137111" alt="Add This Player" target="_blank" /></map><img style="display: block; border: none;" usemap="#bottomlinks" src="http://ak-media.beatport.com/images/beatport/viralPlayer/top.gif" alt="" /><object style="display: block;" classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" width="442" height="264" codebase="http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,40,0"><param name="align" value="center" /><param name="data" value="https://ak-secure-beatport.bpddn.com/swf/beatportplayer.swf" /><param name="allownetworking" value="internal" /><param name="allowScriptAccess" value="never" /><param name="enableJSURL" value="false" /><param name="enableHREF" value="false" /><param name="saveEmbedTags" value="true" /><param name="flashvars" value="bpCfgPath=http://www.beatport.com/en-US/xml/gui/swf/configuration/3&amp;playerId=1137111&amp;autoplay=0&amp;volume=80" /><param name="loop" value="false" /><param name="menu" value="false" /><param name="quality" value="high" /><param name="salign" value="lt" /><param name="scale" value="noscale" /><param name="src" value="https://ak-secure-beatport.bpddn.com/swf/beatportplayer.swf" /><embed style="display: block;" type="application/x-shockwave-flash" width="442" height="264" src="https://ak-secure-beatport.bpddn.com/swf/beatportplayer.swf" scale="noscale" salign="lt" quality="high" menu="false" loop="false" flashvars="bpCfgPath=http://www.beatport.com/en-US/xml/gui/swf/configuration/3&amp;playerId=1137111&amp;autoplay=0&amp;volume=80" saveembedtags="true" enablehref="false" enablejsurl="false" allowscriptaccess="never" allownetworking="internal" data="https://ak-secure-beatport.bpddn.com/swf/beatportplayer.swf" align="center"></embed></object>\r\n\r\nVous pouvez aussi trouver le maxi sur <a href="spotify:album:6An5p3cDIugkBCmImw2pwi">Spotify</a> !\r\n\r\nA noter que la prochaine sortie du label est déja prévue pour avril ... à suivre de près donc !\r\n\r\n</div>\r\n<!-- //         END BEATPORT PLAYER             - -->', 'Sekence ep by Oil B.', 'Sekence ep, le nouveau maxi produit par Oil B. sur le label rennais SPAGH records est disponible sur la majorité des plateformes digitales depuis février 2010.', 'publish', 'open', 'open', '', 'sekence-ep-by-oil-b', '', '', '2013-02-13 18:40:09', '2013-02-13 18:40:09', '', 0, 'http://92.243.15.64/?p=9', 0, 'post', '', 0),
