(17, 1, '2010-03-08 04:23:32', '2010-03-08 04:23:32', 'Abracadabra !! Plutôt que de faire disparaître l’<strong>Ubu</strong>, <strong>les Faders</strong> s’apprêtent à y faire apparaître une nouvelle soirée : la <strong>Close Up</strong> !\r\n<p style="text-align: center;"><img class="size-full wp-image-21 aligncenter" title="closeup_web" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/03/closeup_web-e1268022408153.jpg" alt="close up" width="480" height="672" /></p>\r\nRemarque ?! Faisons disparaître l’Ubu ... puisqu’ils ont cette fois décidé d’implanter un véritable cabaret pour magiciens à la place !\r\n\r\nUne soirée inédite donc, puisque <strong>la magie</strong> est au coeur de l’évènement !\r\n<h3>La soirée :</h3>\r\nÀ soirée inédite, invité de marque car <strong><a href="http://www.myspace.com/rodriguezjr">RODRIGUEZ Jr</a></strong> nous fait l’honneur de revenir à l’Ubu, après la venue des Youngsters il y a 4 ans. Fruit d’une créativité aux relans presques schyzophréniques, son <span style="font-weight: normal; font-size: 13px;"><strong>nouveau live </strong></span><span style="font-weight: normal; font-size: 13px;">s’avère frais, percussif &amp; surprenant !!</span>\r\n<p style="text-align: center;"><img class="aligncenter size-full wp-image-51" title="rodriguezjr" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/03/rodriguezjr-e1268097167788.jpg" alt="rodriguez jr" width="300" height="200" /></p>\r\n<p style="text-align: left;"><em>Not many electronic music producers manage to release award-winning albums, sell shedloads of 12''''s and perform the world over before they hit the big 3-0.\r\nBut Brussels-based Rodriguez Jr - aka Olivier M - has done exactly that.\r\nAs half of French electro act, The Youngsters, he''s already packed more into his time in the industry than some do over their whole career - and he''s still just 29.\r\nOver the past six years he and his partner in crime have released loads of EPs and remixed tracks of dozens artists.\r\nTheir two studios albums - released, like their singles, on F-Com - won a string of awards and won accolades from some of dance music''s biggest names.\r\nThis success catapaulted them onto the international circuit, giving them the platform to take their electrifying live act to some of the biggest clubs and festivals in Europe, South America and Asia several times over.\r\nNow holed-up in the Belgian capital, Olivier’s Rodriguez project is the product of an almost schizophrenic brand of creativity, and a thirst for the new and unexpected.\r\nGoing solo offers something valuable within this business: the freedom to experiment, step off the release/gig/release merry-go-round, and break out of the musical mind-ghetto that so many great acts end up slipping into.\r\nThe Rodriguez alter-ego represents his own journey of re-discovery.\r\nDrawing inspiration from artists as diverse as Stockhausen, LFO, Carl Craig, Eric Satie, Kraftwerk or Michel Polnareff, his spirit of adventure translates into music that can’t comfortably be pigeon-holed.\r\nWhile it’s all electronic, and put together largely in Rodriguez’s own MLab Mk5 studio in Brussels, his music can be leftfield and experimental or rich, melodic and poppy – depending on his mood. Freedom indeed.</em></p>\r\n<p style="text-align: left;"><em>\r\n</em></p>\r\nFader résident, <strong><a href="http://www.myspace.com/oilb">Oil B.</a></strong> lui ouvre la soirée (c’est là qui faut sortir du chapeau son actu, un nouveau maxi : <em>«sekence ep» sur <strong>SPAGH records</strong></em>) avec dextérité, s’il vous plait !\r\n<p style="text-align: center;"><img class="aligncenter size-full wp-image-97" title="tof_web" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/03/tof_web-e1268665528396.jpg" alt="oilb" width="300" height="221" /></p>\r\n<em>Oil B. développe une techno aux ambiances profondes, minimalistes, imbibées de multiples influences.\r\n<span style="font-style: normal;"><em>Co-fondateur d’</em><strong><em>Open Fader</em></strong><em>, c’est dans des dj set précis, progressifs, naviguant de la house calme à la techno agitée, qu’il se produit sur scène (Ubu Club, Vauban, Batofar, Astropolis 08, Transmusicales 09 ...)\r\n<span style="font-style: normal;"><em>Suite à la sortie sur SPAGH records du surprenant "</em><strong><em>King Kong &amp; the Fonky Whales ep</em></strong><em>" aux cotés de </em><a href="http://spagh.fr/Hip-J.html"><em>Hip-J</em></a><em>, il prépare actuellement celle du 5ème opus du label, "sekence ep", un maxi aux couleurs originales ...</em></span></em></span></em>\r\n\r\n<em>\r\n</em>\r\n\r\n<strong><a href="http://www.myspace.com/dataproviders">Bood²</a></strong>, du collectif Data Providers, se charge quant à lui de clôturer cette soirée, avec fougue, merci !!\r\n<p style="text-align: center;"></p>\r\n<em>Bood² s''est forgé à la techno old school des 90’s au travers de laquelle il pose les 1ers jalons de sa collection de vyniles...\r\nAlliant ses influences technoïdes passées aux productions les + récentes, Bood² offre des sets évolutifs s''adaptant aux ambiances athmosphériques comme à la ferveur nocturne de dancefloors en plein rush!!!</em>\r\n\r\n<em><img class="alignnone size-full wp-image-99" title="bood²" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/03/bood²-e1268665657469.jpg" alt="bood²" width="300" height="290" />\r\n</em>\r\n\r\n<strong><a href="http://www.myspace.com/akkaveejays">Akkavj</a></strong>, <strong><a href="http://www.myspace.com/eyescore">Eyescore</a></strong> &amp; Carole sont de mèche avec quelques <strong>prestidigitateurs</strong> afin de réaliser visuellement ce tour de magie !!\r\n<h3><span style="font-weight: normal;">PAF :</span></h3>\r\n<strong>13/14€</strong> en prévente\r\nBar le Chantier, 18 carrefour Jouaust, Rennes\r\n\r\n<strong>14/15€</strong> sur place\r\nUbu Club, 1 rue St Hélier, Rennes\r\n<h3>Befores :</h3>\r\nDes soirées sont prévus en amont de la soirée bien sûr :  infos à venir dans un prochain post dédié', 'Close Up | samedi 3 avril à l''Ubu Club', 'Nouvelle soirée après presque 1 an d''absence et nouveau projet : la "Close Up" se veut être un véritable rendez-vous de magie dans une soirée électro; un véritable cabaret dansant truffé d''illusions.  \r\nOpen Fader | Close Up | Samedi 3 avril | UBU Club | 23h-5h\r\nRodriguez Jr (live)| Oil B. | Bood² | Akkavj & Eyescore.', 'publish', 'open', 'open', '', 'close-up-samedi-3-avril-a-lubu-club', '', '', '2013-02-13 18:39:42', '2013-02-13 18:39:42', '', 0, 'http://92.243.15.64/?p=17', 0, 'post', '', 4),
