(35, 1, '2010-03-08 14:56:50', '2010-03-08 14:56:50', '<p style="text-align: center;"><img class="aligncenter size-full wp-image-36" title="openmagik" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/03/openmagik-e1268059305609.jpg" alt="concours sleeve my face" width="480" height="194" /></p>\r\n\r\n<h3>le concours</h3>\r\nLes Faders &amp; <a href="http://blog.magikstudio.fr">MagikStudio</a> s''associent pour vous proposer un jeu-concours afin de gagner des place pour la prochaine Open Fader "<a href="http://localhost:8888/wp-openfader/2010/events/close-up-samedi-3-avril-a-lubu-club/">Close Up</a>" qui se tiendra à l''Ubu le samedi 3 avril.\r\nDes places, oui, mais pas n''importe lesquels, puisqu''ils s''agit des 2 packs de 2 places + 1 bouteille de champagne à gagner.\r\n<h3>Modalités</h3>\r\nLe principe est simple, vous vous prenez en photo dans le plus pur style « Sleeveface » et vous nous envoyez vos shoot par mail à cette adresse : <strong>buzz[at]magikstudio.fr</strong>\r\n\r\nUn jury composé du collectif OPEN FADER et de la Team Magik Studio, graphistes, photographes, choisiront <strong>5 photos</strong> qui seront postées sur le blog Magik Studio <strong>le 20 mars</strong>. Les deux photos les plus commentées, en bien ou en mal, seront alors récompensées.\r\n<blockquote>LE TRUC MARCHE AVEC DES VINYLES MAIS AUSSI AVEC DES CD, ALORS LÂCHEZ VOUS !</blockquote>\r\nPour un effet parfait, mettez-vous en scène dans un lieu et avec des habits qui correspondent.\r\nEt pour trouver des pochettes de 33 tours, pourquoi ne pas visiter <strong>« Les troubadours du chaos »</strong> rue de st-malo, ou <strong>« Rock’in Bones »</strong> rue d’antrain ?\r\n<h3>Quelques exemples de "sleeve face" :</h3>\r\n<p style="text-align: center;"><a href="http://www.sleeveface.com/"><img class="aligncenter" title="exemple sleeve face 1" src="http://www.sleeveface.com/pics/neil-davies-and-emily-chemical-brothers.jpg" alt="" width="448" height="336" /></a></p>\r\n<p style="text-align: center;"><a href="http://www.sleeveface.com"><img class="aligncenter" title="ex sleeve face 2" src="http://www.sleeveface.com/pics/neil-davies-and-emily-uffie.jpg" alt="" width="448" height="336" /></a></p>\r\n<p style="text-align: center;"><a href="http://www.sleeveface.com/"><img class="aligncenter" title="es sleeve face 3" src="http://www.sleeveface.com/pics/Larry-Swerdlove-and-Swerdlove-Bob-Dylan.jpg" alt="" width="448" height="448" /></a></p>\r\n<p style="text-align: left;">Alors, à vos appareils !!!</p>', 'Concours Sleeve my face', 'Les Faders s''associent avec Magik Studio et vous proposent un concours "sleeve my face" afin de vous faire gagner des places pour la soirée "Close Up" à l''Ubu le samedi 3 avril.', 'publish', 'open', 'open', '', 'concours-sleeve-my-face', '', '\nhttp://www.openfader.org/2010/events/close-up-samedi-3-avril-a-lubu-club/\nhttp://www.magikstudio.fr/magikblog/2010/02/24/jeu-concours-open-fader-magik-studio/', '2010-03-09 17:10:55', '2010-03-09 17:10:55', '', 0, 'http://localhost:8888/wp-openfader/?p=35', 0, 'post', '', 0),
