(87, 1, '2010-03-15 12:34:33', '2010-03-15 12:34:33', 'L''enregistrement en direct &amp; en public de la prochaine émission radio aura lieu<strong> Vendredi 19 mars</strong> au bar <strong>Le Chantier</strong>, c''est de 20h à 01h et c''est free :\r\nUne émission <strong>Break to Drum</strong> présenté par <strong>Brim Brim &amp; Katell </strong>avec<strong> Brim Brim &amp; Katell </strong>!!\r\n<p style="text-align: center;"><img class="aligncenter size-full wp-image-103" title="emission_200310" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/03/emission_200310.jpg" alt="emission mars" width="400" height="556" /></p>\r\nDiffusion sur les ondes : samedi 27 mars de 21h à 00h sur <a href="http://www.radiocampusrennes.fr">Radio Campus Rennes</a> (88.4 fm).\r\n<p style="text-align: center;"></p>', 'Émission RCR | mars | Vend 19 mars au Chantier', 'Enregistrement de l''émission radio de mars en direct & en public au bar Le Chantier', 'publish', 'open', 'open', '', 'emission-rcr-mars', '', '', '2010-03-16 12:56:52', '2010-03-16 12:56:52', '', 0, 'http://localhost:8888/wp-openfader/?p=87', 0, 'post', '', 0),
