(106, 1, '2010-03-23 12:49:13', '2010-03-23 12:49:13', 'À l''occasion des 5 ans de l''association, les Faders ont concocté un magik parcours autour de la soirée "<strong>Close Up</strong>" qui se tiendra le samedi 3 avril à l''Ubu.\r\n\r\n3 jours, <strong>3 soirées électro</strong> associées dans lesquels déambuleront des magiciens qui viendront vous émerveiller à coup de tour de cartes &amp; autres subtilités du close up.\r\n<p style="text-align: center;"><img class="aligncenter size-full wp-image-107" title="parcours" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/03/parcours.jpg" alt="" width="470" height="150" /></p>\r\n\r\n<h3>Jeudi 1 avril :  El Teatro</h3>\r\n<em>Pleasure to Play spéciale "Close Up"</em>\r\n<strong>K-Lymero</strong> (S''il te Play) dédie sa résidence dans le nouveau bar de nuit rennais à la soirée.\r\nAu programme : 2 salles de 23h à 03h avec <strong>K-Lymero</strong> | <strong>Dj''P</strong> | <strong>DRJD Low</strong> | <strong>Fat Freddy</strong>\r\nPAF : <strong>12 €</strong> avec 2 consos (champagne, vodka , etc)\r\n<h3>Vendredi 2 avril : Le Chantier</h3>\r\n<em>Pyramid Menthine Tour le come back.</em>\r\nune <em>magik before</em> de 21h à 01h avec <strong>Menthine</strong> | <strong>Chou</strong> | <strong>Katell</strong> au bar "QG"\r\n<strong>Entrée Libre</strong>\r\n<h3>Samedi 3 avril : Ubu Club</h3>\r\n<strong></strong>Et bien sur la "<strong><a href="http://localhost:8888/wp-openfader/2010/events/close-up-samedi-3-avril-a-lubu-club/">Close Up</a></strong>" à l''Ubu Club le <strong>samedi 3 avri</strong>l à l''Ubu avec <strong>Rodriguez Jr</strong> (live) | <strong>Oil B.</strong> | <strong>Bood²</strong> | <strong>Akka vjs &amp; Eyescore</strong>.', 'Close Up : le parcours du 1er au 3 avril', 'À l''occasion des 5 ans de l''association, les Faders ont concocté un magik parcours autour de la soirée "Close Up" qui se tiendra le samedi 3 avril à l''Ubu ... description !!', 'publish', 'open', 'open', '', 'close-up-le-pa