(113, 1, '2010-04-02 17:08:13', '2010-04-02 17:08:13', 'Après 2 semaines de concours "Sleeve My face", voici les résultats :\r\n\r\nPour chacunes des 2 premières photos :<strong> 2 places  pour la soirée <a href="http://localhost:8888/wp-openfader/2010/events/close-up-samedi-3-avril-a-lubu-club/">"Close Up"</a></strong><strong> samedi 3 avril à l''Ubu &amp; une bouteille de champagne</strong>\r\n\r\nBravo et merci à tous les participants et les votants.\r\n\r\nDonc, sur <strong>40 votes ...</strong>\r\n\r\n<strong>1 - Dejanté </strong> (21 votes)\r\n\r\n<img class="aligncenter size-full wp-image-114" title="alexaphex-400x600" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/04/alexaphex-400x600.jpg" alt="Dejanté" width="400" height="600" />\r\n\r\n<strong>2 - Décalé</strong> (7 votes)\r\n\r\n<img class="aligncenter size-full wp-image-115" title="ian5-459x353" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/04/ian5-459x353.jpg" alt="Décalé" width="459" height="353" />\r\n\r\n<strong>3 - Derrière</strong> (5 votes)\r\n\r\n<img class="aligncenter size-full wp-image-124" title="IMG_4769-450x600" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/04/IMG_4769-450x600.jpg" alt="Derrière" width="450" height="600" />\r\n\r\n<strong>4 - Mystérieux</strong> (3 votes)\r\n\r\n<img class="aligncenter size-full wp-image-116" title="victor-459x345" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/04/victor-459x345.jpg" alt="Mystérieux" width="459" height="345" />\r\n\r\n<strong>5 - Mossieur</strong> ( 2 votes)\r\n\r\n<img class="aligncenter size-full wp-image-117" title="ian4-459x347" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/04/ian4-459x347.jpg" alt="Mossieur" width="459" height="347" />\r\n\r\n<strong>7 - Inspiré &amp; Bernard</strong> (1 vote chacune)\r\n\r\n<img class="aligncenter size-full wp-image-118" title="IMG_4771-450x600" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/04/IMG_4771-450x600.jpg" alt="Inspiré" width="450" height="600" />\r\n\r\n<img class="aligncenter size-full wp-image-119" title="alois-277x600" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/04/alois-277x600.jpg" alt="Benard" width="277" height="600" />', 'Sleeve my face :  les résultats', '', 'publish', 'open', 'open', '', 'sleeve-my-face-les-resultats', '', '', '2010-04-02 17:08:13', '2010-04-02 17:08:13', '', 0, 'http://localhost:8888/wp-openfader/?p=113', 0, 'post', '', 0),
