(156, 3, '2010-05-17 21:09:39', '2010-05-17 21:09:39', '<a rel="attachment wp-att-158" href="http://localhost:8888/wp-openfader/2010/emission-radio/open-fader-lemission-samedi-22-mai-a-partir-de-21h/attachment/rcr-mai-2010web/"><img class="aligncenter size-full wp-image-158" title="Open fader au Chantier samedi 22 mai 2010" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/05/RCR-MAi-2010web.jpg" alt="" width="354" height="497" /></a>\r\n\r\nCe mois-ci, l''émission est présentée par Katell\r\n\r\nAu programme :\r\n\r\n<strong>ChouChou</strong> dj set House/BrokenBeat/HipHop / Open Fader<strong>\r\nPopoye </strong> live set Techno / Data Providers    <strong>\r\nShifting the zero</strong> live machine / Harsh Sound and beautiful  songs\r\n\r\nEt C''est free!!\r\n\r\nAlors à samedi et n''oubliez pas d''éteindre vos voisins!!\r\n\r\nLe chantier : 18 carrefour Jouaust, Bas des Lices, Rennes', 'Emission RCR | samedi 22 Mai | Le Chantier', 'Enregistrement de l''émission RCR de mai au bar Le Chantier', 'publish', 'open', 'open', '', 'open-fader-lemission-samedi-22-mai-a-partir-de-21h', '', '', '2010-05-17 23:26:29', '2010-05-17 23:26:29', '', 0, 'http://localhost:8888/wp-openfader/?p=156', 0, 'post', '', 0),
