(178, 1, '2010-06-17 14:25:33', '2010-06-17 14:25:33', 'Pour cette fin de saison, Les Faders participent encore une fois (avec Fake, Data Providers, S''il te play, Twited Sessions, Adn Projekt, le Chantier, et la ville de Rennes) à l''organisation de la <strong>Summer Session</strong>, à l''occasion de <strong>la fête de la musique</strong>, au Bar <strong>Le Chantier</strong> &amp; au <strong>Square Hyacinthe de Lorette</strong> ...\r\n\r\nVoici le visu et le programme de cette édition (correction toutefois : c''est ESSA.M qui démarre au Chantier et non ESAM) :\r\n<p style="text-align: center;"><img class="aligncenter size-full wp-image-186" title="Recto_SummerSession" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/06/Recto_SummerSession.jpg" alt="Summer Session 2010" width="400" height="566" /></p>\r\n<p style="text-align: center;"><img class="aligncenter size-full wp-image-187" title="Verso_SummerSession" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/06/Verso_SummerSession.jpg" alt="Summer Session 2010" width="400" height="566" /></p>\r\n<p style="text-align: center;"></p>\r\n<p style="text-align: center;"></p>', 'Summer Session 10 | lundi 21 juin 2010', 'La Summer Session, édition 2010 ...', 'publish', 'open', 'open', '', 'summer-session-10-lundi-21-juin-2010', '', '', '2010-06-18 15:13:05', '2010-06-18 15:13:05', '', 0, 'http://localhost:8888/wp-openfader/?p=178', 0, 'post', '', 0),
