(190, 1, '2010-07-07 13:35:48', '2010-07-07 13:35:48', 'La prochaine <strong>Club Sandwich</strong> aura lieu le <strong>mardi 13 juillet</strong> (veille de 14 juillet) au bar <strong>Le Chantier</strong> :\r\n\r\nAll night Long ( à partir de 18h)\r\n\r\nApéro dinatoire - sandwiches sur place\r\n\r\nHouse, Techno &amp; more ...\r\n\r\n<strong>Fatum</strong> (Smile)\r\n\r\n<strong>Oil B.</strong> (Open Fader)\r\n\r\n<strong>Hip.J</strong> (Spagh)\r\n\r\nLe Chantier : 18 carrefour Jouaust, 35000 Rennes\r\n\r\n<img class="aligncenter size-full wp-image-191" title="clubsandwich_130710_web" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/07/clubsandwich_130710_web-e1278509501471.jpg" alt="" width="400" height="570" />', 'Club Sandwich - mardi 13 juillet 2010', 'L''apéro dinatoire du Chantier avec Fatum, Oil B. & Hip.J', 'publish', 'open', 'open', '', 'club-sandwich-mardi-13-juillet-2010', '', '', '2013-02-13 18:39:19', '2013-02-13 18:39:19', '', 0, 'http://localhost:8888/wp-openfader/?p=190', 0, 'post', '', 1),
