(194, 1, '2010-07-08 15:45:57', '2010-07-08 15:45:57', 'Rendez-vous <strong>samedi 31 juillet de 13hà 20h</strong>, place Guérin à Brest, au festival <a href="http://www.astropolis.org">Astropolis</a> pour la rituelle partie de pétanque électonique en triplette orchestrée par<strong> Open Fader</strong> ....\r\n\r\nAu programme de l''aprem'' :\r\n\r\nDu mix, un bar, une terrase &amp; des boules ....\r\n\r\nAvec Fat Freddy, Menthine, Oil B., Chou, DRJD Low, Squaat, and more ...\r\n<p style="text-align: center;"><img class="aligncenter size-full wp-image-195" title="astro2010" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/07/astro2010.jpg" alt="astropolis 2010" width="277" height="403" /></p>', 'Mix''n''Boules - Astropolis 2010 [Hippy Freak]', 'LA partie de pétanque électro de l''été de la place Guérin de Brest... en plein Astropolis !! ', 'publish', 'open', 'open', '', 'mixnboules-astropolis-2010-hippy-freak', '', '', '2010-07-08 16:02:39', '2010-07-08 16:02:39', '', 0, 'http://localhost:8888/wp-openfader/?p=194', 0, 'post', '', 1),
