(200, 1, '2010-10-12 16:20:12', '2010-10-12 16:20:12', 'Soirée Dubstep, Hip-Hop &amp; Drum au Chantier avec Brim Brim, Fat freddy et E.R.C  de Peace Off !!\r\n\r\n<img class="aligncenter size-full wp-image-210" title="chantier_161010" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/10/chantier_161010.jpg" alt="" width="470" height="642" />', 'Brim Fat & E.R.C au Chantier le 16 octobre 2010', 'Soirée Dubstep, Hip-Hop & Drum au Chantier', 'publish', 'open', 'open', '', 'brim-fat-e-r-c-au-chantier-le-16-octobre-2010', '', '', '2010-10-12 16:38:09', '2010-10-12 16:38:09', '', 0, 'http://localhost:8888/wp-openfader/?p=200', 0, 'post', '', 0),
(203, 1, '2010-10-12 16:30:11', '2010-10-12 16:30:11', 'Les émissions reprennent !!\r\n\r\nLa formule est la même, une fois par mois l''enregistrement à lieu <strong>au Chantier </strong>(18 carrefour Jouaust à Rennes) en live, puis l''émission est diffusée la semaine d''après sur <a href="http://www.radiocampusrennes.fr">Radio Campus Rennes</a> (88.4fm).\r\n\r\nCette saison (la 6ème tout de même !!), une nouveauté tout de même : les S''il Te play viennent en renfort et s''occuperont d''une émission sur deux !! Yeahh !\r\n\r\nVoici donc la première de la saison, présentée par Brim &amp; Katell :\r\n\r\n<img class="aligncenter size-full wp-image-212" title="emission_221010" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/10/emission_221010.jpg" alt="émission of rcr chantier" width="470" height="665" />\r\n<p>Before* de la soirée Fake pour l''occasion (le même soir à l''Ubu à partir de 23h avec Le Loup, The Revenge &amp; Guez) !!</p>\r\n\r\n20h &gt; 01h - Free\r\n<hr />\r\n\r\nAu programme :\r\n\r\n<strong>Dj Télémak</strong> (AMP - Rennes)\r\n<strong>Dj Fakktion</strong> ( BassKom Unity - Cherbourg)\r\n<strong>Jorj </strong>(Fake - Rennes)\r\n\r\n<hr />\r\n\r\n* 2 Places à Gagner\r\n\r\nPS : Diffusion de l''émission le 30 octobre à 20h sur RCR (88.4Fm)', 'Emission RCR - le 22 octobre au Chantier', 'Première émission de la saison !!', 'publish', 'open', 'open', '', 'emission-rcr-le-22-octobre-au-chantier', '', '', '2010-10-14 13:51:40', '2010-10-14 13:51:40', '', 0, 'http://localhost:8888/wp-openfader/?p=203', 0, 'post', '', 0),
