(221, 1, '2010-10-15 15:40:50', '2010-10-15 15:40:50', '<p class="aligncenter"><img class="alignnone size-full wp-image-236" title="affiche_stickme" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/10/affiche_stickme.jpg" alt="Stick me - Ubu club - Samedi 13 novembre 2010" width="470" height="662" /></p>\r\n\r\n<h3>DJ FRESHHH [STEREOPHONK]</h3>\r\n<img class="alignleft size-full wp-image-224" title="fresh_2" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/10/fresh_2-e1287154485326.jpg" alt="Dj Freshhh" width="200" height="181" />Derrière ses platines depuis une dizaine d’années, <strong>Dj Freshhh</strong> fait de plus en plus parler de lui grâce à ses mixes fonky et hip hop illustrés de turntablism..\r\n\r\nIl viendra notamment présenter la sortie du 45 tour vinyl <strong>‘’Funky Bijou‘’ sur Stereophonk</strong>,, et il nous prépare déjà quelques surprises !!\r\n\r\nEn attendant, vous pouvez vous procurer ce fameux Bijou sur Rennes : au <em>Chantier</em>, à <strong>Blindspot</strong>, au <em>Selectshop</em> et a l''<em>espace culturel du Leclerc Cleunay</em>.\r\n\r\nFunky !\r\n\r\n&gt; <a href="http://www.myspace.com/freshifreshh">www.myspace.com/freshifreshh</a>\r\n<h3>FROG’S APPETITE [OPEN FADER | TWISTED] - LIVE</h3>\r\n<img class="alignright size-full wp-image-225" title="frogsappetite" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/10/frogsappetite-e1287154601750.jpg" alt="Frog''s appetite" width="200" height="149" />Formé de <strong>Nakwan</strong> et <strong>DRJD Low</strong>, deux activistes bien connus du milieu electro rennais, ce live tout frais sur Labtop, voyage musicalement entre electro hip hop, et breakbeat. Les grenouilles se mouillent dans le seul but de sticker le dance-floor.\r\n\r\nClassique !\r\n<h3>GOT MELC ? [REJECTBEATS - UK] (/)</h3>\r\n<img class="alignleft size-full wp-image-226" title="rejectbeats" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/10/rejectbeats-e1287154678370.png" alt="Rejectbeats" width="200" height="88" />Les deux londonniens <strong>Micky C</strong> et <strong>Melc</strong>, de la bande de <strong>Cut la Roc</strong>, mélangent hip hop, house, et breakbeat  dans un bordel sans nom, un mix comme seuls les anglais savent le faire !!!\r\n\r\nEnjoy !\r\n\r\n&gt; <a href="http://www.rejectbeats.co.uk">www.rejectbeats.co.uk</a>\r\n<h3>BRIM FERGUSOUND VS DJ SAMBAL [OPENFADER]</h3>\r\nJoyeux troublion de l’asso, <strong>Brim Brim</strong> invite <strong>dj Sambal</strong>, joyeux troublion de <strong>Micronologie</strong> (sortie du maxi <strong>‘’Tubes à Essai’’</strong> prévue pour novembre) pour un joyeux collage éclectique et énergique, entre breakbeat, électro drum’n bass et scratch.\r\nQu’on se le dise !!!\r\n<p class="aligncenter"><img class="aligncenter size-full wp-image-227" title="brimvssambal" src="http://localhost:8888/wp-openfader/wp-content/uploads/2010/10/brimvssambal-e1287154739254.png" alt="Brim vs Sambal" width="350" height="257" /></p>\r\n&gt; <a href="http://www.myspace.com/sambalmicronologie">www.myspace.com/sambalmicronologie</a>\r\n\r\n<strong>Visuel by AK[K]A VJ’S</strong>\r\n\r\nDéco spéciale “Stickers” à l’occasion du lancement du site <a href="http://www.art-is-stick.com">www.art-is-stick.com</a>\r\n\r\n<hr /><strong>PAF :</strong>\r\n<ul class="liste">\r\n	<li><strong>12€</strong> en prévente (au Chantier, 18, carrefour Jouaust Rennes)</li>\r\n	<li><strong>10€</strong> sur place avant 00h</li>\r\n	<li><strong>14€</strong> sur place après 00h.</li>\r\n</ul>\r\n<hr />\r\n<h3>BEFORE :</h3>\r\nVendredi 12 novembre au <strong>Bistrot de La cité</strong> à partir de 21h\r\n<ul class="liste">\r\n	<li><strong>MENThINE</strong></li>\r\n	<li><strong>SQUAAT</strong></li>\r\n</ul>\r\n<hr />\r\n<h3>Funky Bijou : le Clip !</h3>\r\n<object classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" width="470" height="377" codebase="http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,40,0"><param name="allowFullScreen" value="true" /><param name="allowscriptaccess" value="always" /><param name="src" value="http://www.youtube.com/v/A49A6SJWzBI?fs=1&amp;hl=fr_FR" /><param name="allowfullscreen" value="true" /><embed type="application/x-shockwave-flash" width="470" height="377" src="http://www.youtube.com/v/A49A6SJWzBI?fs=1&amp;hl=fr_FR" allowscriptaccess="always" allowfullscreen="true"></embed></object>', 'Stick me | samedi 13 novembre 2010 | Ubu Club', 'Dj Freshhh | Sterephonk\r\nFrog''s Appetite - Live | Open Fader / Twisted\r\nGot Melc ? - UK | Rejectbeats\r\nBrim Fergusound Vs Dj Sambal | Open Fader / Micronologie', 'publish', 'open', 'open', '', 'stick-me-samedi-13-novembre-2010-ubu-club', '', '', '2010-11-01 12:44:49', '2010-11-01 12:44:49', '', 0, 'http://localhost:8888/wp-openfader/?p=221', 0, 'post', '', 0),
