(261, 1, '2011-01-25 21:14:55', '2011-01-25 21:14:55', '<img class="aligncenter size-full wp-image-262" title="affiche_happyskull_web_2" src="http://localhost:8888/wp-openfader/wp-content/uploads/2011/01/affiche_happyskull_web_2.jpg" alt="open fader - happy skull - ubu - samedi 19 février 2011" width="480" height="676" />\r\n<h3>La soirée</h3>\r\nEt hop adieu 2010 Bonjour 2011.\r\nL’association ElektropPitch profite de cet hiver morose et triste -snif - pour réchauffer vos oreilles : au programme <strong>beat, bass, scratch et bonne humeur</strong> alors amenez vos « HAPPY SKULL » dans la salle mythique de Rennes le 19 février prochain et faites trembler le dancefloor qui n’attend plus que vous !!\r\n\r\nTout d’abord vous découvrirez ou redécouvrirez l’incroyable collectionneur de balles soul/funk <strong>JAKKA DEEJAY</strong>.\r\n\r\nSuivront <strong><a href="http://www.myspace.com/tonyjkut">Tony JCut</a></strong> et <strong><a href="http://www.myspace.com/adjectiforeillesdpendantes">aDJectif</a></strong> pour un duo <em>dubstep/ hip hop /scratch.</em>\r\n<p style="text-align: left;"><em></em>Laissez-vous ensuite porter par les <em>Bass Addict</em> que sont <strong><a href="http://www.myspace.com/kattell">KATELL</a> N’ <a href="http://www.myspace.com/stratege">STRATEGE</a> </strong>qui se chargeront de faire la transition vers la <em>Drum</em>.</p>\r\n<p style="text-align: center;"><img class="size-medium wp-image-275  aligncenter" title="DJ Katell &amp; Dj Stratège" src="http://localhost:8888/wp-openfader/wp-content/uploads/2011/01/DJ-Katell-Dj-Stratège-300x199.jpg" alt="DJ Katell &amp; Dj Stratège" width="300" height="199" /></p>\r\n<p style="text-align: left;">C’est <strong><a href="http://www.myspace.com/djladylate" target="_blank">LADY LATE</a>,</strong> patronne du label rennais <strong><a href="http://www.myspace.com/elserecordings">Else Recording</a></strong> qui clôturera cette soirée avec un pur set drum’n’bass.</p>\r\n<p style="text-align: center;"><img class="size-medium wp-image-277  aligncenter" title="lady_late" src="http://localhost:8888/wp-openfader/wp-content/uploads/2011/01/lady_late-300x199.jpg" alt="Lady Late" width="300" height="199" /></p>\r\nLe tout sera mis en image par <strong>Karlotta </strong>et la deco sera signée <a href="http://www.art-is-stick.com/">art-si-stick</a>\r\n\r\nAh oui autre chose public, rendez-vous sur le site régulièrement, car pour cette soirée la déco c’est aussi vous…\r\n\r\nA suivre ...\r\n<h3>Les infos</h3>\r\nPAF :\r\n<ul>\r\n	<li><strong>12€</strong> en prévente (au bar Le Chantier, 18 carrefour Jouaust, Rennes)</li>\r\n	<li><strong>10€</strong> sur place avant 01h</li>\r\n	<li><strong>14€</strong> sur place après 01h</li>\r\n</ul>\r\nUbu : 1rue St Hélier, Rennes\r\n\r\n&gt; <a href="http://www.facebook.com/pages/Open-Fader/311292153466#!/event.php?eid=142948389098105">Voir l''évenement facebook</a>\r\n<h3>La Before</h3>\r\nUne Before se tiendra le <strong>vendredi 18 février au Bistrot de la Cité</strong>\r\n21h-01h | Free\r\nInfos à suivre', 'Happy Skulls | Samedi 19 février 2011 @ Ubu Club', 'avec Jak Deejay, Adjectif & Tony J cut, Katell & Stratège, Lady Late, Ak[k]a vj''s', 'publish', 'open', 'open', '', 'happy-skull-samedi-19-fevrier-2011-ubu-club', '', '', '2011-02-17 19:24:23', '2011-02-17 19:24:23', '', 0, 'http://localhost:8888/wp-openfader/?p=261', 0, 'post', '', 4),
