(297, 1, '2011-03-21 00:59:19', '2011-03-21 00:59:19', 'L’asso termine la saison avec une soirée sur le thème des ‘’vraiment méchants’’.\r\nAu programme un plateau dubstep et break complètement inspiré par le crew Peace Off ...\r\n<p style="text-align: center;"><img class="aligncenter size-large wp-image-304" title="Les Méchants" src="http://localhost:8888/wp-openfader/wp-content/uploads/2011/03/affiche_mechants_web-480x676.jpg" alt="Open Fader - Les Méchants - Samedi 9 avril 2011 - Ubu Club - Rennes" width="480" height="676" /></p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n\r\n<h3 style="text-align: left;">La soirée</h3>\r\n<p style="text-align: left;"><strong>FAT FREDDY</strong> (Open Fader) :</p>\r\n<p style="text-align: left;">Que dire ? Fat Freddy ... c''est funky koi !</p>\r\n<p style="text-align: left;">&gt; <a href="http://www.myspace.com/djfatfreddy">myspace</a></p>\r\n<hr />\r\n<p style="text-align: left;"><strong>MKL</strong> (Peace Off) :</p>\r\n<p><img class="alignright size-full wp-image-321" title="mkl" src="http://localhost:8888/wp-openfader/wp-content/uploads/2011/03/mkl.png" alt="mkl" width="86" height="140" />Efficace et technique, MKL ne laisse jamais indifférent lors de ses mix .\r\nRemarqué lors de prestations auprès d'' artistes tels qu''Asian Dub , Modeselector ou encore Vénétian Snares... , il vous proposera ce soir un mix exclusif !!!</p>\r\n<p>&gt;  <a href="http://www.myspace.com/mklmutantcat">myspace</a></p>\r\n<hr />\r\n<p style="text-align: left;"><strong>ELECTROMECA</strong> (Peace Off) Breakbeat / Breakcore live</p>\r\n<p style="text-align: left;">Live breaks distordus et mélodiques, relevant d''une alliance contre nature entre funk agité et breakcore décéléré.</p>\r\n<p style="text-align: left;"><img class="aligncenter size-full wp-image-328" title="electromeca" src="http://localhost:8888/wp-openfader/wp-content/uploads/2011/03/electromeca.jpg" alt="electromeca" width="480" height="254" /></p>\r\n<p style="text-align: left;">&gt; <a href="http://www.myspace.com/electromeca">myspace</a></p>\r\n<hr />\r\n<p style="text-align: left;"><strong>BLACK HAM</strong> (Ruff) Dubstep(-core) Live :</p>\r\n<p style="text-align: left;"><img class="alignleft size-full wp-image-329" title="blackham" src="http://localhost:8888/wp-openfader/wp-content/uploads/2011/03/blackham.jpg" alt="blackham" width="200" height="148" />Dansant  et  dévastateur,  rafraîchissant  et  prometteur,  Black  Ham  avec  sa dynamique nerveuse et stimulante pour les jambes cultive l''éclectisme et fait des ravages !!! Alliant Electro-Ragga, Fidget, Dubstep, Booty, Metal, Dance hall … Le résultat est résolument orienté dancefloor !!! Musicien  Rennais  au  multiples  facettes  (Rotator,  Mr  Kill,  ...),  label  boss  de Peace  off  Records  ,  il  a  su  par  ses  lives  faire  slammer  de  San  Francisco  à Tokyo. Sorti  sur  des  labels  tel  que  Ruff,  Broklyn  Beats,  Tigerbeat6,  Mirex  et  Peace Off,  membre  fondateur  des  nouvelles  soirées  Dirty  Beats  et  préparant  son nouvel  Ep  sur  Peace  off  Rec,  il  nous  proposera  un  live  unique,  exclusif  et énergique !</p>\r\n<p style="text-align: left;">&gt; <a href="http://www.myspace.com/bl4ckh4m">myspace</a></p>\r\n<hr />\r\n<p style="text-align: left;"><strong>MISS~CHéMAR</strong> (Aie Prod) Vj performance :</p>\r\n« Let’z Play! » est un battle VJ organisé autour de Miss~CHéMAR et <a href="http://vjfanfy.over-blog.com/article-de-de-44265918.html">VJ Fanfy </a>(Y#)… Les deux combattantes costumées et cagoulées s’affrontent sans pitié sur scène à base de vidéos à leur image et de coups bas!\r\n\r\n<img class="aligncenter size-full wp-image-330" title="misschemar" src="http://localhost:8888/wp-openfader/wp-content/uploads/2011/03/misschemar.jpg" alt="misschemar - Let''z Play!" width="480" height="123" />\r\n\r\nPour cette édition « Les Méchants », Open Fader invite la plus sadique des deux concurrentes, Miss~CHéMAR! Elle fera claquer du câble VGA et performera au côté de  MKL (Peace Off), qui tremble déjà du saphir….grrrrrr…  Let’z Play again!\r\n\r\n&gt; <a href="http://www.aieprod.com">Voir le site Aie Prod</a>\r\n<hr />\r\n<p><strong>Visuels by Ak[k]a Veejay''s</strong></p>\r\n<p><strong>Déco by <a href="http://www.art-is-stick.com">art-is-stick</a></strong></p>\r\n<h3>Infos :</h3>\r\n<strong>PAF :</strong>\r\n<ul>\r\n	<li>10€ sur place avant 1h</li>\r\n	<li>14 € sur place après 1h</li>\r\n	<li>12€ en préventes au bar Le Chantier (1 8 carrefour Jouaust, Rennes)</li>\r\n</ul>\r\n<strong>Ubu Club :</strong> 1 rue St Hélier, 3500 Rennes\r\n\r\n<strong>&gt;</strong> Suivre l''évènement sur <a href="http://www.facebook.com/event.php?eid=173097719409452">Facebook</a>\r\n<h3>La Before :</h3>\r\n<strong>Vendredi 8 avril</strong> 2011 au bar <strong>Le Chantier</strong>\r\n<strong><a href="http://misschemar.vjfrance.com/">Miss~CHéMAR</a></strong> Dj Set (breakbeat/dubstep/drum’n''bass)\r\nFree - à partir de 22h\r\n<h3>Le Teaser :</h3>\r\n<iframe src="http://player.vimeo.com/video/21742986?byline=0&amp;portrait=0" width="480" height="384" frameborder="0"></iframe>', 'Les Méchants | samedi 9 avril | Ubu club', 'Fat Freddy (Open Fader) | MKL (Peace Off) | Electromeca (Peace Off) [ Black Ham (Ruff) | Miss~CHéMAR (Aie Prod)', 'publish', 'open', 'open', '', 'les-mechants-samedi-9-avril-ubu-club', '', '', '2011-03-31 18:00:34', '2011-03-31 18:00:34', '', 0, 'http://localhost:8888/wp-openfader/?p=297', 0, 'post', '', 0),
