(348, 1, '2011-06-07 12:48:49', '2011-06-07 12:48:49', 'Pour cette cinquième année consécutive, quelques associations electro rennaises se réunissent pour vous faire partager la fête des musiques actuelles autour de deux lieux :<strong> Le bar Le Chantier</strong>, <em>en bas de la place des lices</em> et dans le <strong>Square Yacinthe Lorette</strong>, r<em>ue nantaise</em>.\r\n\r\nAu programme de cette « SUMMER SESSION # 5 » les associations <strong>ElektropPitch/Open Fader</strong>, <strong>ADN Project</strong>, <strong>Muscanoiz</strong>, <strong>Fake</strong>, <strong>SIZE</strong> et<strong> Sil te Play</strong> vous proposent un voyage sonore qui ira du funk /hip-hop au Dubstep sans oublier les musiques Electro Tek / minimale et la drum’n’bass.\r\n\r\nLe voyage sera également visuel, puisque cette année les danseurs du <strong>WITTY CREW</strong> seront présents en début de soirée ainsi que le collectif de jongleurs de feu le <strong>CHKI</strong>…donc venez tôt !! Les deux sites seront mis en images par <strong>KARLOTTA</strong> et <strong>Muscanoiz</strong>...\r\n\r\nNous vous invitons donc déambuler encore une fois aux abords du bas de la place des Lices.\r\n\r\nFête de la musique, faites du son !\r\n\r\nENJOY !!\r\n<h2>Programmation Summer Session #5</h2>\r\n<strong>Square Hyacinthe Lorette</strong>\r\n<ul>\r\n	<li>18h-19h// <strong>Fat freedy</strong> (Open Fader) + <strong>Witty Crew</strong> (danseurs)</li>\r\n	<li>19h-20h// <strong>Bood² </strong>+ <strong>Denis </strong>(Dataproviders)</li>\r\n	<li>20h-21h// <strong>S’il Te Play</strong></li>\r\n	<li>21h-22h// <strong>Undeground Orchestra</strong></li>\r\n	<li>22h-23h// <strong>Poney M </strong>(Jarret crew//Cuir-Moustache)</li>\r\n	<li>23h-00h// <strong>Noisebuilder </strong>(Heretik)</li>\r\n	<li>00h-01h// <strong>Eprohm</strong> + <strong>Koj</strong> (Adn Project/Tekshop;dts)</li>\r\n	<li>01h-02h// <strong>Mickey </strong>+ <strong>Wilborg </strong>(muskanoiz)</li>\r\n</ul>\r\n<strong>Bar le chantier</strong>\r\n<ul>\r\n	<li>17h-18h// <strong>Bertoli</strong> (SIZE)</li>\r\n	<li>18h-19h// <strong>Jaz</strong></li>\r\n	<li>19h-20h// <strong>Guez </strong>+ <strong>Theo Gravil </strong>(Fake)</li>\r\n	<li>20h-21h// <strong>HumanShell</strong> (Sophos)</li>\r\n	<li>21h-22h// <strong>Maëlann et Mö</strong> (Monte la sauce)</li>\r\n	<li>22h-23h// <strong>Squatt </strong>(Open Fader)</li>\r\n	<li>23h-00h// <strong>Stratège</strong> + <strong>Katell </strong>(Beat Shop/Open Fader)</li>\r\n	<li>00h-01h// <strong>BlackHam</strong>+ <strong>Kamouraï </strong>(Peace Off/Mixomattoz)</li>\r\n</ul>\r\n<img class="aligncenter size-large wp-image-374" title="summer-session_5" src="http://localhost:8888/wp-openfader/wp-content/uploads/2011/06/summer-session_5-480x678.jpg" alt="Summer Sesion #5" width="480" height="678" />\r\n\r\n&nbsp;', 'Summer Session #5 | 21 juin 2011 | Rennes', '', 'publish', 'open', 'open', '', 'summer-session-5-21-juin-2011-rennes', '', '', '2011-06-13 13:23:25', '2011-06-13 13:23:25', '', 0, 'http://localhost:8888/wp-openfader/?p=348', 0, 'post', '', 0),
