(356, 1, '2011-05-07 13:04:44', '2011-05-07 13:04:44', 'Enregistrement en direct et en public de l''émission de mai sur Radio Campus Rennes (<a rel="nofollow" href="http://www.radiocampusrennes.fr/" target="_blank">http://www.radiocampusrennes.fr/</a>) au bar Le Chantier\r\n\r\nAu programme :  itws et lives (<strong>Ismael</strong> de Fake &amp; <strong>La Cocotte Fanzine</strong>)\r\n\r\n<strong>-DubStep Session-</strong>\r\n<ul>\r\n	<li><strong>KELIB </strong>| Factor {I} (Caen)</li>\r\n	<li><strong>OSKR Steppa</strong> | Factor{I} (Caen)</li>\r\n	<li><strong>STRATEGE</strong> | BeatShop (Rennes)</li>\r\n</ul>\r\nÉmission présentée par <strong>Katell</strong>\r\n\r\nDiffusion sur les ondes de RCR (88.4FM) le <em>samedi 28 mai de 21h à 00h</em>.\r\n\r\nBar le Chantier : 18 carrefour Jouast, Rennes\r\n\r\n<img class="aligncenter size-full wp-image-359" title="emission_210511" src="http://localhost:8888/wp-openfader/wp-content/uploads/2011/05/emission_210511.jpg" alt="émission RCR de mai 2011" width="480" height="679" />', 'Émission RCR | samedi 21 mai 2011 @ Le Chantier', 'Kelib | OSKR Steppa | Stratège | Iterviews : Ismael (Fake) & La Cocotte Fanzine', 'publish', 'open', 'open', '', 'emission-rcr-samedi-21-mai-2011-le-chantier', '', '', '2011-06-07 13:23:47', '2011-06-07 13:23:47', '', 0, 'http://localhost:8888/wp-openfader/?p=356', 0, 'post', '', 0),
