(361, 1, '2011-06-07 13:16:44', '2011-06-07 13:16:44', 'Enregistrement en direct et en public de l’émission de juin sur Radio Campus Rennes (<a rel="nofollow" href="http://www.radiocampusrennes.fr/" target="_blank">http://www.radiocampusrennes.fr/</a>) au bar Le Chantier\r\n\r\nAu programme :  itws et lives\r\n\r\n<strong>-Salamangedisc-</strong>\r\n<ul>\r\n	<li><strong>DJS MAKKAN </strong></li>\r\n	<li><strong>D''JOK</strong></li>\r\n	<li><strong>ZERBINOS</strong></li>\r\n</ul>\r\nÉmission présentée par <strong>K-Lymero</strong>\r\n\r\nDiffusion sur les ondes de RCR (88.4FM) le <em>samedi 2 juillet de 21h à 00h</em>.\r\n\r\nBar le Chantier : 18 carrefour Jouast, Rennes\r\n\r\n&nbsp;\r\n\r\n<img class="aligncenter size-full wp-image-372" title="emission_250611" src="http://localhost:8888/wp-openfader/wp-content/uploads/2011/06/emission_250611.jpg" alt="emission RCR 25 juin 2011" width="480" height="679" />', 'Émission RCR | samedi 25 juin 2011 @ Le Chantier', 'DJS MAKKAN | D''JOK | ZERBINOS', 'publish', 'open', 'open', '', 'emission-rcr-samedi-25-juin-2011-le-chantier', '', '', '2011-06-08 11:34:24', '2011-06-08 11:34:24', '', 0, 'http://localhost:8888/wp-openfader/?p=361', 0, 'post', '', 0),
