(383, 1, '2011-06-23 13:43:37', '2011-06-23 13:43:37', '<img src="http://localhost:8888/wp-openfader/wp-content/uploads/2011/06/mixnboules-480x171.jpg" alt="mix&#039;n&#039;boules - Astropolis 2011" title="mixnboules" width="480" height="171" class="aligncenter size-large wp-image-382" />\r\n<h3>Samedi aprem'' à Astropopo : c''est pétanque !!</h3>\r\nPartie de pétanque électronique organisée en collaboration avec <strong>l''Association des Pétanqueurs de la Place Guérin</strong> &amp; <strong>Open Fader</strong>, le <strong>Mix''N''Boules</strong> réunit toutes les générations en plein coeur de Brest, le temps d''un après-midi. Au rendez-vous, musique, rencontres et convivialité, sur le terrain de jeu comme aux nombreuses terrasses des cafés entourant la place. La circulation des véhicules y est temporairement interrompue pour assurer tranquillité, sécurité, jeu et fête !\r\n\r\nAttention ! Pour participer n''oubliez pas de vous inscrire au <strong>02 98 43 37 74</strong>.\r\n\r\nPour voir la prog'' complète d''astro c''est par là : <a href="http://www.astropolis.org">www.astropolis.org</a>', 'Astropolis 2011 | Le Mix''n''Boules | samedi 30 juillet', 'La partie de pétanque électronique d''astropolis !!', 'publish', 'open', 'open', '', 'astropolis-2011-le-mixnboules-samedi-30-juillet', '', '', '2011-06-23 13:48:41', '2011-06-23 13:48:41', '', 0, 'http://localhost:8888/wp-openfader/?p=383', 0, 'post', '', 0),
