(392, 1, '2011-08-02 13:23:51', '2011-08-02 13:23:51', 'Le <strong>AssBeanRoyalKlub</strong> est une jeune association caennaise fondé par des activistes normands de la première heure ( Rfranck, Lex Vertex et Tonton ). Elle s''est orientée vers la promotion des musiques électroniques sur la région bas-normande au travers, entre autre, de soirées récurentes a la salle des musiques actuelles de Caen le Cargo. Bon nombre d''artistes nationaux ( Arno Gonzalez, Timid Boy...) ou internationaux ( Julian Jeweil, Reinhart Voight....) y prirent les commandes.\r\nDans le cadre des befores du festival<strong> Nordik Impakt</strong>, le AssBean, accompagné de <strong>Sei A</strong> et de ces activistes régionaux, les <strong>Trpr</strong> et <strong>Lex Vertex</strong>, seront accueillis a <strong>l''Ubu</strong> par la team des <strong>Open Fader</strong>.\r\n\r\n<img class="aligncenter size-large wp-image-393" title="fly_ubu_160911" src="http://localhost:8888/wp-openfader/wp-content/uploads/2011/08/fly_ubu_160911-480x698.jpg" alt="Sei A, Init, Menthine, Lew Vertex @ Ubu le vendredi 16 septembre 2011" width="480" height="698" />\r\n<h2>SEI A  Live ( Seinan Music, Turbo rec / UK )</h2>\r\n<img class="alignleft size-full wp-image-394" title="sei_a" src="http://localhost:8888/wp-openfader/wp-content/uploads/2011/08/sei_a.jpg" alt="Sei A" width="180" height="240" />Après avoir signés de nombreux maxis sur Urban Torque, Audio Therapy, Missive et Imprime!, Andy Graham aka Sei A se démarque avec son très attendu premier album sur Missive « Editing shadows ». « Editing shadows » s’ouvre mystérieusement sur le titre ‘Smile for me’ qui a fait la renommée musicale de Sei A sur la scène internationale et dont le remix par l’artiste israélien CHAIM a fait le tour des platines des plus grands Djs. « Editing shadows » est un disque mature, intimiste et charnel. Malgré son jeune âge, Sei A a su s’approprier les particularités sonores de Detroit et de Chicago en intégrant à sa musique une sensualité un peu en sommeil dans la vague minimale. On retrouve toute la jubilation de la house music, deep et spirituelle, respectueuse de son héritage qui, progressivement, devient inventive, névrotique et hallucinatoire.\r\n“En résumé Sei A, c’est la fougue de Paul Kalkbrenner ou d’Isolée (…) qui rencontrerait le classicisme de Cobblestone Jazz. Belle signature pour le label parisien Missive ! » **** (DJ Barney – Only for Djs / nov.2008)\r\n“Avec Editing Shadows, Sei A redonne un coup de jeune à la house music, qu’il rend à nouveau sexy et désirable.” TSUGI (nov.2008)\r\n\r\n&gt; <a href="http://www.myspace.com/andyseinan">http://www.myspace.com/andyseinan</a>\r\n<h2>INIT Live ( Trpr / Caen )</h2>\r\nC''est la synchronisation de trois ordinateurs et de trois esprits, ceux des trois djs et producteurs techno caennais :Skipkod ( Romain ), Ovilsky ( François ) et Shikuano ( Pierre ). C''est autour du collectif {tr / pr }-Très Primitive Musique qu''ils se retrouvent en 2008. Depuis ils développent un son puissant et minimaliste et des sets live en perpétuelle évolution. Ils ont déjà eu la chance de se produire aux cotés de nombreuses pointures du genre ( Reinhard Voigt, Scan X, The Cox, Mathias Meindl, LAN, Fresh Meat, Helge Baumberg, Geschwister Schumann, St.fano...), sur des scènes telles que le Cargo ( Caen ), Golden Gate ( Berlin), M.I.K.Z. ( Berlin ) ou encore pour l''émission de radio de référence Berlinoise : Tapedeck.\r\n\r\n<img class="aligncenter size-full wp-image-395" title="init" src="http://localhost:8888/wp-openfader/wp-content/uploads/2011/08/init.jpg" alt="Init" width="450" height="299" />\r\n\r\n&gt; <a href="http://tresprimitive.com/index.php">http://tresprimitive.com/index.php</a>\r\n<h2>MENTHINE ( Open Fader / Rennes )</h2>\r\nCe sont ses amis dj''s, musiciens et sa passion grandissante pour les musiques électroniques qui poussent Menthine a acquérir des platines en 2003.                                                                    Quelques bacs plus tard, l''influence des sons tek, electro et plus récemment break, permettent a Menthine de s''affirmer dans un style propre a sa vision du mix.                                                         En octobre 2004, nait le projet Open Fader avec ses quatre associés DRJD Low, Oil B, DaveLeBil et sa soeur Karlotta. Menthine multiplie les prestations scéniques : fete de la musique au Chantier, Mobil Home au coté de Missil, let''s woman move au coté d''Elisa Do Brasil...\r\n\r\n<img class="aligncenter size-full wp-image-396" title="menthine" src="http://localhost:8888/wp-openfader/wp-content/uploads/2011/08/menthine.jpg" alt="Menthine" width="450" height="300" />\r\n\r\n&gt; <a href="http://www.myspace.com/menthine">http://www.myspace.com/menthine</a>\r\n<h2>LEX VERTEX ( AssBeanRoyalKlub / Caen )</h2>\r\n<img class="alignleft size-full wp-image-397" title="Lex-Vertex" src="http://localhost:8888/wp-openfader/wp-content/uploads/2011/08/Lex-Vertex.jpg" alt="Lex vertex" width="180" height="271" />Devenu un acteur incontournable de la scène électronique bas normande, il commence a faire ses armes en 1997 au sein des raves party de la région. Remarqué par les activistes de ArtsAttack!, il remporte le premier tremplin du festival Nordik Impakt 07 en 2005 dans la catégorie TekHouse et joue au coté de Scratch Massive, Ivan Smagghe...\r\nDepuis il fonda le AssBeanRoyalKlub avec Tonton et Rfranck ( RIP ) et il officia sur de nombreuses soirées dans les bars et clubs de la région au coté de Julian Jeweil, Reinhart Voight, Julian Jeweil, Timid Boy, Anthony Collins....Il fit un passage très remarqué par la presse spécialisée ( Trax Magasine ) lors du dernier Nordik Impakt : « ...le meilleur moment de la soirée nous attendait dans la quatrième salle, plus petite et chaleureuse, ou Lex Vertex, un DJ local, a délivré une merveille de minimal élastique et intelligente. »\r\n<h3>Infos Pratiques :</h3>\r\n<strong>PAF :</strong> 7€ / 9€ / 11€\r\n\r\n<strong>Préventes : </strong>points de ventes habituels (digitick, etc)\r\n\r\n<strong>Ubu :</strong> 1 rue St Hélier, Rennes\r\n\r\n<strong>Event FB : </strong><a href="http://www.facebook.com/event.php?eid=209992165724194">http://www.facebook.com/event.php?eid=209992165724194</a>', 'Before Nordik Impakt @ Ubu - Vendredi 16.09.11', 'AssBean Royal Klub & Open Fader présentent dans le cadre des befores Nordik Impact 13 :\r\nSEI A - Live | Init - Live | Menthine | Lex Vertex\r\nUbu Club - Vendredi 16 septembre 2011', 'publish', 'open', 'open', '', 'before-nordikimpakt-160911', '', '', '2011-08-22 14:52:33', '2011-08-22 14:52:33', '', 0, 'http://localhost:8888/wp-openfader/?p=392', 0, 'post', '', 0),
