(411, 1, '2011-10-04 12:03:20', '2011-10-04 12:03:20', 'Les émissions reprennent pour une nouvelle saison !\r\nToujours <strong>mensuelle</strong>, <strong>enregistrée en live</strong> au <a href="http://www.facebook.com/barlechantier">bar Le chantier</a> (<em>18 carrefour Jouaust, Rennes</em>) et diffusée la semaine d''après le samedi soir sur <a href="http://www.radiocampusrennes.fr">Radio Campus Rennes</a> | 88.4 Fm (disponibles ensuite en podcast sur les site de la radio).\r\n\r\nAu Programme ce mois-ci :\r\n\r\n<strong>BIG WHOOP</strong> (Digital Shaperz / I am what i play)\r\n&gt; <a href="http://www.facebook.com/pages/Big-Whoop/112631158807595">facebook</a>\r\n\r\n<strong>DJ UNRHUE</strong> (Peacemakers)\r\n&gt; <a href="http://www.facebook.com/pages/Unruhe-Peacemakers/309507765969">facebook </a>\r\n\r\nEnregistrement en direct &amp; en public au bar <strong>Le Chantier le samedi 22 octobre 2011 de 20h à 01h</strong>.\r\n\r\nDiffusion sur <strong>RCR (88.4FM) le samedi 29 octobre de 21h à 00h</strong>.\r\n\r\nÉmission présentée par <strong>K-Lymero</strong> !\r\n\r\n&gt; Aller sur le <strong>Podcast : </strong> <a href="http://www.radiocampusrennes.fr/opfa/podcast-8890">Émission octobre</a>\r\n\r\n<img class="size-large wp-image-412 alignnone" title="emission_221011" alt="Open Fader | l''émission RCR d''octobre au bar Le Chantier" src="http://localhost:8888/wp-openfader/wp-content/uploads/2011/10/emission_221011-480x480.jpg" width="480" height="480" />', 'Émission RCR | Samedi 22 octobre 2011 @ Le Chantier', '', 'publish', 'open', 'open', '', 'emission-rcr-samedi-22-octobre-2011-le-chantier', '', '', '2013-02-09 15:50:21', '2013-02-09 15:50:21', '', 0, 'http://localhost:8888/wp-openfader/?p=411', 0, 'post', '', 0),
