(485, 1, '2011-12-14 14:36:46', '2011-12-14 14:36:46', '<h3>Vendredi 23 décembre | Le Chantier | 21h - 01h - Free</h3>\r\nEnregistrement de l''émission pour <a href="http://www.radiocampusrennes.fr">Radio Campus Rennes</a> de <strong>décembre</strong> en direct et en public au bar Le Chantier\r\nAu programme cette l''émission de décembre présentée par <strong>Brim :</strong>\r\n\r\n<strong>DJ LYNCH\r\n</strong>\r\n\r\n<strong>L''HARMOPÉE</strong>\r\n<em>Hip Hop</em>\r\n\r\n<strong>DJ SCHLOSS</strong>\r\nRuff, Peace Off - <em>Dubstep, Bass Music</em>\r\n\r\n<strong>E-MOTION</strong>\r\nHorizon Vertical - <em>Live Drum''n''Bass</em>\r\n\r\nDiffusion de l''émission en podcast sur Radio Campus Rennes à partir de janvier.\r\n<h3>Collecte - Le noël des lascars</h3>\r\nPar ailleurs à l''occasion de cette émission de noël, <strong>nous collectons dès maintenant vos jouets</strong> , en bon état bien sûr, <strong>pour les enfants du secours populaire</strong>.\r\n\r\nA cet effet, des boîtes en carton dédiées, sont a votre disposition au <strong>bar Le Chantier</strong> (18, Carrefour Jouaust, Bas des Lices, Rennes).\r\n\r\n<img class="alignnone size-large wp-image-508" title="emission_231211" src="http://localhost:8888/wp-openfader/wp-content/uploads/2011/12/emission_2312112-480x678.jpg" alt="Émission radio campus rennes décembre 2011" width="480" height="678" />', 'Émission RCR | Vendredi 23 décembre 2011 @ Le Chantier', '', 'publish', 'open', 'open', '', 'emission-rcr-23-12-11', '', '', '2011-12-15 13:45:45', '2011-12-15 13:45:45', '', 0, 'http://localhost:8888/wp-openfader/?p=485', 0, 'post', '', 0),
