(424, 1, '2011-10-04 13:01:19', '2011-10-04 13:01:19', 'Après le succès de l’édition de la <strong>taille S</strong>, l’équipe <strong>Size</strong> a grandi. Une <strong>taille M</strong> convient mieux à cette nouvelle édition. Cette fois, <strong>Size_</strong> s’associe aux associations <strong>Open Fader</strong> et <strong>Reservoirsons</strong>. Pour cet évènement, <strong>deux salles</strong> seront consacrées aux festivités avec toujours la valorisation des lieux à travers la <strong>décoration</strong> et la <strong>mise en lumière</strong> ainsi que la musique afin de créer une atmosphère particulière.\r\nEt si en plus vous apportez votre plus beaux couvre-chef, <strong>TAILLE « M »</strong> vous tire son chapeau !\r\n\r\n<img class="aligncenter size-large wp-image-422" title="jardin-moderne_taille-m" src="http://localhost:8888/wp-openfader/wp-content/uploads/2011/10/affiche_taiile-m.jpg" alt="Taille M | Jardin Moderne | samedi 5 novembre 2011" width="480" height="672" />\r\n<h3>NOISEBUILDER - live - (JUNKY ROBOT RECORDS / QUBIQ / HERETIK)</h3>\r\n<strong><img class="alignleft size-full wp-image-428" title="noisebuilder" src="http://localhost:8888/wp-openfader/wp-content/uploads/2011/10/noisebuilder1.jpg" alt="noisebuilder" width="203" height="210" />Noisebuilder</strong> commence au début des années 90 comme dj dans les subversives afters parisiennes. Il devient l’un des premiers acteurs de la scène rave party française en jouant ses premiers lives. La rencontre avec le <strong>Heretik System</strong> est déterminante, l’un des sound system français les plus populaires : là commence son histoire... Avec son label <strong>Junky Robot</strong> récemment créé,<strong> Noisebuilder</strong> fait un joli come-back avec des productions sculptées pour les dancefloors !\r\n\r\n&gt; <a href="http://www.facebook.com/NoisebuilderHeretik">Facebook</a>\r\n<h3>Commuter - live - (Skryptom, Afu Ltd, Goog)</h3>\r\n<img class="alignright size-full wp-image-442" title="commuter" src="http://localhost:8888/wp-openfader/wp-content/uploads/2011/10/commuter1.jpg" alt="commuter" width="170" height="240" />Depuis sa révélation sur <strong>Skryptöm</strong> en 2010, le label de <strong>Elecktric Rescue</strong>, <strong>Commuter</strong> se s''arrête plus : sur <strong>Goog Record</strong> (label de Lowkey et Kardinal), <strong>Junky Robot</strong> (label de Noisebuilder), <strong>Verboten Records</strong> ou sur le prestigieux label de <strong>Thomas P. Heckman, Afu ltd</strong>. Ce breton s’illustre sur diverses scènes et soirées prestigieuses comme les soirées PLAY, Astropolis, Panoramas, le Bataclan, le Glazart, le Batofar, le Lieu Unique, le Rex Club... Il vous offrira un live Minimal Techno puissant sur des sons hypnotiques et envoûtants. Promis juré.\r\n\r\n&gt; <a href="http://www.facebook.com/pages/commuter/64278967112?ref=ts">Facebook</a>\r\n<h3>Mais aussi :</h3>\r\n<ul>\r\n	<li><strong>Momo</strong> (Reservoirsons)</li>\r\n	<li><strong>Lloyd</strong> (Fake / Size)</li>\r\n	<li><strong>Oil B.</strong> (Spagh records / Open Fader)</li>\r\n	<li><strong>A/U/T/O</strong> (Size)</li>\r\n	<li><strong>Fat Freddy</strong> (Open Fader)</li>\r\n	<li><strong>Ecko</strong> (Reservoirsons)</li>\r\n	<li><strong>Squatt</strong> (Open Fader)</li>\r\n	<li><strong>Trysh</strong> (Reservoirsons)</li>\r\n</ul>\r\n<h3>Videos</h3>\r\n<div>\r\n<ul>\r\n	<li><strong>Akka Vj''s</strong> (Open Fader)</li>\r\n	<li><strong>Natural System</strong></li>\r\n</ul>\r\n</div>\r\n<h3>Infos</h3>\r\n<ul>\r\n	<li>PAF : <strong>12€</strong> taille unique (Préventes : Réseau <em>Tickenet</em> &amp; <em>Bar Le Chantier</em>)</li>\r\n	<li>Chapeaux &amp; lunettes bienvenus</li>\r\n	<li><a href="http://www.jardinmoderne.org/">Jardin Moderne</a> : <em>11 rue du Manoir de Servigné, Rennes (dans la zone industrielle de la route de  Lorient)</em></li>\r\n</ul>\r\n<h3>Befores</h3>\r\n<strong>Vendredi 4 novembre 2011 au Bar Le Chantier</strong> (18 carrefour Jouaust) à partir de 21h - Free\r\n<ul>\r\n	<li>Menthine</li>\r\n	<li>D''JP</li>\r\n	<li>Guez</li>\r\n</ul>\r\n<h3>Quelques players :</h3>\r\n<object width="100%" height="81" classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" codebase="http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,40,0"><param name="allowscriptaccess" value="always" /><param name="src" value="http://player.soundcloud.com/player.swf?url=http%3A%2F%2Fapi.soundcloud.com%2Ftracks%2F25726100" /><embed width="100%" height="81" type="application/x-shockwave-flash" src="http://player.soundcloud.com/player.swf?url=http%3A%2F%2Fapi.soundcloud.com%2Ftracks%2F25726100" allowscriptaccess="always" /></object> <span><a href="http://soundcloud.com/noisebuilder/noisebuilder-live-act-music">Noisebuilder - Live Act @ Music Makes Me Dance - 09242011</a> by <a href="http://soundcloud.com/noisebuilder">NOISEBUILDER</a></span>\r\n\r\n<object width="100%" height="81" classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" codebase="http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,40,0"><param name="allowscriptaccess" value="always" /><param name="src" value="http://player.soundcloud.com/player.swf?url=http%3A%2F%2Fapi.soundcloud.com%2Ftracks%2F6846240" /><embed width="100%" height="81" type="application/x-shockwave-flash" src="http://player.soundcloud.com/player.swf?url=http%3A%2F%2Fapi.soundcloud.com%2Ftracks%2F6846240" allowscriptaccess="always" /></object> <span><a href="http://soundcloud.com/commuter/commuter-promo-mix">Commuter-Promo Mix</a> by <a href="http://soundcloud.com/commuter">commuter</a></span>\r\n\r\n<object width="100%" height="81" classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" codebase="http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,40,0"><param name="allowscriptaccess" value="always" /><param name="src" value="http://player.soundcloud.com/player.swf?url=http%3A%2F%2Fapi.soundcloud.com%2Ftracks%2F23141866" /><embed width="100