(686, 1, '2013-02-03 18:04:28', '2013-02-03 18:04:28', '<p>Votre nom (obligatoire)<br />\r\n    [text* your-name] </p>\r\n\r\n<p>Votre email (obligatoire)<br />\r\n    [email* your-email] </p>\r\n\r\n<p>Sujet<br />\r\n    [text your-subject] </p>\r\n\r\n<p>Votre message<br />\r\n    [textarea your-message] </p>\r\n\r\n<p>[submit "Envoyer"]</p>\n[your-subject]\n[your-name] <[your-email]>\nDe : [your-name] <[your-email]>\r\nSujet : [your-subject]\r\n\r\nCorps du message :\r\n[your-message]\r\n\r\n--\r\nCe email a été envoyé via formulaire de contact le Open Fader http://localhost:8888/wp-openfader\nopenfader@gmail.com\n\n\n\n1\n[your-subject]\n[your-name] <[your-email]>\nCorps du message :\r\n[your-message]\r\n\r\n--\r\nCe email a été envoyé via formulaire de contact le Open Fader http://localhost:8888/wp-openfader\n[your-email]\n\n\n\nVotre message a bien été envoyé. Merci.\nErreur lors de l''envoi du message. Veuillez réessayer plus tard ou contacter l''administrateur d''une autre manière.\nErreur de validation. Veuillez vérifier les champs et soumettre à nouveau.\nErreur lors de l''envoi du message. Veuillez réessayer plus tard ou contacter l''administrateur d''une autre manière.\nMerci de bien vouloir accepter les conditions pour continuer.\nL''adresse email semble invalide.\nVeuillez remplir le champ obligatoire.\nVotre réponse est incorrecte.\nImpossible de télécharger le fichier.\nCe type de fichier n''est pas autorisé.\nCe fichier est trop volumineux.\nImpossible de télécharger le fichier. Une erreur est survenue.\nLe code entre est incorrect.', 'Formulaire de contact 1', '', 'publish', 'open', 'open', '', 'formulaire-de-contact-1', '', '', '2013-02-03 18:07:30', '2013-02-03 18:07:30', '', 0, 'http://localhost:8888/wp-openfader/?post_type=wpcf7_contact_form&#038;p=686', 0, 'wpcf7_contact_form', '', 0),
