(510, 1, '2012-01-04 16:17:02', '2012-01-04 16:17:02', '<img class="alignnone size-large wp-image-511" title="puzzlegame" src="http://localhost:8888/wp-openfader/wp-content/uploads/2012/01/puzzlegame-480x171.jpg" alt="puzzlegame" width="480" height="171" />\r\n\r\n<strong>La prochaine soirée arrive très bientôt et elle s''annonce ÉNORME !</strong>\r\n\r\nCela dit, et avant de vous dire<strong> QUOI ? QUI ? OU ?</strong> et autres détails sur l''évenement, nous vous proposons, en avant première, de <strong>gagner 2 places </strong>et ça c''est cool !\r\n<h3>Comment ?</h3>\r\nC''est très simple, il suffit pour cela de <strong><a href="http://localhost:8888/wp-openfader/wp-content/uploads/2012/01/openfader_puzzlegame.rar">telécharger les 36 pièces du Puzzle Game</a></strong> et de reconstituer l''affiche de la soirée afin de la découvrir avant tout le monde ...\r\n\r\nLes 10 <strong>premières personnes à vaincre ce puzzle et qui collent l''affiche</strong>, correctement et ''proprement'' reconstituée, sur le <strong><a href="http://www.facebook.com/openfader.page">mur de notre page Facebook</a></strong> (et seulement sur celui là) se verront particper à un triage au sort et 2 d''entre elles se verront remettre <strong>2 places chacune</strong> pour LA fameuse soirée en question !!\r\n\r\nTout les coups sont permis, du logiciel au collage ...\r\n\r\n<a href="http://localhost:8888/wp-openfader/wp-content/uploads/2012/01/openfader_puzzlegame.rar"><img class="aligncenter size-full wp-image-518" title="dl" src="http://localhost:8888/wp-openfader/wp-content/uploads/2012/01/dl.png" alt="download" width="224" height="219" /></a>\r\n<h3>Où la coller ?</h3>\r\nL''affiche est à coller par ici et pas ailleurs\r\n\r\n<a href="http://www.facebook.com/openfader.page">http://www.facebook.com/openfader.page</a>\r\n\r\nEt pour ceux qui ce posent la question : oui il faut un Facebook et oui il faut ''liker'' notre page ;D\r\n\r\nC''est parti, grouillez-vous !!', 'Puzzle Game', '', 'publish', 'open', 'open', '', 'puzzle-game', '', '', '2012-01-04 16:52:37', '2012-01-04 16:52:37', '', 0, 'http://localhost:8888/wp-openfader/?p=510', 0, 'post', '', 0),
