(536, 1, '2012-01-06 12:34:01', '2012-01-06 12:34:01', '<h3>Welcome on stage : Dope D.O.D</h3>\r\nUn savant mélange de musiques électroniques, de hip hop 90''s et une esthétique gothico-industrielle font de ce groupe un ovni excitant ! L''association <strong>ElektroPitch</strong> est fière de présenter ce métissage electro-hip-hop le <strong>18 Février 2012 à l''Ubu</strong>, minuit : Please welcome on stage : <strong>DOPE D.O.D</strong> !\r\n\r\nUne introduction old school hip hop and funk avec dj <strong>Fat Freddy</strong> et le groupe de funk <strong>Endless Summer</strong>.\r\nUne apparition de <strong>Micronologie</strong> serait la bienvenue pour accueillir ce hip hop hollandais par la garde locale ? Nous verrons bien, en tous cas <strong>Didier Sambal</strong>, leur dj sera à nos côtés et se fera le plaisir de conclure cette soirée haute en couleurs musicales par un set electro fidget, arme fatale à dance floors dont il a le secret.\r\n\r\n<img class="aligncenter size-large wp-image-539" title="affiche_dopedod_180212" src="http://localhost:8888/wp-openfader/wp-content/uploads/2012/01/affiche_dopedod_180212-480x675.jpg" alt="Affiche Open Fader ''Dope D.O.D'' - samedi 18 février 2012 @ ubu" width="480" height="675" />\r\n\r\nUn peu de détails ...\r\n<h3>dope d.o.d - Live (hollande)</h3>\r\n<img class="size-full wp-image-550 alignright" title="Dope-dod-press-2" src="http://localhost:8888/wp-openfader/wp-content/uploads/2012/01/Dope-dod-press-2.jpg" alt="Dope D.O.D" width="180" height="180" />Alors qu’avec Odd Future, on pensait avoir touché les bas-fonds d’un hip-hop sombre et macabre, le crew hollandais <strong>Dope D.O.D.</strong> (entendez « Duo Of Darkness ») débarque avec talent sur le terrain des Beggars et autres Virus Sindycate, et explose le baromètre de la « glauquitude ». Originaire de Gröningen (G-Town comme ils l’appellent) &amp; formé en 2007, notre quatuor dépareillé commence sévèrement à faire parler de lui, et vous kidnappe les oreilles à coup de rythmiques hip-hop impeccables et enrichies de sonorités dubstep / drum''n''bass. En témoigne leur fabuleux track « <em>What Happened</em> », dont le clip, à la réalisation impeccable, illustre un univers complet, dérangeant, oppressant … intriguant. Sur fond d’ambiance post-apocalyptique, se déroule une ligne basse puissante, une boucle redondante mais curieusement incisive à coups de sonorités presque industrielles et de mélodies glacées. C''est original, calculé au millimètre, obsédant, entêtant, sans chance de rémission. Les 3 MCs y distillent leurs flows énormes. Percutants, froids, crissants presque. Et le style de chacun d’eux se distingue clairement : les intonations appuyées de <strong>Jay Reaper</strong>, le ton rauque et menaçant de <strong>Skits Vicious</strong>, et enfin le flow fluide <strong>Dopey Rotten</strong>, rappellant parfois celui d’Eminem.\r\n\r\n<img class="alignleft  wp-image-555" title="dopedod_logo" src="http://localhost:8888/wp-openfader/wp-content/uploads/2012/01/dopedod_logo.png" alt="Dope D.O.D" width="120" height="120" />Leur premier album, paru en 2008, "<em>Fountain of Death</em>" atteste d’une culture hip-hop à l’ancienne, empruntant largement au hardcore des mid-nineties comme à<strong> Cypress Hill</strong>, se tenant cependant loin de toute caricature, quelque part entre la folie et la sympathie discrète. « <em>The Evil</em> » EP, paru en juin dernier, ou encore le titre « <em>Psychosis</em> », en collaboration avec <strong>Sean Price</strong> (Heltah Skeltah / USA), s’inscrivent en prémisses très prometteurs de l’album « Branded » à venir en novembre prochain !\r\n\r\nFort d’un hip-hop franc du collier, sombre et racé, proche de la grime uk, <strong>Dope D.O.D</strong> s’inscrit dans une certaine avant-garde du rap horrorcore, et scande haut et fort les travers d’une société consumériste qu’ils honnissent, brûlée par les deux bouts. Notre combo énervé apporte sans nul doute une grande bouffée d’oxygène au hip-hop européen et risque d’en secouer plus d’un !\r\n\r\n<img class="aligncenter size-large wp-image-547" title="Dope-dod-press-3" src="http://localhost:8888/wp-openfader/wp-content/uploads/2012/01/Dope-dod-press-3-480x226.jpg" alt="Dope D.O.D" width="480" height="226" />\r\n\r\n<hr />\r\n\r\n&gt; <a href="http://dopedod.com">dopedod.com</a>\r\n<h3>Didier sambal &amp; micronologie - Dj set &amp; live</h3>\r\n<strong><img class="alignright  wp-image-573" title="didier_sambal" src="http://localhost:8888/wp-openfader/wp-content/uploads/2012/01/didier_sambal-480x359.jpg" alt="didier sambal" width="288" height="215" />MICRONOLOGIE</strong> est un groupe de hip hop fondé à Rennes en 2005. <strong>K.Oni</strong>, <strong>Safirius</strong>, <strong>Casta</strong> (MC’s) et <strong>Dj Sambal</strong> constituent le groupe. Leur style mélange allègrement rhythm''n''blues, soul, funk et jazz avec pour dénominateur commun une certaine science du groove. La cinquième phalange de la formation est Permone, membre du collectif « Drum Brothers », beatmaker attitré du groupe. Leur nom est une contraction des mots "microphone" et "chronologie". Leur musique, manie le verbe avec dextérité en battant la mesure de manière effrénée. "Les Micronologues" sculptent un langage musical à base de boucles rythmiques étoffées, de samples cisaillés avec précision, de textes intelligents et de scratches incisifs. Héritiers du courant « Native Tongue » au sein du hip hop américain (A Tribe Called Quest, Jungle Brothers, De la Soul), ils se sont également nourris du meilleur de la scène française de la fin des années 90 : Sages poètes de la rue, Saïan Supa Crew, Scred Connexion...\r\n\r\nAprès un premier album éponyme paru localement en 2005, les 4 chimistes de <strong>MICRONOLOGIE</strong> se font repérer en participant aux <strong>Transmusicales de Rennes en 2007</strong> mais surtout en remportant le <strong>Tremplin du Festival des Vieilles Charrues en 2008</strong>. S’en suit l’enregistrement d’un nouvel opus « <strong><em>ART RYTHME ETHIQUE</em></strong> » à paraître le 17 avril 2009.\r\n\r\n<img class="aligncenter size-large wp-image-574" title="micronologie" src="http://localhost:8888/wp-openfader/wp-content/uploads/2012/01/micronologie-480x320.jpg" alt="micronologie" width="480" height="320" />\r\n\r\nAvec ce disque, <strong>Micronologie</strong> revisite le hip hop old school à coup de samples motown mis en texte de manière parfois consciente, parfois drôle mais toujours subtile. L’album est également le fruit de rencontres, avec un featuring de la dernière sensation hip hop anglaise Foreign Beggars sur le bien nommé « Mendiants Etrangers ». Toujours à l’international, le morceau « Trilingual » est une collaboration avec le rappeur américain <strong>Sun7</strong> et <strong>Naufalle</strong> du groupe Aïwa. Les morceaux « Ceci s’adresse », « Résistants » et « Eux=MC’s² » portent la signature du groupe avec une pulsation funky irrésistible. « Le son Qui Deheboite », du nom de son producteur<strong> DJ Deheb</strong> (producteur de nombreux MC’s américains), est un véritable ovni doté d’un son massif, original et rehaussé par un featuring de l’excellent groupe rennais <strong>Panel Large</strong>. Des titres comme « L’Escalier » et « Point Final », quant à eux, montrent un autre aspect du groupe, plus conscient.\r\n\r\n<hr />\r\n\r\n&gt; <a href="http://www.myspace.com/micronologie">myspace</a>\r\n<h3>Endless Summer - Live</h3>\r\n<p><strong>Endless Summer</strong> était à l’origine, un quartet orienté <strong>jazz & soul</strong> C’est à sept, qu’ils créent ce collectif pour un concert unique. Mais pris au jeu, ils décident de remettre le couvert en vous servant cette recette finement assemblée des meilleurs crus de <strong>old-school funk, nu-soul et autres breaks</strong>.</p>\r\n<p style="text-align: center;"><img class="size-large wp-image-570 aligncenter" title="endless_summer" src="http://localhost:8888/wp-openfader/wp-content/uploads/2012/01/endless_summer-480x360.jpg" alt="Endless Summer" width="480" height="360" /></p>\r\n\r\n\r\n<hr />\r\n<p style="text-align: left;">&gt; <a href="http://www.myspace.com/xxendlesssummerxx">myspace</a></p>\r\n\r\n<h3>Infos Pratiques</h3>\r\n<ul>\r\n	<li>PAF : <strong>18 €</strong></li>\r\n	<li>Préventes : réseau <strong>Tickenet</strong> &amp; bar <strong>Le Chantier</strong></li>\r\n	<li><strong>Ubu :</strong> 1, rue St Hélier, 3500Rennes</li>\r\n	<li>évènement FB : <a href="http://www.facebook.com/events/202738676487298/">http://www.facebook.com/events/202738676487298/</a></li>\r\n</ul>\r\n<h3>Befores</h3>\r\n<ul>\r\n	<li><strong>Samedi 11 février </strong> au bar <strong>Le Chantier</strong> avec <strong>Boogaloo </strong>(Stone Groove) &amp; <strong>Menthine </strong>(Open Fader)</li>\r\n	<li><strong>Vendredi 17 février</strong> au <strong>Bar''Hic</strong> avec <strong>Wahn</strong> (Labtop Session), <strong>Human Shell</strong> (Sophos), <strong>Katell</strong> (Open Fader)</li>\r\n</ul>\r\n\r\n<hr />\r\n\r\nLe Chantier : 18 carrefour Jouaust, Rennes\r\nLe Bar''Hic : place des lices , Rennes\r\n<h3>Clips Vidéos</h3>\r\n<strong>Dope D.O.D</strong>\r\n<iframe src="http://www.youtube.com/embed/Z-zL_paDVTc?rel=0" frameborder="0" width="480" height="274"></iframe>\r\n<strong>Micronologie</strong>\r\n<iframe src="http://www.youtube.com/embed/5xjKoJSSSvM?rel=0" frameborder="0" width="480" height="274"></iframe>', 'Dope D.O.D | Ubu | Samedi 18 février 2012', '', 'publish', 'open', 'open', '', 'dope-d-o-d-ubu-samedi-18-fevrier-2012', '', '', '2013-02-13 18:41:18', '2013-02-13 18:41:18', '', 0, 'http://localhost:8888/wp-openfader/?p=536', 0, 'post', '', 4),
