(601, 1, '2012-01-25 13:05:13', '2012-01-25 13:05:13', 'En guise de <strong>Teaser</strong> de la prochaine <strong>Open Fader à l''Ubu (18.02.12)</strong>, voici quelques vidéos qui devraient en convaincre plus d''un !!\r\n\r\n<img class="alignnone size-full wp-image-602" title="dopedod_video_thumb" src="http://localhost:8888/wp-openfader/wp-content/uploads/2012/01/dopedod_video_thumb.jpg" alt="dope dod" width="480" height="150" />\r\n\r\nD''abord un aperçu de leur passage récent au <strong>Bikini</strong> à <strong>Toulouse</strong> :\r\n\r\n<iframe src="http://www.youtube.com/embed/OVoQrfyIF6g?rel=0" frameborder="0" width="480" height="274"></iframe>\r\n\r\nEnsuite leur <strong>dernier clip</strong> ... c''est tout frais :\r\n\r\n<iframe src="http://www.youtube.com/embed/rOXwZfX2I6c?rel=0" frameborder="0" width="480" height="274"></iframe>\r\n\r\nOn complétera cette petite liste avec le dernier clip de <strong>Micronologie</strong>, car la garde locale n''a pas à pâlir :\r\n\r\n<iframe src="http://www.youtube.com/embed/5xjKoJSSSvM?rel=0" frameborder="0" width="480" height="274"></iframe>\r\n\r\nEt puis, bien sûr, le fameux clip aux (plus de) <strong>5 millions vues</strong> :\r\n\r\n<iframe src="http://www.youtube.com/embed/Z-zL_paDVTc?rel=0" frameborder="0" width="480" height="274"></iframe>\r\n\r\nAlors ??\r\n\r\nVoilà, RDV le <strong>samedi 18 février</strong> à l''<a href="http://www.ubu-rennes.com/">Ubu</a> !!\r\n\r\n<a title="Dope D.O.D | Ubu | Samedi 18 février 2012" href="http://localhost:8888/wp-openfader/2012/events/dope-d-o-d-ubu-samedi-18-fevrier-2012/">+ de détails sur cette soirée</a>', 'Quelques vidéos ... ou comment teaser la ''DOPE D.O.D''', '', 'publish', 'open', 'open', '', 'quelques-videos-ou-comment-teaser-la-dope-d-o-d', '', '\nhttp://www.openfader.org/2012/events/dope-d-o-d-ubu-samedi-18-fevrier-2012/', '2013-02-13 18:41:12', '2013-02-13 18:41:12', '', 0, 'http://localhost:8888/wp-openfader/?p=601', 0, 'post', '', 0),
