(618, 1, '2012-02-14 13:53:12', '2012-02-14 13:53:12', '<h3>L''avez-vous déjà remarqué ?</h3>\r\nPeut-être avez vous remarqué, ces derniers mois, une cocotte trôner sur les comptoirs rennais ?\r\nRassurez vous, en aucun cas, la bestiole ne vous mordra car sous ses plumes de papier se cache la <strong>Cocotte Fanzine</strong>, une nouvelle gazette rennaise qui pose à plat ses chroniques pour mieux les replier sous un élégant origami illustré.\r\n\r\n<img class="alignnone size-full wp-image-619" title="bandeau-fanzine-long" src="http://localhost:8888/wp-openfader/wp-content/uploads/2012/02/bandeau-fanzine-long.jpg" alt="cocotte fanzine n°2" width="480" height="109" />\r\nA chaque saison, l''animal se plie à une thématique où billets d''humeur et articles s''échappent du poulailler à la découverte des pépites culturelles et alternatives du moment !\r\n\r\nInvitée de l''<a title="Émission RCR | jeudi 16 février 2012 @ Le Chantier" href="http://localhost:8888/wp-openfader/2012/emission-radio/emission-rcr-jeudi-16-fevrier-2012-le-chantier/">émission de radio Open Fader</a>, jeudi 16 février, la cocotte dévoilera son univers et son actualité en vue de la sortie au printemps de <strong>son troisième épisode</strong> !\r\n\r\nFaites donc un tour sur le <a href="http://lacocottefanzine.tumblr.com/">Cocotte Tumblr</a> !!\r\n\r\n<em>Cover Cocotte Fanzine n°2 :</em>\r\n\r\n<img class="alignnone size-full wp-image-620" title="RECTO-COCOTTE_OCT_2011-petit" src="http://localhost:8888/wp-openfader/wp-content/uploads/2012/02/RECTO-COCOTTE_OCT_2011-petit.jpg" alt="cocotte fanzine n°2" width="480" height="480" />\r\n\r\n<em>Cover Cocotte Fanzine n°1 :</em>\r\n\r\n<img class="alignnone size-full wp-image-621" title="COCOTTE-1" src="http://localhost:8888/wp-openfader/wp-content/uploads/2012/02/COCOTTE-1.jpg" alt="Cocotte Fanzine n°1" width="480" height="490" />', 'La Cocotte Fanzine : la gazette en origami', '', 'publish', 'open', 'open', '', 'la-cocotte-fanzine-la-gazette-en-origami', '', '\nhttp://www.openfader.org/2012/emission-radio/emission-rcr-jeudi-16-fevrier-2012-le-chantier/', '2012-02-14 13:55:15', '2012-02-14 13:55:15', '', 0, 'http://localhost:8888/wp-openfader/?p=618', 0, 'post', '', 0),
(606, 1, '2012-02-01 14:08:36', '2012-02-01 14:08:36', '<h3>Jeudi 16 février 2012 | Le Chantier | 21h - 01h - Free</h3>\r\nEnregistrement de l’émission pour<a href="http://www.radiocampusrennes.fr"> Radio Campus Rennes</a> de <strong>février</strong> en direct et en public au <strong>bar Le Chantier.</strong>\r\nAu programme de cette émission présentée par <strong>Katell</strong> :\r\n<ul>\r\n	<li><strong>RAËL\r\n</strong>Epsylonn Otoktone</li>\r\n	<li><strong>BANDIT TRACKS &amp; ALBERTO BASTARD\r\n</strong>Acolytes Sound System</li>\r\n	<li><strong>BEE FLEX\r\n</strong>Kamikaz Cross Fader</li>\r\n</ul>\r\nInterviews : <strong>Les Cocottes, le 48</strong>\r\n\r\nPlaces à gagner pour la ''<a title="Dope D.O.D | Ubu | Samedi 18 février 2012" href="http://localhost:8888/wp-openfader/2012/events/dope-d-o-d-ubu-samedi-18-fevrier-2012/">DOPE D.O.D</a>'' le <strong>samedi 18 février à l''Ubu</strong>\r\n\r\nDiffusion de l''émission sur <strong>RCR</strong> (88.4fm) le <strong>samedi 25 février</strong> 2012 de 21h à 00h.\r\n\r\n<img class="alignnone  wp-image-607" title="emission_160212" src="http://localhost:8888/wp-openfader/wp-content/uploads/2012/02/emission_160212.jpg" alt="émission radio campus rennes février 2012" width="480" height="480" />', 'Émission RCR | jeudi 16 février 2012 @ Le Chantier', '', 'publish', 'open', 'open', '', 'emission-rcr-jeudi-16-fevrier-2012-le-chantier', '', '\nhttp://www.openfader.org/2012/events/dope-d-o-d-ubu-samedi-18-fevrier-2012/', '2012-02-01 14:21:21', '2012-02-01 14:21:21', '', 0, 'http://localhost:8888/wp-openfader/?p=606', 0, 'post', '', 1),
