(628, 1, '2012-02-21 18:15:51', '2012-02-21 18:15:51', 'Vous trouverez ici tous les reports vidéo de cette <a title="Dope D.O.D | Ubu | Samedi 18 février 2012" href="http://localhost:8888/wp-openfader/2012/events/dope-d-o-d-ubu-samedi-18-fevrier-2012/">soirée de ouf du samedi 18 avril 2012 à l''ubu</a>.\r\n\r\nOn complétera cet article au fur et à mesure des sorties  vidéos ... stay tuned !!\r\n<h3>Endless Summer par Boilerhum</h3>\r\n<iframe src="http://player.vimeo.com/video/40298475" frameborder="0" width="480" height="270"></iframe>\r\n<h3>Micronologie par Boilerhum</h3>\r\n<iframe src="http://player.vimeo.com/video/40221076" frameborder="0" width="480" height="270"></iframe>\r\n<h3>Dope D.O.D par Boilerhum</h3>\r\n<iframe src="http://player.vimeo.com/video/40370110" frameborder="0" width="480" height="270"></iframe>\r\n<h3>Dope D.O.D. par Damien Stein</h3>\r\n<iframe src="http://www.youtube.com/embed/3GyeMQxRPk4" frameborder="0" width="480" height="274"></iframe>\r\n&gt; <a href="http://damienstein.tumblr.com/">http://damienstein.tumblr.com/</a>\r\n<h3>Endless Summer - Extrait !</h3>\r\n<iframe src="http://www.youtube.com/embed/-NrA3P4GzPE" frameborder="0" width="480" height="274"></iframe>\r\n<h3>Didier Sambal par Damien Stein</h3>\r\n<iframe src="http://www.youtube.com/embed/_OBlYu-WsIw?rel=0" frameborder="0" width="480" height="274"></iframe>', 'Retour en vidéos sur la Dope D.O.D. du 18.02.12', '', 'publish', 'open', 'open', '', 'retour-en-videos-sur-la-dope-d-o-d-du-18-02-12', '', '\nhttp://www.openfader.org/2012/events/dope-d-o-d-ubu-samedi-18-fevrier-2012/', '2013-02-13 18:41:06', '2013-02-13 18:41:06', '', 0, 'http://localhost:8888/wp-openfader/?p=628', 0, 'post', '', 1),
