(639, 1, '2012-03-22 18:15:34', '2012-03-22 18:15:34', 'Enregistrement en direct &amp; en public de l''<strong>émission RCR</strong> (<a href="http://www.radiocampusrennes.fr">radiocampusrennes.fr</a>) de <strong>mars</strong> au bar <strong>Le Chantier\r\nSamedi 24 mars | 21h - 1h | free  </strong>\r\n\r\nAu programme :\r\n\r\n<strong>Analogue Gypsi\r\n</strong>(Electro - Balkan Step / Unknown Frequencies)\r\n&gt; <a href="http://www.soundcloud.com/unknown-frequencies">http://www.soundcloud.com/unknown-frequencies</a>\r\n\r\nÉmission présenté par <strong>Brim</strong>\r\n\r\nDiffusion sur Radio Campus Rennes (88.4Fm) le samedi 31 mars de 21h à 00h.\r\n\r\nLe Chantier : 18 carrefour Jouast, Rennes\r\n\r\n<img class="alignnone size-full wp-image-640" title="emission_240312" src="http://localhost:8888/wp-openfader/wp-content/uploads/2012/03/emission_240312.jpg" alt="emission_240312" width="480" height="480" />', 'Émission RCR | samedi 24 mars 2012 @ Le Chantier', 'Enregistrement en direct & en public de l''émission RCR de mars au bar Le Chantier', 'publish', 'open', 'open', '', 'emission-rcr-samedi-24-mars-2012-le-chantier', '', '', '2012-03-22 18:17:02', '2012-03-22 18:17:02', '', 0, 'http://localhost:8888/wp-openfader/?p=639', 0, 'post', '', 0),
