(663, 1, '2012-04-16 18:23:47', '2012-04-16 18:23:47', 'De 20h à 01h | Free.\r\n\r\nEnregistrement en direct &amp; en public de l''émission <strong>Radio Campus Rennes</strong> (<a href="http://www.radiocampusrennes.fr">www.radiocampusrennes.fr</a>) d''avril.\r\n\r\nÉmission spéciale associations présentée par <strong>K-Lymero </strong>avec\r\n<ul>\r\n	<li><strong>Midweek</strong></li>\r\n	<li><strong>Midi Deux</strong></li>\r\n	<li><strong>S''il Te Play</strong></li>\r\n	<li>Itw des <strong>Cocottes</strong> pour la sortie du 3ème numéro</li>\r\n</ul>\r\n1 place à gagner pour la <strong>SkinJackin</strong> du 28.04\r\n\r\nDiffusion sur <strong>Radio Campus Rennes</strong> (88.4FM) le <strong>samedi 28 avril</strong> 2012 à 21h puis en podcast sur le site.\r\n\r\n<img class="alignnone size-full wp-image-669" title="emission_210412" src="http://localhost:8888/wp-openfader/wp-content/uploads/2012/04/emission_2104121.jpg" alt="émission 210412" width="480" height="480" />\r\n\r\n&nbsp;', 'Émission RCR | samedi 21 avril 2012 @ Le Chantier', '', 'publish', 'open', 'open', '', 'emission-rcr-samedi-21-avril-2012-le-chantier', '', '', '2012-04-18 08:41:51', '2012-04-18 08:41:51', '', 0, 'http://localhost:8888/wp-openfader/?p=663', 0, 'post', '', 0),
(646, 1, '2012-03-23 19:11:41', '2012-03-23 19:11:41', '<h3>Skin Jackin'' Party</h3>\r\n<strong>Samedi 28 avril 2012 | 00h- 06h | Ubu</strong>\r\n<ul>\r\n	<li><strong>Phil Kieran </strong>- <em>Live</em> [ Ireland | Techno_PKRec, Cocoon ]</li>\r\n	<li><strong>Red Sunrise</strong> - <em>Live</em> [Verboten records / Junky Robot]</li>\r\n	<li><strong>Ecko</strong> [Reservoirsons]</li>\r\n	<li><strong>DRJD Low</strong> [Open Fader]</li>\r\n	<li><strong>Skin Jackin</strong> [Live Paint Tattoo]</li>\r\n</ul>\r\n<img class="alignnone size-full wp-image-655" title="fly1_skinjackin" src="http://localhost:8888/wp-openfader/wp-content/uploads/2012/03/fly1_skinjackin.jpg" alt="Skin Jackin Party - samedi 28 avril 2012 - Ubu Club" width="480" height="655" />\r\n\r\n<img class="alignright size-full wp-image-648" title="Elisa" src="http://localhost:8888/wp-openfader/wp-content/uploads/2012/03/Elisa.jpg" alt="Elisa - SkinJackin Party" width="200" height="200" />Une soirée electro-techno haute en couleur, pour sûr validée et illuminée par les poscas du <strong><a href="http://www.skinjackin.com/">Skin Jackin'' crew</a></strong>. Les dermo-pirates bordelais viendront peindre les épidermes de nos corps ainsi mieux préparés pour s’aventurer sur le dance-floor !\r\n\r\nC’est notre <strong>DRJD Low</strong> local, moitié de <strong><a href="http://www.facebook.com/people/Frogs-Appetite/100001814496592">Frog’s Appetite</a></strong>, qui accueillera les premiers poscaïsés et se chargera ainsi d’ introduire le live de <strong><a href="http://soundcloud.com/red-sunrise">Red Sunrise</a></strong>.\r\nCe dernier, producteur de talent prolifique nous offre un live punchy résolument Dance Floor, à l’équilibre melodico-acide bien trouvé.\r\n\r\n<img class="alignleft size-full wp-image-650" title="philkieran" src="http://localhost:8888/wp-openfader/wp-content/uploads/2012/03/philkieran.jpg" alt="Phil Kieran - Skin Jackin Party" width="200" height="152" />Maître de cérémonie, c’est <strong><a href="http://www.philkieran.com/">Phil Kieran</a></strong> qui viendra faire tourner son live à l''<strong><a href="http://www.ubu-rennes.com/">Ubu</a></strong>. Vous vous rappelez peut-être de cet excellent remix de <em><strong>Motor 1*1</strong></em>, vous avez été séduit par son excellent album sur <strong><em>Cocoon</em></strong> ou ses dernières productions avec <strong><em>Green Velvet</em></strong> sur son propre label ?! Une soirée haute en couleur on vous dit !!\r\n\r\n<strong><a href="http://www.myspace.com/eckopitch">Dj Ecko</a></strong> se chargera des plus vaillants (tous !) avec un set de tracks techno puissants et efficaces pour conclure cette <strong>Skin Jackin'' Party</strong>.\r\n<h3>Infos Pratiques</h3>\r\n<ul>\r\n	<li><strong>PAF :</strong> <strong>13 / 15 €</strong></li>\r\n	<li><strong>Préventes :</strong> Réseau Tickenet &amp; Bar Le Chantier (18 carrefour Jouaust, Rennes) &amp; Select Shop (rue St Georges, Rennes)</li>\r\n	<li><strong>Ubu :</strong> 1 rue St Hélier à Rennes</li>\r\n</ul>\r\n<h3>Un petit clip ?</h3>\r\n<iframe src="http://www.youtube.com/embed/RjDTLAjMFJo?rel=0" frameborder="0" width="480" height="360"></iframe>\r\n<h3>Before</h3>\r\nLe <strong>soir même</strong>, le <strong>Select Shop</strong> vous propose sa soirée mensuelle <strong>LP &gt; MP3</strong> (<em>Only Vinyl dj set</em>) en guise de before de l''<strong>Ubu.</strong>\r\n\r\nÇa se passe au <strong>Chantier</strong>, avec <strong>Pat Panik</strong>, <strong>MKL</strong>, <strong>Oil B.\r\n</strong>C''est de <strong>21h à 01h, et c''est free</strong>. (avec une braderie Troc'' Vinyl de 8hà 21h)\r\n\r\nPlus d''infos par là : <a href="http://www.facebook.com/lpmp3">http://www.facebook.com/lpmp3</a>\r\n<h3>Quelques links</h3>\r\n<ul>\r\n	<li><a href="http://www.philkieran.com/">http://www.philkieran.com/</a></li>\r\n	<li><a href="http://soundcloud.com/red-sunrise">http://soundcloud.com/red-sunrise</a></li>\r\n	<li><a href="http://www.myspace.com/eckopitch">http://www.myspace.com/eckopitch</a></li>\r\n	<li><a href="http://www.myspace.com/drjdlow">http://www.myspace.com/drjdlow</a></li>\r\n	<li><a href="http://www.skinjackin.com/">http://www.skinjackin.com/</a></li>\r\n</ul>', 'Skin Jackin'' Party | Ubu | samedi 28 avril 2012', 'Une soirée electro-techno haute en couleur !!\r\nPhil Kieran - live | Red Sunrise - Live | Ecko | DRJD Low | Skin Jackin'' performance', 'publish', 'open', 'open', '', 'skin-jackin-party-ubu-samedi-28-avril-2012', '', '', '2013-02-13 18:40:58', '2013-02-13 18:40:58', '', 0, 'http://localhost:8888/wp-openfader/?p=646', 0, 'post', '', 0),
