(687, 1, '2013-02-05 20:41:05', '2013-02-05 20:41:05', 'La prochaine soirée <strong>Open Fader ''<em>Versatile'' </em></strong>se déroulera le <em>samedi <strong>16 mars</strong> 2013</em> à l''<a title="voir les site de l''ubu" href="http://www.ubu-rennes.com/" target="_blank">ubu club</a> !', 'Versatile, coming soon ...', '', 'publish', 'closed', 'closed', '', 'coming-soon-2', '', '', '2013-02-13 18:40:52', '2013-02-13 18:40:52', '', 0, 'http://localhost:8888/wp-openfader/?p=687', 0, 'post', '', 0),
(843, 0, '2013-03-11 13:46:21', '2013-03-11 13:46:21', 'Bonjour, \r\nSur les recommandations de Camille de l''association ATM, je me permets de prendre contact avec vous concernant la soirée de samedi soir Legowelt, Bot''Ox, Prosumer, à la MJC Antipode. \r\nVendez-vous des places à des tarifs préférentiels pour les titulaires de la carte Antipode/ubu ? \r\nMerci! \r\nBonne journée, \r\nLoubna\n<!--more-->\nAUTHOR: loubnabentamy@hotmail.com\nAUTHOR EMAIL: loubnabentamy@hotmail.com\nAUTHOR URL: \nSUBJECT: [contact\nIP: 212.198.111.18\nArray\n(\n    [Nom] =&gt; Bentamy Loubna\n    [email] =&gt; loubnabentamy@hotmail.com\n    [Message] =&gt; Bonjour, \r\nSur les recommandations de Camille de l''association ATM, je me permets de prendre contact avec vous concernant la soirée de samedi soir Legowelt, Bot''Ox, Prosumer, à la MJC Antipode. \r\nVendez-vous des places à des tarifs préférentiels pour les titulaires de la carte Antipode/ubu ? \r\nMerci! \r\nBonne journée, \r\nLoubna \r\n\n)\n', 'loubnabentamy@hotmail.com - 2013-03-11 13:46:21', '', 'publish', 'open', 'open', '', '0baed665c9b07bd10e06dd48dac8737a', '', '', '2013-03-11 13:46:21', '2013-03-11 13:46:21', '', 44, 'http://localhost:8888/wp-openfader/?post_type=feedback&p=843', 0, 'feedback', '', 0),
(847, 0, '2013-04-30 06:02:33', '2013-04-30 06:02:33', 'Hello\r\n\r\nMy name is Petra Hagmann, I’m the responsible booking agent for CAGE and Sadistik. They are excited to announce their European tour in September 2013 and I wanted to see if you would be interested in this bill. \r\n\r\nCAGE is best known for being a part of Def Jux records &amp; recording alongside indie rap legends such as El-P, Aesop Rock &amp; many others. He''s sold hundreds of thousands of albums and is the protagonist in an upcoming film by Shia LaBeouf. CAGE has not toured Europe since 2008, and since then he''s toured with Kid Cudi, released a music video on MTV directed by Shia Lebouff, has starred in a short film with Kid Cudi called MANIAC, and performed the song MANIAC with Kid Cudi on Jimmy Fallon. In addition to that, CAGE is set to release his highly anticipated album in May. \r\n\r\nIt’s been three months since the release of Sadistik’s new album “Flowers for my Father” on Fake Four Inc., which debuted at number 11 on the iTunes Hip-Hop charts! Please feel free to check out his new music video for “Russian Roulette” www.youtube.com/watch?v=zpZ5OHt38b4 feat. Cage &amp; Yes Alexander which debuted on VIBE, please take a moment to check it out: www.vibe.com/article/v-premiere-sadistik-feat-cage-yes-alexander-russian-roulette-video\r\n\r\nSadistik was currently touring with CunninLynguists across Canada and he has collaborated, played shows and/or toured with acts such as Tech N9ne, D-12, Bone Thugs-n-Harmony, Eyedea, P.O.S., Sage Francis, Doomtree, Slaughterhouse, Big Boi, Atmosphere, etc. and has developed a ravenous and growing fan base world wide. His last European tour was in 2010 and was quite successful, but his fanbase has grown drastically since then. \r\n\r\nPlease feel free to check out a few music videos:\r\n\r\nCAGE:\r\n“I Never Knew You” www.youtube.com/watch?v=F4Sxm6zx4e8\r\n“Captain Bumout” www.youtube.com/watch?v=vrIUuP88Jpw\r\n“Super Baked” www.youtube.com/watch?v=zk3EjNk8sEE \r\n\r\nSadistik:\r\n“Searching for Some Beautiful” www.youtube.com/watch?v=VnzaPkl6Nvg \r\n“Micheal” www.youtube.com/watch?v=CI9pLSH5Mcw \r\n“City in Amber” www.youtube.com/watch?v=ikfR4ppmStU \r\n\r\nIf you are interested, please simply reply to this email. Feel free to check out the links below for further information on both, Sadistik’s and CAGE’s music. Thank you very much for your time, please don''t hesitate to contact me with any questions or concerns you might have.\r\n\r\nBest,\r\nPetra Hagmann\r\n\r\nCAGE\r\nwww.chrispalko.com\r\n\r\nSadistik\r\nwww.sadistikmusic.com\n<!--more-->\nAUTHOR: petrahagmann@gmail.com\nAUTHOR EMAIL: petrahagmann@gmail.com\nAUTHOR URL: \nSUBJECT: [contact\nIP: 88.84.12.239\nArray\n(\n    [Nom] =&gt; Petra Hagmann\n    [email] =&gt; petrahagmann@gmail.com\n    [Message] =&gt; Hello\r\n\r\nMy name is Petra Hagmann, I’m the responsible booking agent for CAGE and Sadistik. They are excited to announce their European tour in September 2013 and I wanted to see if you would be interested in this bill. \r\n\r\nCAGE is best known for being a part of Def Jux records &amp; recording alongside indie rap legends such as El-P, Aesop Rock &amp; many others. He''s sold hundreds of thousands of albums and is the protagonist in an upcoming film by Shia LaBeouf. CAGE has not toured Europe since 2008, and since then he''s toured with Kid Cudi, released a music video on MTV directed by Shia Lebouff, has starred in a short film with Kid Cudi called MANIAC, and performed the song MANIAC with Kid Cudi on Jimmy Fallon. In addition to that, CAGE is set to release his highly anticipated album in May. \r\n\r\nIt’s been three months since the release of Sadistik’s new album “Flowers for my Father” on Fake Four Inc., which debuted at number 11 on the iTunes Hip-Hop charts! Please feel free to check out his new music video for “Russian Roulette” www.youtube.com/watch?v=zpZ5OHt38b4 feat. Cage &amp; Yes Alexander which debuted on VIBE, please take a moment to check it out: www.vibe.com/article/v-premiere-sadistik-feat-cage-yes-alexander-russian-roulette-video\r\n\r\nSadistik was currently touring with CunninLynguists across Canada and he has collaborated, played shows and/or toured with acts such as Tech N9ne, D-12, Bone Thugs-n-Harmony, Eyedea, P.O.S., Sage Francis, Doomtree, Slaughterhouse, Big Boi, Atmosphere, etc. and has developed a ravenous and growing fan base world wide. His last European tour was in 2010 and was quite successful, but his fanbase has grown drastically since then. \r\n\r\nPlease feel free to check out a few music videos:\r\n\r\nCAGE:\r\n“I Never Knew You” www.youtube.com/watch?v=F4Sxm6zx4e8\r\n“Captain Bumout” www.youtube.com/watch?v=vrIUuP88Jpw\r\n“Super Baked” www.youtube.com/watch?v=zk3EjNk8sEE \r\n\r\nSadistik:\r\n“Searching for Some Beautiful” www.youtube.com/watch?v=VnzaPkl6Nvg \r\n“Micheal” www.youtube.com/watch?v=CI9pLSH5Mcw \r\n“City in Amber” www.youtube.com/watch?v=ikfR4ppmStU \r\n\r\nIf you are interested, please simply reply to this email. Feel free to check out the links below for further information on both, Sadistik’s and CAGE’s music. Thank you very much for your time, please don''t hesitate to contact me with any questions or concerns you might have.\r\n\r\nBest,\r\nPetra Hagmann\r\n\r\nCAGE\r\nwww.chrispalko.com\r\n\r\nSadistik\r\nwww.sadistikmusic.com\r\n\n)\n', 'petrahagmann@gmail.com - 2013-04-30 06:02:33', '', 'publish', 'open', 'open', '', '1776a5dac962389e14d4e0a05c991062', '', '', '2013-04-30 06:02:33', '2013-04-30 06:02:33', '', 44, 'http://localhost:8888/wp-openfader/?post_type=feedback&p=847', 0, 'feedback', '', 0),
