(719, 1, '2013-02-09 15:01:59', '2013-02-09 15:01:59', 'Nouvelle release  sur <a href="http://www.spaghrecords.fr">spaghrecords</a> pour <a href="http://soundcloud.com/oilb">oil b.</a> : plume sera disponible en digital sur vos plateformes (beatport, juno, trackitdow, itunes, ...) à partir du <strong>25 février</strong>.\r\n\r\nAlready supported by <em>Richie Hawtin, Jesse Rose, Franco Bianco, Mild Bang, Jose Wated</em> ...\r\n\r\n<iframe src="https://w.soundcloud.com/player/?url=http%3A%2F%2Fapi.soundcloud.com%2Ftracks%2F76692205" height="166" width="100%" frameborder="no" scrolling="no"></iframe>', 'Plume ep sur spaghrecords', '', 'publish', 'open', 'open', '', 'plume-ep-sur-spaghrecords', '', '', '2013-02-25 19:26:21', '2013-02-25 19:26:21', '', 0, 'http://localhost:8888/wp-openfader/?p=719', 0, 'post', '', 0),
(740, 1, '2013-02-13 18:06:55', '2013-02-13 18:06:55', '<h2>Gilb''R à Rennes le samedi 16 mars - 00h &gt; 06h !</h2>\r\n<p style="text-align: center;"><a href="http://localhost:8888/wp-openfader/2013/events/open-fader-versatile/"><img class="aligncenter  wp-image-755" alt="Open Fader Versatile, samedi 16 mars 2013 à l''ubu club avec Gilb''R, Monkey Analow, Oil B., Squatt" src="http://localhost:8888/wp-openfader/wp-content/uploads/2013/02/facebook.jpg" width="851" height="315" /></a></p>\r\n\r\n<ul>\r\n	<li><strong>Gilb’R</strong> [versatile records, fr]</li>\r\n	<li><strong>Monkey Analow</strong> [spagh records, fr]</li>\r\n	<li><strong>Oil B.</strong> [spagh records | openfader, fr]</li>\r\n	<li><strong>Squatt</strong> [openfader, fr]</li>\r\n</ul>\r\n<!--more-->\r\n<h2>La soirée :</h2>\r\n<strong><a href="http://localhost:8888/wp-openfader/wp-content/uploads/2013/02/Gilbr-pic-800px.jpg"><img class=" wp-image-742 alignleft" title="Gilb''R" alt="Gilb''R" src="http://localhost:8888/wp-openfader/wp-content/uploads/2013/02/Gilbr-pic-800px-300x300.jpg" width="200" height="200" /></a><a href="https://soundcloud.com/gilbr" target="_blank">Gilb’R</a></strong> est un homme à multiples facettes : boss de <a href="http://versatilerecords.com/" target="_blank"><strong>Versatile records</strong></a>, co-pilote de <strong>Chateau Flight</strong> avec <strong>I:Cube</strong>, producteur de <strong>The Big Crunch Theory</strong> avec <strong>Lisa Li Lund</strong>, membre de<strong> Aladdin</strong> avec <strong>Nicolas Ker</strong>, producteur solo reconnu et dj encyclopédique.\r\n\r\n<strong>Versatile ?</strong> Outre-Atlantique c''est être polyvalent. Pour <strong>les Faders</strong> le mot sonne comme une invitation... Et l''occasion est toute trouvée : faire venir <strong>Gilb’R</strong> à l’<a href="http://www.ubu-rennes.com/" target="_blank"><strong>Ubu</strong></a> et lui adjoindre l’actualité bouillonnante &amp; variée du label rennais <a href="http://www.spaghrecords.fr/" target="_blank"><strong>spaghrecords</strong></a> : <a href="https://soundcloud.com/monkeyanalow" target="_blank"><strong>monkey analow</strong></a> (‘<em>acid light</em>’ le 23 janvier) ; <a href="https://soundcloud.com/oilb" target="_blank"><strong>oil b.</strong></a> (‘<em>plume</em>’ le 25 février) ; le tout accompagné par <strong>Squatt.</strong>\r\n\r\n<iframe src="https://w.soundcloud.com/player/?url=http%3A%2F%2Fapi.soundcloud.com%2Ftracks%2F72736337" height="166" width="100%" frameborder="no" scrolling="no"></iframe>\r\n\r\n<iframe style="line-height: 1.714285714; font-size: 1rem;" src="https://w.soundcloud.com/player/?url=http%3A%2F%2Fapi.soundcloud.com%2Ftracks%2F76692205" height="166" width="100%" frameborder="no" scrolling="no"></iframe>\r\n\r\n<strong><a href="http://localhost:8888/wp-openfader/wp-content/uploads/2013/02/affiche_openfader_versatile_160313.png"><img class="alignright size-thumbnail wp-image-839" alt="Versatile, l''affiche - samedi 16 mars 2013 à l''ubu" src="http://localhost:8888/wp-openfader/wp-content/uploads/2013/02/affiche_openfader_versatile_160313-200x200.png" width="200" height="200" /></a>Versatile ?</strong> instable diront certains, lunatique diront d''autres de ce côté de l''Atlantique. Toujours est-il que la thématique de la soirée est dans la balance et les décors noir et blanc de <a href="http://www.size-fr.com/" target="_blank"><strong>Size</strong></a> en feront le pendant : une ambiance, vous l''aurez compris, complètement … <strong>Versatile.</strong>\r\n\r\n<em>(Dress code de rigueur)</em>\r\n<h2><em></em>INSERT INTO `wp_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES
(881, 1, '2013-08-31 15:18:53', '2013-08-31 15:18:53', '<h2><span style="font-size: 1rem; line-height: 1.714285714;"><img class="alignright size-full wp-image-883" alt="origami thumb" src="http://localhost:8888/wp-openfader/wp-content/uploads/2013/08/thumb.jpg" width="180" height="180" />Samedi 21 septembre 2013 @ UBU Club</span></h2>\r\n<ul>\r\n	<li><span style="line-height: 1.714285714; font-size: 1rem;"><strong>The Rogue Element</strong> (Lot49 / UK)</span></li>\r\n	<li><span style="line-height: 1.714285714; font-size: 1rem;"><strong>Crystal Distortion</strong> - Live (Spiral Tribe "Rave On" / UK)</span></li>\r\n	<li><span style="line-height: 1.714285714; font-size: 1rem;"><strong>OTAM</strong> (Open Fader / Rennes)</span></li>\r\n	<li><span style="line-height: 1.714285714; font-size: 1rem;"><strong>Katell</strong> (Open Fader / Rennes)</span></li>\r\n	<li><span style="line-height: 1.714285714; font-size: 1rem;"><strong>Brim</strong> (Rennes)</span></li>\r\n</ul>\r\n<!--more-->\r\n<h2>La soirée</h2>\r\n[caption id="attachment_888" align="alignleft" width="215"]<a href="http://localhost:8888/wp-openfader/wp-content/uploads/2013/08/affiche.jpg"><img class="size-medium wp-image-888" alt="Origami, l''affiche : samedi 21 septembre à l''Ubu" src="http://localhost:8888/wp-openfader/wp-content/uploads/2013/08/affiche-215x300.jpg" width="215" height="300" /></a> samedi 21 septembre à l''Ubu[/caption]\r\n\r\n<a href="https://soundcloud.com/therogueelement" target="_blank"><strong>THE ROGUE ELEMENT</strong></a>, producteur britannique primé aux International Breakbeat Awards, enchaîne les Ep seyants sur LOT 49. Le précurseur de la scène Old School Break anglaise <a href="https://soundcloud.com/lab51rat" target="_blank"><strong>CRYSTAL DISTORTION</strong></a> des Spiral Tribe, viendra nous hypnotiser par son live légendaire et unique. <strong>OTAM</strong>, nouveau venu chez les faders nous présentera son live electrobreak.\r\nLe transformiste <strong>BRIM</strong> ouvrira le bal sur des sonorités breakbeat. L''énergique <strong>KATELL</strong> se chargera de conclure la soirée sur un set Break to D n’B.\r\n<em>Groove and beat on !</em>\r\n\r\n<iframe src="https://w.soundcloud.com/player/?url=http%3A%2F%2Fapi.soundcloud.com%2Ftracks%2F96725489" height="166" width="100%" frameborder="no" scrolling="no"></iframe>\r\n\r\n<iframe src="https://w.soundcloud.com/player/?url=http%3A%2F%2Fapi.soundcloud.com%2Ftracks%2F93500069" height="166" width="100%" frameborder="no" scrolling="no"></iframe>\r\n<h2>Infos :</h2>\r\n<ul>\r\n	<li><span style="line-height: 1.714285714; font-size: 1rem;"><strong>15€</strong> membres Ubu et préventes au<em> bar Le Chantier</em> et <a title="ouvrir Ticketnet" href="http://www.ticketnet.fr/fr/manifestation/soiree-open-fader-origami-billet/idmanif/297417" target="_blank"><em>Tickenet</em></a> (hors frais/commissions)</span></li>\r\n	<li><span style="line-height: 1.714285714; font-size: 1rem;"><strong>17€</strong> sur place</span></li>\r\n</ul>\r\n<em>Ubu Club : 1 rue St Hélier, 35000 Rennes</em>\r\n<h2>Before <span style="line-height: 1.714285714; font-size: 1rem;">: </span></h2>\r\n<span style="line-height: 1.714285714; font-size: 1rem;"><strong>Vendredi 20 septembre</strong> au Bar <strong>le Scaramouche </strong><em>3 Bis r Duhamel\r\n</em>with <strong>Modul Club, Digital Windows, Open Fader</strong>\r\nEntrée libre &amp; gratuite\r\n\r\n</span><em id="__mceDel"><em id="__mceDel"><em id="__mceDel">(Places à gagner)</em></em></em>', 'Origami', '', 'publish', 'open', 'open', '', 'origami', '', '', '2013-09-17 17:57:26', '2013-09-17 17:57:26', '', 0, 'http://localhost:8888/wp-openfader/?p=881', 0, 'post', '', 0),
