(922, 1, '2014-01-07 22:21:24', '2014-01-07 22:21:24', '<h2>Samedi 1er février 2014</h2>\r\n<ul>\r\n	<li><span style="line-height: 1.714285714; font-size: 1rem;"><strong>Madben</strong> - Live - (<em>Astropolis Records</em>)</span></li>\r\n	<li><span style="line-height: 1.714285714; font-size: 1rem;"><strong>Do you copy ?</strong> - Live - (<em>Digital Window</em>)</span></li>\r\n	<li><span style="line-height: 1.714285714; font-size: 1rem;"><strong>Azano</strong> (<i>S''il Te Play )</i></span></li>\r\n	<li><span style="line-height: 1.714285714; font-size: 1rem;"><strong>Menthine</strong> (<em>Open Fader</em>)</span></li>\r\n</ul>\r\nPlus d''infos &amp; Billetterie en ligne !\r\n\r\n<!--more-->\r\n\r\n<a href="#billetterie">Aller à la billeterie</a>\r\n\r\nPour cette première soirée de l''année l''association ElectroPitch a décidé de chauffer le dancefloor et vous propose<a href="http://localhost:8888/wp-openfader/wp-content/uploads/2014/01/madben.jpg"><img class="alignleft size-full wp-image-923" alt="madben" src="http://localhost:8888/wp-openfader/wp-content/uploads/2014/01/madben.jpg" width="900" height="350" /></a> de prendre quelques couleurs à l''Ubu !\r\n\r\nRepéré par <strong>Laurent Garnier</strong> en 2010, Il signe depuis sur le label <a href="http://astropolis.org">Astropolis Record</a> avec le morceau "<em>We want to rave on</em>" . Il arpente et enflamme les dancefloors au delà des frontières… Le très talentueux <a href="http://madben.fr/"><strong>MADBEN</strong></a> viendra éveiller vos sens avec son  nouveau live. Des productions originales pour une envolée rythmique house et techno qui ne laissera personne indifférent.\r\n\r\n<iframe src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/40521656&amp;color=ff6600&amp;auto_play=false&amp;show_artwork=true" height="166" width="100%" frameborder="no" scrolling="no"></iframe>\r\n\r\nOuvrez vos mirettes pour <strong>DO YOU COPY ?</strong> (<em>Digital Window</em>), un collectif qui grimpe et vous présentera un set techno à consommer avec délectation.\r\n\r\n<iframe src="//www.youtube.com/embed/lnKWnhI1onw?rel=0" height="400" width="100%" allowfullscreen="" frameborder="0"></iframe>\r\n\r\nPour sa première scène Ubuesque, Open Fader propose à l''audacieux <strong>AZANO</strong> de vous faire partager sa passion de la musique à travers un DJ set electro / Tek minimal  dansant concocté aux petits "oignons" !\r\n\r\n<span style="line-height: 1.714285714; font-size: 1rem;">Vibrations techno et electro enivrante, </span><strong style="line-height: 1.714285714; font-size: 1rem;">MENTHINE</strong><span style="line-height: 1.714285714; font-size: 1rem;">, (</span><em style="line-height: 1.714285714; font-size: 1rem;">Open Fader</em><span style="line-height: 1.714285714; font-size: 1rem;">) présentera pour l''occasion des productions "</span><em style="line-height: 1.714285714; font-size: 1rem;">Menthe à l''Eau</em><span style="line-height: 1.714285714; font-size: 1rem;">", un partage sonore productif  pour un set original…. </span>\r\n\r\nVous n''avez plus qu''à vous laisser transporter par toute ces sonorités, ajoutez un zeste de bonne humeur, quelques pincées décoratives et c''est une excellente soirée mijotée avec soin qui s''offre à vous !\r\n<h2>Infos Pratiques</h2>\r\nPaf : <strong>13€ (</strong>100<strong> </strong>premières places au Chantier &amp; membres ubu)<strong> / 15€</strong> (hors frais de billeterie)\r\n<span style="line-height: 1.714285714; font-size: 1rem;">Bar Le Chantier : <em>18 carrefour Jouaust, Rennes</em>\r\n</span>\r\n\r\nUbu : 1 rue St Hélier à Rennes\r\n<a href="http://www.ubu-rennes.com/">http://www.ubu-rennes.com/</a>\r\n<h2>Pour vous mettre en appétit :</h2>\r\nBefore de la soirée avec <strong>E-Runner</strong> &amp; <strong>Clément Cordero</strong> au bar <strong>Le Scaramouche</strong>, le 31 janvier de 21h à 00h (gratuit)\r\n\r\nLe Scaramouche :  3 Rue Jean Marie Duhamel, 35000 Rennes\r\n<h2 id="billetterie">Billetterie en ligne</h2>\r\ne-billet à imprimer !\r\n\r\n<script type="text/javascript" src="https://www.weezevent.com/js/widget.js"></script><iframe id="weezuniq55330" src="https://www.weezevent.com/widget_billeterie.php?id_evenement=55330&amp;code=42261&amp;cas=1&amp;resize=1&amp;multi=0" height="600" width="100%" frameborder="0" scrolling="auto"></iframe>', '{Electric Party} Ubu Club', '', 'publish', 'open', 'open', '', 'electric-party-ubu', '', '', '2014-01-14 18:51:01', '2014-01-14 18:51:01', '', 0, 'http://localhost:8888/wp-openfader/?p=922', 0, 'post', '', 0),
(910, 0, '2013-11-21 04:38:17', '2013-11-21 04:38:17', 'Bonjour,\r\nauriez vous une adresse mail ou on peut vous contacter svp?\r\nMerci\n<!--more-->\nAUTHOR: anthonytoumalove@gmail.com\nAUTHOR EMAIL: anthonytoumalove@gmail.com\nAUTHOR URL: \nSUBJECT: [contact\nIP: 109.22.223.85\nArray\n(\n    [Nom] =&gt; \n    [email] =&gt; anthonytoumalove@gmail.com\n    [Message] =&gt; Bonjour,\r\nauriez vous une adresse mail ou on peut vous contacter svp?\r\nMerci\n)\n', 'anthonytoumalove@gmail.com - 2013-11-21 04:38:17', '', 'publish', 'open', 'open', '', 'eb992e5cec93677ae97fac83fcef4ede', '', '', '2013-11-21 04:38:17', '2013-11-21 04:38:17', '', 44, 'http://localhost:8888/wp-openfader/?post_type=feedback&p=910', 0, 'feedback', '', 0),
(958, 0, '2014-03-12 13:43:34', '2014-03-12 13:43:34', 'Bonjour,\r\nNous sommes Undergroove, un groupe de groove rennais.\r\nA l''occasion de la sortie de notre premier album (Rythmicotractable), nous organisons une soirée concert le 26 avril 2014 dans la salle de concert du 4bis à Rennes (35).\r\nN''hésitez pas à venir pour découvrir notre univers musical et scénique.\r\n\r\nPour plus d''informations sur le groupe, vous pouvez aussi visiter notre site www.undergroove.fr/ ou notre facebook www.facebook.com/undergroove.quartet\r\nMerci d''avance de votre intérêt,\r\n\r\nCordialement,\r\n\r\nMartin Capon (06 16 34 16 61) pour Undergroove\n<!--more-->\nAUTHOR: undergroove.bretagne@gmail.com\nAUTHOR EMAIL: undergroove.bretagne@gmail.com\nAUTHOR URL: \nSUBJECT: [contact\nIP: 2.10.9.17\nArray\n(\n    [Nom] =&gt; Martin Capon\n    [email] =&gt; undergroove.bretagne@gmail.com\n    [Message] =&gt; Bonjour,\r\nNous sommes Undergroove, un groupe de groove rennais.\r\nA l''occasion de la sortie de notre premier album (Rythmicotractable), nous organisons une soirée concert le 26 avril 2014 dans la salle de concert du 4bis à Rennes (35).\r\nN''hésitez pas à venir pour découvrir notre univers musical et scénique.\r\n\r\nPour plus d''informations sur le groupe, vous pouvez aussi visiter notre site www.undergroove.fr/ ou notre facebook www.facebook.com/undergroove.quartet\r\nMerci d''avance de votre intérêt,\r\n\r\nCordialement,\r\n\r\nMartin Capon (06 16 34 16 61) pour Undergroove\n)\n', 'undergroove.bretagne@gmail.com - 2014-03-12 13:43:34', '', 'publish', 'open', 'open', '', '6c5a27b2d7c4f0f797a5fcf18ea0c362', '', '', '2014-03-12 13:43:34', '2014-03-12 13:43:34', '', 44, 'http://localhost:8888/wp-openfader/?post_type=feedback&p=958', 0, 'feedback', '', 0),
(950, 1, '2014-01-14 22:49:55', '2014-01-14 22:49:55', '<h2>Des couleurs à l''ubu !</h2>\r\nPour cette première soirée de l''année l''association ElectroPitch a décidé de chauffer le dancefloor et vous propose de prendre quelques couleurs à l''Ubu !\r\n\r\n<img class="alignleft size-full wp-image-923" alt="madben" src="http://localhost:8888/wp-openfader/wp-content/uploads/2014/01/madben.jpg" />\r\n\r\nRepéré par <strong>Laurent Garnier</strong> en 2010, Il signe depuis sur le label <a href="http://astropolis.org">Astropolis Record</a> avec le morceau "<em>We want to rave on</em>" . Il arpente et enflamme les dancefloors au delà des frontières… Le très talentueux <a href="http://madben.fr/"><strong>MADBEN</strong></a> viendra éveiller vos sens avec son  nouveau live. Des productions originales pour une envolée rythmique house et techno qui ne laissera personne indifférent.\r\n\r\nOuvrez vos mirettes pour <strong>DO YOU COPY ?</strong> (<em>Digital Window</em>), un collectif qui grimpe et vous présentera un set techno à consommer avec délectation.\r\n\r\nPour sa première scène Ubuesque, Open Fader propose à l''audacieux <strong>AZANO</strong> de vous faire partager sa passion de la musique à travers un DJ set electro / Tek minimal  dansant concocté aux petits "oignons" !\r\n\r\nVibrations techno et electro enivrante, <strong>MENTHINE</strong> <em>(Open Fader)</em> présentera pour l''occasion des productions "<em>Menthe à l''Eau</em>", un partage sonore productif  pour un set original….\r\n\r\nVous n''avez plus qu''à vous laisser transporter par toute ces sonorités, ajoutez un zeste de bonne humeur, quelques pincées décoratives et c''est une excellente soirée mijotée avec soin qui s''offre à vous !\r\n\r\n<hr />\r\n\r\n<h2>Infos Pratiques</h2>\r\nPaf : <strong>13€ (</strong>100<strong> </strong>premières places au Chantier &amp; membres ubu)<strong> / 15€</strong> (hors frais de billeterie)\r\nBar Le Chantier : <em>18 carrefour Jouaust, Rennes</em>\r\n\r\nUbu : 1 rue St Hélier à Rennes <a href="http://www.ubu-rennes.com/">http://www.ubu-rennes.com/</a>\r\n\r\n<hr />\r\n\r\n<h2>Pour vous mettre en appétit :</h2>\r\nBefore de la soirée avec <strong>E-Runner</strong> &amp; <strong>Clément Cordero</strong> au bar <strong>Le Scaramouche</strong>, le 31 janvier de 21h à 00h (gratuit)\r\n\r\nLe Scaramouche :  3 Rue Jean Marie Duhamel, 35000 Rennes', 'electric party', '', 'publish', 'open', 'open', '', 'electric-party', '', '', '2014-01-14 23:11:23', '2014-01-14 23:11:23', '', 0, 'http://localhost:8888/wp-openfader/?page_id=950', 0, 'page', '', 0),
