(955, 0, '2014-02-01 18:28:53', '2014-02-01 18:28:53', 'Bonjour,\r\n\r\nj''espère que vous lirez ce message ce soir, puisque j''ai un gros problème. J''avais acheté deux places pour ce soir, et sans faire exprès, j''ai téléchargé une place 2 fois, au lieu de télécharger les deux.. Résultat, je me retrouve avec 2 mêmes places mais pas avec l''autre et je ne sais pas du tout comment faire pour l''avoir vu que je l''ai pas reçu par mail.\r\nS''il vous plait aidez moi dès que vous pourrez ! Voici mon numéro (vous pouvez aussi répondre par mail) : 06 61 55 70 49\r\nMerci\r\n\r\nCordialement\r\nKamila França\n<!--more-->\nAUTHOR: kamilafranca@hotmail.fr\nAUTHOR EMAIL: kamilafranca@hotmail.fr\nAUTHOR URL: \nSUBJECT: [contact\nIP: 82.236.143.77\nArray\n(\n    [Nom] =&gt; FRANCA\n    [email] =&gt; kamilafranca@hotmail.fr\n    [Message] =&gt; Bonjour,\r\n\r\nj''espère que vous lirez ce message ce soir, puisque j''ai un gros problème. J''avais acheté deux places pour ce soir, et sans faire exprès, j''ai téléchargé une place 2 fois, au lieu de télécharger les deux.. Résultat, je me retrouve avec 2 mêmes places mais pas avec l''autre et je ne sais pas du tout comment faire pour l''avoir vu que je l''ai pas reçu par mail.\r\nS''il vous plait aidez moi dès que vous pourrez ! Voici mon numéro (vous pouvez aussi répondre par mail) : 06 61 55 70 49\r\nMerci\r\n\r\nCordialement\r\nKamila França\n)\n', 'kamilafranca@hotmail.fr - 2014-02-01 18:28:53', '', 'publish', 'open', 'open', '', 'd5179b69078c4f767e6148db3edc89ea', '', '', '2014-02-01 18:28:53', '2014-02-01 18:28:53', '', 44, 'http://localhost:8888/wp-openfader/?post_type=feedback&p=955', 0, 'feedback', '', 0),
(956, 0, '2014-02-04 17:14:27', '2014-02-04 17:14:27', 'Salut à tous ! \r\nUn petit message pour encore vous remercier pour cette excellente soirée.\r\nJe crois que tout le monde était content ! \r\nJe récupère les rush à droite à gauche des différents films/photos tournés sur place. Cela prend un peu de temps car ce sont de gros fichiers et les copains sont tout sauf réactifs.\r\nMis à part ça, j''aurai besoin des Records de la soirée. Comme je ne suis pas à Rennes ça va être dur de me les filer en physique. Donc si une âme charitable peut m''envoyer ça via Dropbox ou autre ça sera avec grand plaisir. Pas de son, pas de montage ! Les images tabassent, elles sont un peu sombres pour certaines mais c''est grunge donc c''est cool.\r\n\r\nConcernant votre prochaine soirée, contactez moi pour qu''on voit ensembles comment être encore plus au top pour la capta.\r\n\r\nMerci encore de la part de tout le monde.\r\nNico\n<!--more-->\nAUTHOR: lemee.nicolas@gmail.com\nAUTHOR EMAIL: lemee.nicolas@gmail.com\nAUTHOR URL: \nSUBJECT: [contact\nIP: 82.232.66.136\nArray\n(\n    [Nom] =&gt; Nico de Digital Window\n    [email] =&gt; lemee.nicolas@gmail.com\n    [Message] =&gt; Salut à tous ! \r\nUn petit message pour encore vous remercier pour cette excellente soirée.\r\nJe crois que tout le monde était content ! \r\nJe récupère les rush à droite à gauche des différents films/photos tournés sur place. Cela prend un peu de temps car ce sont de gros fichiers et les copains sont tout sauf réactifs.\r\nMis à part ça, j''aurai besoin des Records de la soirée. Comme je ne suis pas à Rennes ça va être dur de me les filer en physique. Donc si une âme charitable peut m''envoyer ça via Dropbox ou autre ça sera avec grand plaisir. Pas de son, pas de montage ! Les images tabassent, elles sont un peu sombres pour certaines mais c''est grunge donc c''est cool.\r\n\r\nConcernant votre prochaine soirée, contactez moi pour qu''on voit ensembles comment être encore plus au top pour la capta.\r\n\r\nMerci encore de la part de tout le monde.\r\nNico\n)\n', 'lemee.nicolas@gmail.com - 2014-02-04 17:14:27', '', 'publish', 'open', 'open', '', 'aa2e66f04bba351c00d4ea7ee8c390ef', '', '', '2014-02-04 17:14:27', '2014-02-04 17:14:27', '', 44, 'http://localhost:8888/wp-openfader/?post_type=feedback&p=956', 0, 'feedback', '', 0),
(960, 1, '2014-04-06 16:30:14', '2014-04-06 16:30:14', '<h2><a href="http://localhost:8888/wp-openfader/wp-content/uploads/2014/04/DSC_5283.jpg"><img class="aligncenter size-full wp-image-969 img-responsive" alt="DSC_5283" src="http://localhost:8888/wp-openfader/wp-content/uploads/2014/04/DSC_5283.jpg" width="1000" height="668" /></a></h2>\r\n<h2><span style="line-height: 1.5em;">La soirée</span></h2>\r\n\r\n<hr />\r\n\r\nPour cette édition printanière,  <strong>ElectroPitch</strong> remet le couvert à l’<a href="http://www.ubu-rennes.com/">Ubu</a> pour une nouvelle soirée <strong>Open Fader</strong>, <em>édition spéciale</em> puisque l’association fête ses 10 ans ! Qui dit évènement exceptionnel dit plateau de 1er choix : amis ravers et clubeuses soyez donc prêts et en forme le <strong>26 avril</strong> prochain ! A l’honneur tout d’abord, <strong>Darijade</strong>, notre résident ! Deux invités de talent, <strong>La Denrée</strong> pour un set house de première nécessité <iframe src="//www.mixcloud.com/widget/iframe/?feed=http%3A%2F%2Fwww.mixcloud.com%2Fensemblevide%2Fastropolis-mixtape-2014%2F&amp;embed_uuid=dec3ebcb-39d4-4927-9b30-27f52887b5fb&amp;replace=0&amp;hide_cover=1&amp;embed_type=widget_standard&amp;hide_tracklist=1" height="180" width="100%" frameborder="0"></iframe>\r\n\r\n<a href="https://soundcloud.com/modul-club"><strong>Modul Club</strong></a> pour un live explosif et clôturer la soirée !\r\n\r\n[soundcloud url="https://api.soundcloud.com/tracks/124682894" params="auto_play=false&amp;hide_related=false&amp;visual=true" width="100%" height="300" iframe="true" /]\r\n\r\n&nbsp;\r\n\r\nCerise sur le gâteau, l''asso fait la connexion avec Manchester et invite <a href="https://soundcloud.com/ben-pearce-productions"><strong>Ben Pearce</strong></a> boss du label <a href="http://purpsoul.com/">Purp &amp; Soul</a> !\r\n\r\n<iframe src="//www.youtube.com/embed/FcKzmy02Kpo?rel=0" height="425" width="100%" allowfullscreen="" frameborder="0"></iframe>\r\n<h2>Infos Pratiques</h2>\r\n\r\n<hr />\r\n\r\n<ul>\r\n	<li>Tarif réduit : <strong>15€</strong>, 50 places, préventes bar <em>le Chantier, 18 Carrefour Jouaust, Rennes</em></li>\r\n	<li>Tarif Normal (préventes et sur place) : <strong>17€</strong> (hors frais de location)</li>\r\n</ul>\r\n<strong>Où acheter des places ?</strong>\r\n<ul>\r\n	<li>Au Bar le Chantier, 18 Carrefour Jouaust, Rennes</li>\r\n	<li>Sur le Réseau <a href="http://www.digitick.com/">Digitick</a></li>\r\n</ul>\r\n<h2>Befores :</h2>\r\n\r\n<hr />\r\n\r\n<ul>\r\n	<li>Au <strong>Bar''Hic</strong> vendredi 25 avril de 00h à 03h\r\n<em>Menthine &amp; Fat Freddy</em></li>\r\n	<li>Au <strong>Chantier</strong> samedi 26 avril de 21h à 00h\r\n<em>Clément Cordeiro &amp; Télémak</em></li>\r\n</ul>\r\n<iframe width="100%" height="180" src="//www.mixcloud.com/widget/iframe/?feed=http%3A%2F%2Fwww.mixcloud.com%2Fmenthine%2Fmondays-mix%2F&amp;embed_uuid=670f55d4-78c3-4950-a3f4-776b2dd9f9c0&amp;replace=0&amp;hide_cover=1&amp;embed_type=widget_standard&amp;hide_tracklist=1" frameborder="0"></iframe>', 'Hello Birthday Party Time', '', 'publish', 'open', 'open', '', 'hello-birthday-party', '', '', '2014-04-15 19:00:19', '2014-04-15 19:00:19', '', 0, 'http://localhost:8888/wp-openfader/?page_id=960', 0, 'page', '', 0),
