(974, 0, '2014-04-09 14:49:12', '2014-04-09 14:49:12', 'Bonjour, \r\nOu peut on acheter des billets pour la soirée du 26 avril ?\r\nJe ne trouve la soirée sur digitick ni sur ticketnet ?\r\n\r\nPas avance merci\r\n\r\nDavid\n<!--more-->\nAUTHOR: pivdav@gmail.com\nAUTHOR EMAIL: pivdav@gmail.com\nAUTHOR URL: \nSUBJECT: [contact\nIP: 80.10.159.202\nArray\n(\n    [Nom] =&gt; David Ison\n    [email] =&gt; pivdav@gmail.com\n    [Message] =&gt; Bonjour, \r\nOu peut on acheter des billets pour la soirée du 26 avril ?\r\nJe ne trouve la soirée sur digitick ni sur ticketnet ?\r\n\r\nPas avance merci\r\n\r\nDavid\n)\n', 'pivdav@gmail.com - 2014-04-09 14:49:12', '', 'publish', 'open', 'open', '', '896cd2a1d884e638bd3282c77407dc08', '', '', '2014-04-09 14:49:12', '2014-04-09 14:49:12', '', 44, 'http://localhost:8888/wp-openfader/?post_type=feedback&p=974', 0, 'feedback', '', 0),
(978, 1, '2015-01-10 15:54:04', '2015-01-10 15:54:04', '<h2>La programmation</h2>\r\n<img class="img-thumbnail alignright wp-image-1001 size-thumbnail" src="http://localhost:8888/wp-openfader/wp-content/uploads/2015/01/KOMPAKT.FM-_-Reinhard-Voigt5iXt7CiH3jMD-original-200x200.jpg" alt="KOMPAKT.FM _ Reinhard Voigt5iXt7CiH3jMD-original" width="200" height="200" />Pour cette date un peu particulière, <strong>Open Fader</strong> met du cœur à l’ouvrage  !!\r\n\r\nNotre atout, <em>cœur</em>, bien évidemment, <strong>Reinhard Voigt</strong>, pour ses lives électro à couper le souffle. Son label, <strong>Kompakt</strong>, niche de sons et d''artistes toujours en ébullition ; à voir absolument !!\r\n\r\nLui aussi y met <em>du cœur</em>, <strong>F.E.M.</strong>, talentueux producteur techno du collectif <strong>Social Afterwork</strong> viendra nous régaler les oreilles. À découvrir, les multiples morceaux parus sur KMS, Bluelephant et bien d''autres!\r\n\r\nUn autre <em>coup de cœur</em> : <strong>Yann Lean</strong>, dj et producteur. Il a collaboré pour plusieurs morceaux aux côté de <strong>Madben</strong>, mais également différents projets pour <strong>F.E.M.\r\n</strong> Plus récemment, il a sortie son premier EP sur <strong>KMS Records</strong> (Yokasoï) !\r\nÀ venir découvrir si ce n''est pas encore fait !\r\n\r\n<strong>Menthine</strong> &amp; <strong>Darijade</strong>, <em>au cœur</em> des faders, viendront présenter leur dernier projet !\r\n<h2>Les infos pratiques</h2>\r\n<ul>\r\n	<li><strong>13€</strong> membre Admit</li>\r\n	<li><strong>15€</strong> en prévente (hors frais de location)</li>\r\n	<li><strong>17€</strong> sur place</li>\r\n</ul>\r\nPréventes disponibles en ligne ou au bar Le Chantier (18 carrefour Jouaust à Rennes)\r\n\r\nUbu club : 1, rue St Hélier, 35000 Rennes\r\n<iframe style="border: 0;" src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2664.115376545895!2d-1.6728670000000112!3d48.10801!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x480ede4ab549957d%3A0xfc80ffddb3eb3f65!2sUbu!5e0!3m2!1sfr!2sfr!4v1420932497658" width="100%" height="200" frameborder="0"></iframe>\r\n<h2>La before</h2>\r\nUne before se tiendra le soir même au Bar Le Chantier (18 carrefour Jouaust à Rennes)\r\n<h2 id="billeterie">La billeterie</h2>\r\n<a class="weezevent-widget-integration" title="Logiciel billetterie en ligne" href="http://www.weezevent.com//?c=sys_widget" target="_blank" data-src="https://www.weezevent.com/widget_billeterie.php?id_evenement=95711&amp;code=43417&amp;resize=1&amp;color_primary=e66e5e" data-width="100%" data-height="600" data-id="95711" data-resize="1" data-noscroll="0" data-nopb="0">Billetterie Weezevent</a><script src="https://www.weezevent.com/js/widget/min/widget.min.js" type="text/javascript"></script>', 'Love', '', 'publish', 'open', 'open', '', 'home', '', '', '2015-01-10 23:32:39', '2015-01-10 23:32:39', '', 0, 'http://localhost:8888/wp-openfader/home/', -1, 'page', '', 0),
