onfirme avec cette nouvelle salve de titres un style corrosif bien assumé (...). N''est pas Sale Gosse qui veut, lui y arrive avec brio." \r\n(l''intégralité de l''article en PJ)\r\n\r\n\r\n\r\n\r\n* Longueur d''Ondes (février 2013) : "Troisième album pour cet énergumène qui sait soulever les salles avec ses chansons tubesques qui se fredonnent dès le deuxième refrain."\r\n\r\n\r\nJe reste à votre entière disposition pour tous renseignements complémentaires .\r\n\r\n \r\nbonne réception \r\ncordialement \r\n \r\n\r\n\r\n Béatrice Mochel \r\npresse pour Jules \r\n06 80 84 01 80\r\n \r\n \r\n \r\n pour \r\nb.a.b &amp; b.a.p\r\nTél : +33 (0)1 46 06 29 26\r\nwww.beatriceadnotbooking.com\r\n\r\n\r\n \n)\n', 'mochel.beatrice@orange.fr - 2013-07-09 08:10:52', '', 'publish', 'open', 'open', '', '0fd552258481140c7b0cd2d3fb394adb', '', '', '2013-07-09 08:10:52', '2013-07-09 08:10:52', '', 44, 'http://localhost:8888/wp-openfader/?post_type=feedback&p=873', 0, 'feedback', '', 0),
(849, 1, '2013-06-02 18:54:56', '2013-06-02 18:54:56', '<img class="size-thumbnail wp-image-850 alignright" alt="size_0613" src="http://localhost:8888/wp-openfader/wp-content/uploads/2013/06/size_0613-200x200.jpg" width="200" height="200" />\r\n\r\n<strong>Size</strong>, <strong>Open fader</strong> et <strong>Réservoirsons</strong> remettent le couvert et vous proposent une nouvelle fois un <a href="http://www.jardinmoderne.org/" target="_blank">Jardin Moderne</a> customisé avec toujours la même volonté : une programmation musicale riche et l’envie à chaque fois de créer un univers festif différent mêlant technique et esthétisme. Artistes locaux et internationaux viendront faire vibrer les dancefloors et égayer l’ensemble de vos sens.\r\n<h2><span style="font-size: 1.285714286rem; line-height: 1.6;">// 3 SCÈNES dont 1 extérieure//</span></h2>\r\n<ul>\r\n	<li><span style="line-height: 1.714285714; font-size: 1rem;">DANDI &amp; UGO (Italo business/IT)</span></li>\r\n	<li><span style="line-height: 1.714285714; font-size: 1rem;">DAVE THE DRUMMER (Hydraulix rec/UK)</span></li>\r\n	<li><span style="line-height: 1.714285714; font-size: 1rem;">MARIANO SANTOS (Santos recording/ARG)</span></li>\r\n	<li><span style="line-height: 1.714285714; font-size: 1rem;">ITZAIA (Bigpunch/ANDORRE) </span></li>\r\n	<li><span style="line-height: 1.714285714; font-size: 1rem;">TRYSH (Italo business/FR)</span></li>\r\n	<li><span style="line-height: 1.714285714; font-size: 1rem;">AXONES (Bequem digital rec/FR)</span></li>\r\n	<li><span style="line-height: 1.714285714; font-size: 1rem;">AZANO vs PAMARAN (S’il te play/Midweek)</span></li>\r\n	<li><span style="line-height: 1.714285714; font-size: 1rem;">RE.SET vs FAT FREDDY (Size)</span></li>\r\n	<li><span style="line-height: 1.714285714; font-size: 1rem;">SQUATT (Open Fader)</span></li>\r\n	<li><span style="line-height: 1.714285714; font-size: 1rem;">BAM! (Size)</span></li>\r\n	<li><span style="line-height: 1.714285714; font-size: 1rem;">BRIM (Open Fader)</span></li>\r\n	<li><span style="line-height: 1.714285714; font-size: 1rem;">Video mapping by IVORY</span></li>\r\n</ul>\r\n<!--more-->\r\n<p style="text-align: center;"><a href="http://localhost:8888/wp-openfader/wp-content/uploads/2013/06/size_0613.jpg"><img class="aligncenter size-full wp-image-850" alt="size_0613" src="http://localhost:8888/wp-openfader/wp-content/uploads/2013/06/size_0613.jpg" width="500" height="704" /></a></p>\r\n<strong><span style="line-height: 1.714285714; font-size: 1rem;">DANDI &amp; UGO (Italo business/IT)</span></strong>\r\nLe duo Dandi &amp; Ugo est né d''une amitié forte et une grande passion pour la musique techno. Après une décennie de DJ sets, ils décident de passer à la production et commence donc une nouvelle aventure en enregistrant des morceaux sur des prestigieux labels italiens. Ils remportent un large succès et travaillent ensuite avec des artistes tel que Richie Hawtin / Len Faki et bien d''autres. En 2006, en collaboration avec Alessandro Piatto (NOIA / Klein &amp; MBO), ils décident d''ouvrir leur propre label. C’est la naissance d’ ITALO BUSINESS RECORDS.\r\n<a href="http://www.facebook.com/l.php?u=https%3A%2F%2Fsoundcloud.com%2Fdjdandieugo&amp;h=iAQH5DajM&amp;s=1" target="_blank" rel="nofollow nofollow">https://soundcloud.com/djdandieugo</a>\r\n\r\n<strong>MARIANO SANTOS (Santos recording/ARG)</strong>\r\nDj &amp; Producer, propriétaire de ses propres labels: Santos Recordings, MCS Records, MK01 Records et VOL0101 Records, il anime l’émission hebdomadaire «Nightbeat » où il est entendu dans plus de 70 stations de radio et les sites de musique à travers le monde. Il a également plus de 50 productions éditées, des titres originaux et remixés pour plus de 25 labels différents. Dj globe-trotteur, ses productions Tech-House ont atteint des sommets.\r\n<a href="http://www.facebook.com/l.php?u=http%3A%2F%2Fwww.mixcloud.com%2Fmarianosantos%2F&amp;h=MAQG2yJyK&amp;s=1" target="_blank" rel="nofollow nofollow">http://www.mixcloud.com/marianosantos/</a>\r\n\r\n<strong>DAVE THE DRUMMER (Hydraulix rec/UK)</strong>\r\nTout les amoureux de la musique techno seront probablement tombés sur des productions de ce londonien propriétaire du label « Hydraulix ». Il est l’un des principaux producteurs de son acid techno de Londres dans le milieu des années 90. Fin technicien des platines, DJ innovant, il joue aujourd''hui une techno funky groovy des plus explosifs !\r\n<a href="http://www.facebook.com/l.php?u=https%3A%2F%2Fsoundcloud.com%2Fdave-the-drummer&amp;h=cAQGwWPpZ&amp;s=1" target="_blank" rel="nofollow nofollow">https://soundcloud.com/dave-the-drummer</a>\r\n\r\n<strong>ITZAIA (Bigpunch/AD)</strong>\r\nCe qu’aime par-dessus tout Itzaia ? Contempler le dancefloor s’animer au rythme de ses dj sets. influencées par les sons tech-house, techno, minimal, ses compositions et ses mixs n’ont que cette même et unique vocation.\r\n<a href="http://www.facebook.com/l.php?u=https%3A%2F%2Fsoundcloud.com%2Fitzaia&amp;h=IAQFg6VL4&amp;s=1" target="_blank" rel="nofollow nofollow">https://soundcloud.com/itzaia</a>\r\n\r\n<strong>TRYSH (Italo business/FR)</strong>\r\nDj/Producer, ces premiers mix sortent de l''ombre grâce a l''association RESERVOIRSONS. Il a pu notamment jouer au coter de Flex, Hacler &amp; Kuch, Noisebuilder, D''jamency, Noob, Modul club .... Ces premières productions apparaissent sur le label Auramirror a l''été 2012, soutenue par les djs Flex, Ugo, Ross Alexander ou A.paul. Une affaire à suivre de très prêts !\r\n<a href="http://www.facebook.com/l.php?u=https%3A%2F%2Fsoundcloud.com%2Ftrysh-trysh&amp;h=fAQGXah3z&amp;s=1" target="_blank" rel="nofollow nofollow">https://soundcloud.com/trysh-trysh</a>\r\n\r\n<strong>AXONES (Bequem digital rec/FR)</strong>\r\nConnu aussi sous le nom de MOMO, AXONES est membre du collectif RESERVOIRSONS, il participe à l''organisation des soirées SIZE sur Rennes. Après plusieurs années de dijing il se met à la production pour sortir ses premiers EPs sur les labels SUBWOOFER RECORD, BEQUEM DIGITAL et ROUGHRABBIT RECORDING. Fan de rythmique et ligne de basse solide, sa Techno se définit puissante et dynamique!\r\n<a href="https://soundcloud.com/axones" target="_blank" rel="nofollow nofollow">https://soundcloud.com/axones</a>\r\n\r\n<span style="line-height: 1.714285714; font-size: 1rem;">Mise en scène et vidéo performance : <strong>IVORY &amp; SIZE</strong></span>\r\n<strong style="line-height: 1.714285714; font-size: 1rem;"></strong>\r\n<h2>// DRESS CODE : Les Super-Héros //</h2>\r\n<h2>// TARIFS et POINTS DE VENTES //</h2>\r\n<ul>\r\n	<li><span style="line-height: 1.714285714; font-size: 1rem;">15 euros - préventes réseau ticketnet et bar le Chantier</span></li>\r\n	<li><span style="line-height: 1.714285714; font-size: 1rem;">18 euros - sur place</span></li>\r\n</ul>\r\n<h2><span style="line-height: 1.714285714; font-size: 1rem;">// PARTENAIRES //</span></h2>\r\n<span style="line-height: 1.714285714; font-size: 1rem;">Jardin Moderne / Canal B / Wik / La cité du son / Electro news / La cave délices / Bar le Chantier / Urban expression</span>', 'Super Size @ Jardin Moderne - samedi 15 juin 2013', '', 'publish', 'open', 'open', '', '849', '', '', '2013-06-02 19:02:08', '2013-06-02 19:02:08', '', 0, 'http://localhost:8888/wp-openfader/?p=849', 0, 'post', '', 0),
