(874, 0, '2013-07-09 08:10:58', '2013-07-09 08:10:58', 'Mochel \r\npresse pour Jules \r\n06 80 84 01 80\r\n \r\net pour \r\nb.a.b &amp; b.a.p\r\nTél : +33 (0)1 46 06 29 26\r\nwww.beatriceadnotbooking.com\r\n\r\n \r\n\r\n\r\nBonjour \r\n \r\nje me permets de vous envoyer ce mail afin de vous présenter Jules et le vilain orchestra  .\r\nJ''en suis l'' attachée de presse et je viens vous demander de bien vouloir si possible  annoncer leur passage  \r\nen concert  au TRANSAT EN VILLE DE RENNES LE SAMEDI 13 JUILLET 2013\r\n \r\n \r\nJules souhaiterait vous accorder  un reportage , une interview ,   un message de sa venue dans votre région  ce qui  l'' aiderait à se faire connaître un peu plus  ..\r\nde diffuser cette information si possible ...\r\n Jules et ses  6  musiciens "le vilain Orchestra  font  partie des deux gagnants du tremplin du FESTIDREUZ  2013 qui s'' est déroulé le 6 juillet dernier à FOUESNANT dans le Finistère \r\nils  ont remporté un franc succès .\r\n \r\n\r\nJules &amp; le Vilain Orchestra :  Quelque part à la croisée du rock et de la chanson française. Le Sale Gosse, nouvel opus de Jules, est nourri par une folle légèreté. On découvre un album bien mûr, mais surtout pas mature.  Décidément « variété alternative », Jules et le Vilain Orchestra remettent au goût du jour le titre bien senti, qu’ on fredonnera encore dans plusieurs décennies. A nouvel album, nouveau spectacle : le  one man song d ’hier devient le big band d ’aujourd’hui !  Vous verrez,  Jules ne manque pas d’ humour, ça\r\nc’est certain. Il est un VRAI chanteur populaire, et on adore ça !\r\nAvec notamment « Thérèse », il a conquis le public du Tremplin Festidreuz 2013\r\n \r\n\r\n \r\n\r\n\r\n  \r\n \r\n Voici ci-dessous les infos et actus de notre artiste Jules.\r\n \r\nN''hésitez pas à visionner son EPK  qui donne un bon avant-goût de Jules sur scène, ainsi que son dernier clip :)\r\nJules Officiel \r\nC’ était mal barré. Tout petit, Jules est déjà vieux.\r\n Quand les filles de l’ école se  trémoussent sur les tubes pop des 80’s, lui fume la pipe en se passant les disques de Serge Reggiani, Jacques Brel, Nino Ferrer, Bob Dylan, Renaud ou Goldman.\r\n La spirale de la défaite est enclenchée, impossible...\r\n\r\n\r\nVous trouverez également des infos directement sur notre site http://www.beatriceadnotbooking.com/PageJules.html (textes de présentation, bio "rigolote", vidéos, sons...)\r\n\r\n\r\nEt voici les photos, lien Dropbox ci-dessous dans lequel vous trouverez :\r\n- Deux photos de Jules tout seul\r\n- Une photo de lui + 3 musiciens\r\n \r\nPour les télécharger dans la bonne définition, cliquez sur le rouage en haut à droite du lien.\r\n\r\n\r\nhttps://www.dropbox.com/sh/zddnbhk2to7pw1f/33Ibh2W91N\r\n\r\n\r\n\r\nJULES - Variété alternative \r\nAprès avoir été L’homme le plus fort du monde avec son précédent album, Jules revient faire des étincelles sur scène. \r\nEt ça tombe bien car c’est sur scène que ce Sale Gosse prend sa véritable dimension. \r\nLe fougueux jeune homme s’y révèle être un véritable showman, alliant l’énergie du rock au phrasé caressant. Un puncheur qui a aussi de la gouaille à revendre, une écriture sans fioriture, et ce qu’il faut d’humour et d’autodérision. Jubilatoire !\r\n \r\nhttp://www.beatriceadnotbooking.com/PageJules.html\r\nhttp://www.julesofficiel.com/\r\n\r\n\r\n\r\n\r\n* Nouvel album "Le Sale Gosse" - sorti le 4 mars (Polychrone/Socadisc)\r\nPour écouter :  http://www.beatriceadnotbooking.com/PageJules.html\r\n\r\n\r\n* Pour le découvrir , le lien de son EPK : http://youtu.be/luemiwltyf8\r\n\r\n\r\n* Clip du single "Mal barré" : http://youtu.be/CsZ01BhA4s8 \r\n\r\n\r\n* Il sera au Café de la Danse à Paris le 16 novembre 2013.\r\n\r\n\r\n\r\n\r\n\r\n\r\nLes médias en parlent : \r\n* Rock &amp; Folk (avril 2013) : "Son troisième album assume ouvertement ses influences chanson et ses textes pleins de verve tout en les confrontant à une musicalité exigeante et tonique."\r\n\r\n\r\n* La Montagne (mai 2013) - en 1ère partie des Tistics/les Franglaises à La 2Deuche (Lempdes - 63) :\r\n Devant une salle pleine, une première partie avec une révélation, Jules. Pétillant, gouailleur, drôle, le chanteur distille avec de belles mimiques des textes bien ficelés. Il a su chauffé la salle, seulement avec un guitariste, juste à un très très bon niveau. Retenez ce prénom..."\r\n(l''intégralité de l''article en PJ).\r\n\r\n\r\n* Francofans (février/mars 2013) : "C''est drôle, percutant, touchant car mis en musique avec beaucoup d''ingéniosité (...). Jules confirme avec cette nouvelle salve de titres un style corrosif bien assumé (...). N''est pas Sale Gosse qui veut, lui y arrive avec brio." \r\n(l''intégralité de l''article en PJ)\r\n\r\n\r\n\r\n\r\n* Longueur d''Ondes (février 2013) : "Troisième album pour cet énergumène qui sait soulever les salles avec ses chansons tubesques qui se fredonnent dès le deuxième refrain."\r\n\r\n\r\nJe reste à votre entière disposition pour tous renseignements complémentaires .\r\n\r\n \r\nbonne réception \r\ncordialement \r\n \r\n\r\n\r\n Béatrice Mochel \r\npresse pour Jules \r\n06 80 84 01 80\r\n \r\n \r\n \r\n pour \r\nb.a.b &amp; b.a.p\r\nTél : +33 (0)1 46 06 29 26\r\nwww.beatriceadnotbooking.com\n<!--more-->\nAUTHOR: mochel.beatrice@orange.fr\nAUTHOR EMAIL: mochel.beatrice@orange.fr\nAUTHOR URL: \nSUBJECT: [contact\nIP: 88.173.43.240\nArray\n(\n    [Nom] =&gt; MOCHEL BEATRICE PRESSE POUR JULES ET LE VO \n    [email] =&gt; mochel.beatrice@orange.fr\n    [Message] =&gt; Mochel \r\npresse pour Jules \r\n06 80 84 01 80\r\n \r\net pour \r\nb.a.b &amp; b.a.p\r\nTél : +33 (0)1 46 06 29 26\r\nwww.beatriceadnotbooking.com\r\n\r\n \r\n\r\n\r\nBonjour \r\n \r\nje me permets de vous envoyer ce mail afin de vous présenter Jules et le vilain orchestra  .\r\nJ''en suis l'' attachée de presse et je viens vous demander de bien vouloir si possible  annoncer leur passage  \r\nen concert  au TRANSAT EN VILLE DE RENNES LE SAMEDI 13 JUILLET 2013\r\n \r\n \r\nJules sou