onfirme avec cette nouvelle salve de titres un style corrosif bien assumé (...). N''est pas Sale Gosse qui veut, lui y arrive avec brio." \r\n(l''intégralité de l''article en PJ)\r\n\r\n\r\n\r\n\r\n* Longueur d''Ondes (février 2013) : "Troisième album pour cet énergumène qui sait soulever les salles avec ses chansons tubesques qui se fredonnent dès le deuxième refrain."\r\n\r\n\r\nJe reste à votre entière disposition pour tous renseignements complémentaires .\r\n\r\n \r\nbonne réception \r\ncordialement \r\n \r\n\r\n\r\n Béatrice Mochel \r\npresse pour Jules \r\n06 80 84 01 80\r\n \r\n \r\n \r\n pour \r\nb.a.b &amp; b.a.p\r\nTél : +33 (0)1 46 06 29 26\r\nwww.beatriceadnotbooking.com\r\n\r\n\r\n \n)\n', 'mochel.beatrice@orange.fr - 2013-07-09 08:10:58', '', 'publish', 'open', 'open', '', '28ac017396b76312b0c1625a332b8279', '', '', '2013-07-09 08:10:58', '2013-07-09 08:10:58', '', 44, 'http://localhost:8888/wp-openfader/?post_type=feedback&p=874', 0, 'feedback', '', 0),
